INSERT INTO `news` VALUES (_binary '',2,'2024-10-11 15:17:17.330343',2,7,'2024-12-06 21:15:27.427114',133,2,'2024-11-03 21:58:48.967422','https://res.cloudinary.com/dztroerja/video/upload/v1730795662/news-2_dsgpvf.mp3','<p>Anh Phạm Quang Linh - người sáng lập \"Quang Linh Vlogs - Cuộc sống châu Phi\", được hiệp thương là một trong 397 ủy viên Mặt trận Tổ quốc Việt Nam, sáng 18/10.</p><p>\"Đây là vinh dự lớn lao mà bản thân tôi chưa từng nghĩ đến. Tôi sẽ cố gắng hơn nữa làm tốt công tác xã hội, hỗ trợ cộng đồng, xây dựng hình ảnh đất nước Việt Nam ở nước ngoài để không phụ lòng tin tưởng của mọi người\", anh Linh nói.</p><figure class=\"image\"><img style=\"aspect-ratio:1020/686;\" src=\"https://i1-vnexpress.vnecdn.net/2024/10/18/5cb325171185a8dbf194-172924721-4769-5927-1729248897.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=FQpXtZLtBhNCYHFT0WTVbA\" width=\"1020\" height=\"686\"></figure><p>Phạm Quang Linh tham dự Đại hội đại biểu Mặt trận Tổ quốc Việt Nam, sáng 18/10. Ảnh: Hoàng Phong</p><p>Phạm Quang Linh 27 tuổi, quê Nghi Lộc, tỉnh Nghệ An. Năm 2016, học hết phổ thông, Linh sang Angola, quốc gia miền trung châu Phi, làm thợ xây theo diện xuất khẩu lao động. Sau thời gian làm việc tại các công trình xây dựng ở thành phố, anh tiết kiệm, mở xưởng làm nước đá ở thủ đô Luanda.</p><p>Một dịp lễ, nhóm của Linh đến làng Sanzala, chứng kiến cuộc sống thiếu thốn của người dân tại đây, anh bỏ tiền tổ chức những bữa ăn không đồng, phát gạo, nhu yếu phẩm hỗ trợ họ. Anh lập kênh YouTube Quang Linh Vlogs, chia sẻ về cuộc sống và hoạt động thiện nguyện ở châu Phi, nhận được nhiều quan tâm.</p><p>Khi xưởng đá ăn nên làm ra và kênh YouTube tạo lợi nhuận, Linh lập nhóm 9 người, gồm 4 người Việt, 5 người Angola, lấy tên \"Team châu Phi\", dần tổ chức các dự án thiện nguyện quy mô lớn hơn cho người dân bản địa.</p><p>Nhận thấy làng Sanzala chưa từng được dùng nước sạch, nhóm quyên góp tiền thuê thợ khoan giếng để tạo nguồn nước sinh hoạt cho người dân. Thấy dân không có điện, họ lắp hệ thống điện mặt trời, kéo đường dây đến từng nhà.</p><p>Anh đã dành hai năm cùng nhóm để xây sửa trường học, đến từng nhà vận động người dân, cho 5.000 trẻ em đến lớp.<br>&nbsp;</p><p style=\"text-align:right;\"><strong>Viết Tuân</strong></p>','trankhangctu@gmail.com','anonymousUser',NULL,'Quang Linh Vlogs là Ủy viên Mặt trận Tổ quốc Việt Nam','https://vnexpress.net/quang-linh-vlogs-la-uy-vien-mat-tran-to-quoc-viet-nam-4805843.html','\"Phạm Quang Linh, người sáng lập kênh YouTube Quang Linh Vlogs - Cuộc sống châu Phi, được hiệp thương là một trong 397 ủy viên Mặt trận Tổ quốc Việt Nam. Từ thợ xây ở Angola, Linh thành lập xưởng làm nước đá và kênh YouTube để giúp đỡ người dân địa phương. Anh cùng nhóm Team châu Phi thực hiện các dự án thiện nguyện quy mô lớn như khoan giếng, lắp điện mặt trời và xây sửa trường học, mang lại cuộc sống tốt đẹp hơn cho người dân Sanzala. Linh cho biết sẽ tiếp tục làm tốt công tác xã hội, hỗ trợ cộng đồng và xây dựng hình ảnh Việt Nam ở nước ngoài. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1730732043/tagged-images/vi4zhybamppgbf4lurut.jpg','Quang Linh Vlogs là Ủy viên Mặt trận Tổ quốc Việt Nam',NULL,NULL,NULL),(_binary '',NULL,'2024-10-05 17:15:43.452926',3,5,'2024-12-06 21:29:00.324444',35,2,'2024-11-06 19:27:02.559882','https://res.cloudinary.com/dztroerja/video/upload/v1730795663/news-3_ufdq8d.mp3','<p>Thuộc nhóm 87 cơ thủ bị Liên đoàn Pool Thế giới (WPA) cấm thi đấu sáu tháng, Lường Đức Thiện cho biết anh rất buồn vì muốn chơi mọi giải.</p><p>\"Tôi buồn, nhưng không hụt hẫng vì đã biết có khả năng bị như vậy\", Đức Thiện nói với VnExpress sáng 18/10. \"Các cơ thủ chúng tôi muốn được chơi ở mọi giải đấu có thể, mà không sợ bị phạt. Nhưng cách WPA cấm các cơ thủ cứ như thể chúng tôi có tội\".</p><figure class=\"image\"><img style=\"aspect-ratio:680/408;\" src=\"https://i1-thethao.vnecdn.net/2024/10/18/lu-o-ng-du-c-thie-n-1729220798-7971-1729221282.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=BXCkQARo5tKGJaLRbsXUiQ\" width=\"680\" height=\"408\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Cơ thủ Lường Đức Thiện. Ảnh: FBNV</i></span></p><p>Hôm 17/10, WPA thông báo tới các liên đoàn thành viên, về quyết định cấm 245 cơ thủ thi đấu 6 tháng, ở các giải thuộc WPA, trong đó có 87 cơ thủ Việt Nam. Lý do là những cơ thủ này đã dự pool 9 bi Hanoi Open 2024, giải đấu không được WPA cấp phép. Trước đó, WPA liên hệ với ban tổ chức về việc hướng dẫn cấp phép cho giải đấu này, nhưng hai bên không đạt thỏa thuận.</p><p>Hanoi Open 2024 thuộc hệ thống World Nineball Tour (WNT), do Liên đoàn billiard và snooker Hà Nội, phối hợp với công ty Matchroom của Anh tổ chức, được Sở Văn hóa và Thể thao Hà Nội cấp phép. WPA từng giao Matchroom tổ chức các giải pool 9 bi, nhưng hai bên xung đột và đối nghịch từ năm 2023. Matchroom tạo ra hệ thống giải WNT và xếp thứ tự cơ thủ riêng cho 9 bi - nội dung phổ biến nhất của pool.</p><p>Trong số cơ thủ vừa bị WPA cấm thi đấu, có toàn bộ 10 người đang dự Reyes Cup 2024 - giải đấu giữa châu Âu và châu Á. Ngoài ra, còn có những cơ thủ hàng đầu thế giới như Shane van Boening, Fedor Gorst, Ko Ping Chung hay Wiktor Zielinski.</p><p>Nhiều cơ thủ hàng đầu thế giới trước đó đã tuyên bố tẩy chay WPA, vì lệnh cấm các đồng nghiệp châu Á và Việt Nam. Vì thế, việc bị WPA cấm thi đấu 6 tháng không ảnh hưởng nhiều tới họ. Có những cơ thủ thay đổi quyết định, ủng hộ WPA như Joshua Filler hay Albin Ouschan. Điều này khiến những cơ thủ hàng đầu khác thất vọng. \"Tôi tức điên và thất vọng vì có những cơ thủ không giữ lời hứa. Những ai không giữ lời thì đừng khóc một khi tình hình không thay đổi\", tay cơ Mỹ Skyler Woodward nói.</p><figure class=\"image\"><img style=\"aspect-ratio:680/408;\" src=\"https://i1-thethao.vnecdn.net/2024/10/18/skyler-woodward-1729221205-4363-1729221282.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=I8XAgB_imjNapUpQ4k_s7g\" width=\"680\" height=\"408\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Skyler Woodward tại giải Hanoi Open 2024 ở Việt Nam. Ảnh: Matchroom</i></span></p><p>Trong 87 cơ thủ Việt Nam bị cấm thi đấu, đều có những cao thủ như Đức Thiện, Dương Quốc Hoàng, Phạm Phương Nam, Nguyễn Anh Tuấn hay Bùi Trường An. Họ cũng đã biết trước về án phạt.</p><p>\"Tôi đã nhận được thông báo, nhưng không bất ngờ lắm, vì đã biết thông tin này từ trước\", Phương Nam nói. \"Dù sao tôi vẫn hy vọng sau lệnh cấm, hai tổ chức sẽ ngồi lại đàm phán cùng nhau để đưa môn thể thao này phát triển mạnh mẽ hơn\".</p><p>Còn Trường An bình luận ngắn gọn: \"Đã chơi thì chấp nhận chịu, biết nói sao\".</p><p>Lường Đức Thiện 32 tuổi, đang là đương kim vô địch quốc gia pool 10 bi. Anh hiện đứng thứ 80 trên bảng thứ bậc WNT, là cơ thủ số hai Việt Nam sau Dương Quốc Hoàng. Trường An và Phương Nam lần lượt là tay cơ số bốn và số năm quốc gia, đều trong Top 100 thế giới.</p><p>Năng lực các cơ thủ có thể được đánh giá dựa trên chỉ số FargoRate, được tính qua kết quả đối đầu của gần 300.000 cơ thủ trên thế giới. Trong Top 10 cơ thủ hàng đầu theo chỉ số này, có tới 8 người nằm trong danh sách cấm, trừ Filler và Anton Raga.</p><p>Phần lớn cơ thủ hàng đầu thế giới chọn WNT vì các giải thưởng ở đó cao hơn hẳn so với WPA. Chẳng hạn giải pool 9 bi thế giới 2024 thuộc WNT có quỹ thưởng 1 triệu USD, còn giải 10 bi thế giới 2024 của WPA có tổng tiền thưởng 250.000 USD.</p><p>WPA quy định cơ thủ nào muốn dự các giải WPA 6 tháng sau, sẽ phải nộp 500 USD cho liên đoàn quốc gia. \"Tôi không kỳ thị hệ thống nào cả, vì luôn muốn thi đấu khi có cơ hội\", Đức Thiện nói thêm. \"Nhưng chắc là tôi sẽ không nộp phạt, vì tôi không có tội\".</p><p style=\"text-align:right;\"><strong>Xuân Bình</strong></p>','trankhangctu@gmail.com','minhkhang2',NULL,'Cơ thủ Việt Nam: \'Liên đoàn cấm như thể chúng tôi có tội\'','https://vnexpress.net/co-thu-viet-nam-lien-doan-cam-nhu-the-chung-toi-co-toi-4805608.html','\"WPA cấm 87 cơ thủ Việt Nam thi đấu 6 tháng vì tham gia giải Hanoi Open 2024 không được cấp phép. Các cơ thủ Việt Nam và hàng loạt cơ thủ hàng đầu thế giới bị ảnh hưởng, trong đó có Đức Thiện, Dương Quốc Hoàng, Phạm Phương Nam, Nguyễn Anh Tuấn, Bùi Trường An.  Họ biết trước về án phạt và chấp nhận. Nguyên nhân chính của cuộc khủng hoảng là sự bất đồng giữa WPA và Matchroom về cấp phép giải đấu và hệ thống xếp hạng. Nhiều cơ thủ hàng đầu thế giới chọn WNT vì giải thưởng cao hơn. Các cơ thủ Việt Nam bày tỏ mong muốn giải quyết bất đồng để môn thể thao phát triển. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729270236/tagged-images/wbdsxibewxda5pm8vtkd.jpg','Cơ thủ Việt Nam: \'Liên đoàn cấm như thể chúng tôi có tội\'',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-06 14:40:03.807300',4,1,'2024-11-06 15:32:21.116732',34,2,'2024-11-03 18:34:45.548870','https://res.cloudinary.com/dztroerja/video/upload/v1730795666/news-4_p7nmoz.mp3','<p>Theo chuyên gia, nếu không muốn áp lực vay ngân hàng, người mua nên bán hai thửa đất ở quê lấy 2,6 tỷ đồng mua nhà để sớm ổn định cuộc sống.</p><p>Vợ chồng tôi đang sinh sống và làm việc ở TP HCM, chưa có con nhỏ. Sau nhiều năm tích cóp, chúng tôi có khoản tiết kiệm 400 triệu đồng cùng hai miếng đất, diện tích 100 m2 và 70 m2 ở quê, ước tính theo giá thị trường khoảng 2,6 tỷ đồng. Thu nhập của hai vợ chồng khoảng 18 triệu đồng, trong đó tiền thuê nhà mất 6 triệu. Vợ chồng tôi dự tính bán đất để mua nhà TP HCM nhưng phân vân giữa các phương án sau.</p><p>Một là, bán thửa đất nhỏ 70 m2, giá khoảng 800 triệu đồng, vay thêm ngân hàng mua một căn chung cư giá khoảng 3 tỷ đồng. Trong một năm, chúng tôi được hỗ trợ miễn lãi và gốc. Sau một năm, nếu thu nhập không cải thiện nhiều, tôi tính bán nốt thửa đất 100 m2 để trả nợ ngân hàng.</p><p>Hai là, bán thửa đất nhỏ trước, còn thửa lớn dành để đầu tư. Sau khi có lãi, tôi mới bán để mua nhà.</p><p>Ba là, bán cả hai thửa đất để mua một căn chung cư 3 tỷ, không cần vay thêm ngân hàng. Trường hợp này chúng tôi sẽ mất hết tài sản ở quê.</p><p>Mong nhận được tư vấn từ chuyên gia và độc giả kinh nghiệm giúp tôi chọn được phương án hợp lý nhất!</p><p style=\"text-align:right;\"><strong>Độc giả Nhân Đức</strong></p><p><strong>Chuyên gia tư vấn:</strong></p><p>Hiện ngân sách mua nhà của bạn khoảng 3 tỷ đồng, trong đó hơn 80% đang nằm trong đất, còn lại là tiền mặt. Bạn cần lưu ý đất nền thường có thanh khoản lâu, có thể kéo dài nhiều tháng, nhất là trong bối cảnh thị trường phía Nam vẫn còn ảm đạm. Nhiều trường hợp đã tìm được căn nhà ưng ý nhưng chưa kịp bán được đất nên trễ kế hoạch mua nhà và bỏ lỡ cơ hội sở hữu căn phù hợp.</p><p>Với phương án một, nếu bán được thửa đất nhỏ 70 m2, giá khoảng 800 triệu đồng, bạn sẽ có vốn ban đầu mua nhà 1,2 tỷ đồng. Tôi cho rằng tỷ lệ vay mua nhà không nên quá 50% để cân bằng giữa sinh hoạt hàng ngày và việc trả nợ hàng tháng. Với trường hợp của bạn, khoản vay ngân hàng chiếm 60% giá trị căn nhà nên áp lực trả lãi ngân hàng khá cao.</p><p>Về lãi suất vay mua nhà, nhiều ngân hàng đang hỗ trợ lãi suất 5-8% mỗi tháng, cố định trong 6-12 tháng, kỳ hạn vay 3-5 năm. Sau ưu đãi, lãi suất thả nổi vào khoảng 9-10% một năm. Giả sử bạn vay 1,8 tỷ đồng với lãi suất 10% trong 25 năm, mỗi tháng bạn cần để ra khoảng 21 triệu đồng (gốc cố định, lãi giảm dần).</p><p>Giả sử bạn bán thửa đất lớn hơn và giữ miếng nhỏ, gộp với khoản tiết kiệm là 2,2 tỷ đồng, giảm tỷ lệ vay ngân hàng xuống 30%. Bạn vẫn cần để ra khoảng 6-8 triệu đồng để trả ngân hàng hàng tháng. Trong khi tổng thu nhập của vợ chồng chỉ có 18 triệu đồng, riêng tiền thuê nhà hết 6 triệu đồng, còn lại 12 triệu đồng để cho chi phí sinh hoạt. Nếu có thêm em bé, chi phí dành cho một đứa trẻ cần tối thiểu 5 triệu đồng một tháng. Nếu không gia tăng thu nhập (trên 40 triệu đồng một tháng), gần như rất khó để bạn có thể trả nợ vay mua nhà.</p><p>Với phương án thứ hai, do không nắm rõ vị trí hai thửa đất, lịch sử tăng giá khu vực xung quanh, biên độ lợi nhuận bạn kỳ vọng, tôi không phân tích được chính xác phương án này. Tuy nhiên, bạn lưu ý đầu tư đất nền cần giữ trong trung và dài hạn bởi thị trường hiện nay chưa hết khó, nhiều nhà đầu tư \"ôm\" đất vùng ven TP HCM vẫn đang phải giảm giá để thoát hàng. Nếu bạn kỳ vọng lợi nhuận có thể tăng mạnh trong thời gian ngắn, đáp án là gần như không thể. Chưa kể, tiềm năng tăng giá của phân khúc này còn phụ thuộc nhiều vào vị trí, thông tin quy hoạch, hạ tầng...</p><p>Tôi cho rằng phương án phù hợp với gia đình bạn là bán hai thửa đất, cộng với khoản tiền tiết kiệm dành mua nhà. Phương án này giúp bạn không phải chịu áp lực vay ngân hàng, sớm có cuộc sống ổn định. Với ngân sách 3 tỷ đồng, bạn có thể tìm mua căn hộ khoảng 50-70 m2, tùy vị trí và thời gian bàn giao của dự án. Bạn tham khảo những khu vực tập trung nhiều dự án tầm trung phù hợp ngân sách như khu Đông (TP Thủ Đức), khu Nam (quận 7, Nhà Bè), khu Tây Bắc (quận Tân Bình, Tân Phú)...</p><p>Để tìm được căn hộ phù hợp, bạn cần vạch ra một số tiêu chí như vị trí, thương hiệu chủ đầu tư, pháp lý, tiện ích, chất lượng bàn giao... từ đó lựa chọn dự án phù hợp với nhu cầu của gia đình. Chúc bạn tìm được sự lựa chọn phù hợp!</p><p style=\"text-align:right;\"><strong>Ông Võ Hồng Thắng</strong><br>Phó tổng giám đốc DKRA Group</p>','minhkhang4','admin',NULL,'Có nên bán hết đất ở quê để mua chung cư TP HCM?','https://vnexpress.net/co-nen-ban-het-dat-o-que-de-mua-chung-cu-tp-hcm-4806016.html','\"Bài viết đưa ra lời khuyên cho một cặp vợ chồng muốn mua nhà ở TP HCM với tài sản là hai thửa đất ở quê. Chuyên gia đề xuất bán cả hai thửa đất để mua nhà, tránh áp lực vay ngân hàng. Bài viết phân tích các phương án khác như vay ngân hàng, đầu tư đất nền, nhưng cho rằng phương án bán đất mua nhà là hợp lý nhất. Chuyên gia cũng cung cấp thông tin về thị trường bất động sản, lãi suất vay mua nhà, và gợi ý các khu vực và tiêu chí khi chọn mua nhà. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729324990/tagged-images/yqx2fkkepj0pqrayxrwe.jpg','Có nên bán hết đất ở quê để mua chung cư TP HCM?',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-06 14:42:56.332008',5,NULL,'2024-12-06 21:02:16.935160',23,1,NULL,NULL,'Tin tức 4 Sanctus amet sed ipsum lorem','tranminhkhang8888@gmail.com','admin','Tin tức không có nguồn chính thống, không có dữ liệu chính xác, không hợp lệ.','Tin tức 4 Sanctus amet sed ipsum lorem','',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1728914525/tagged-images/zsnaxikuvhvgct4n3pym.jpg','Tin tức 4 Sanctus amet sed ipsum lorem','admin',NULL,NULL),(_binary '',1,'2024-10-06 15:09:47.124426',6,4,'2024-11-06 19:29:31.827496',54,2,'2024-11-03 23:33:41.209860','https://res.cloudinary.com/dztroerja/video/upload/v1730795663/news-6_j6iigz.mp3','<p>Cựu hậu vệ Stuart Pearce đề xuất cầu thủ Man City trả lương cho Alex Ferguson để huyền thoại này tiếp tục làm đại sứ toàn cầu cho Man Utd.</p><p>\"Sẽ rất tuyệt nếu các cầu thủ Man Utd quyết định tài trợ số tiền đó mỗi mùa để giữ Ferguson tại vị, vì ông ấy quá quan trọng với CLB này, đúng không?\", Pearce nói trên talkSPORT ngày 17/10.</p><p>Cựu danh thủ 62 tuổi sau đó còn đề xuất các cầu thủ Man City hỗ trợ trả lương cho Ferguson. \"Tôi hơi điên một chút khi nghĩ rằng, các cầu thủ Man City nên can thiệp và trả lương cho Ferguson mỗi năm để giữ ông ấy ở lại, vì những gì ông ấy đã làm cho CLB cùng thành phố\", Pearce giải thích. \"Điều đó sẽ truyền cảm hứng cho chúng tôi hàng tuần. Đó sẽ là động thái đẳng cấp. Họ sa thải HLV vĩ đại nhất trong lịch sử CLB, nhưng chúng tôi sẽ tài trợ mức lương đó, không vấn đề gì\".</p><figure class=\"image\"><img style=\"aspect-ratio:680/383;\" src=\"https://i1-thethao.vnecdn.net/2024/10/18/stuart-pearce-alex-ferguson-ol-7231-3031-1729207847.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=KayWaCS7Fk1UTgWfCVbdow\" alt=\"Stuart Pearce (trái) cùng Alex Ferguson chỉ đạo trong trận derby Manchester ở Ngoại hạng Anh tháng 9/2005. Ảnh: Sky Sports\" width=\"680\" height=\"383\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Stuart Pearce (trái) cùng Alex Ferguson chỉ đạo trong trận derby Manchester ở Ngoại hạng Anh tháng 9/2005. Ảnh: Sky Sports</i></span></p><p>Khi thi đấu đỉnh cao, Pearce đá hậu vệ, khoác áo các CLB Wealdstone, Coventry City, Nottingham Forest, Newcastle, West Ham, Man City và Longford. Ông ghi năm bàn qua 78 lần ra sân cho tuyển Anh và giải nghệ năm 2012. Năm 2016, ông trở lại thi đấu, ký hợp đồng một trận với Longford - CLB tại Gloucestershire có biệt danh là \"CLB tệ nhất Vương quóc Anh\".</p><p>Pearce khởi nghiệp HLV tại Nottingham Forest, rồi dẫn dắt Man City giai đoạn 2005-2007. Ông từng dẫn dắt U21 Anh và làm HLV tạm quyền của \"Tam sư\" năm 2012. Công việc huấn luyện gần nhất của ông là làm trợ lý cho David Moyes tại West Ham giai đoạn 2020-2022.</p><p>Ferguson dẫn dắt Man Utd liên tục 27 năm và giành 38 danh hiệu, trong đó có hai Champions League và 13 Ngoại hạng Anh. Sau khi giải nghệ năm 2013, huyền thoại người Scotland ký hợp đồng làm đại sứ toàn cầu của Man Utd với mức lương khoảng 2,8 triệu USD mỗi năm.</p><p>Ngày 15/10, chủ sân Old Trafford thông báo thôi hợp đồng đại sứ với Ferguson nhằm cắt giảm chi phí. Cựu HLV 82 tuổi cũng bị hạn chế vào phòng thay đồ Man Utd sau các trận đấu. Man Utd khẳng định không cấm hoàn toàn cựu HLV 82 tuổi, nhưng cho biết sẽ có \"sự hiểu biết chung\" về việc ai được vào đó.</p><p>Huyền thoại Man Utd, Eric Cantona phản ứng gay gắt với quyết định của CLB cũ, dọa ném tất cả lãnh đạo CLB cũ vào \"đống phân to\". Hai cựu cầu thủ Man Utd khác là Dwight Yorke và Rio Ferdinand cũng bất ngờ với bất ngờ với động thái của CLB cũ, cho rằng không còn ai được đảm bảo tương lai.</p><p>Cựu tiền vệ của Tottenham, Jamie O\'Hara cũng lên tiếng chỉ trích: \"Làm sao mà Ferguson lại bị cắt hợp đồng trước Ten Hag? Một CLB hoàn toàn hỗn loạn\".</p><p>Tiền vệ Paul Pogba cho rằng phán quyết của Man Utd không thay đổi vị thế và đóng góp của Ferguson. \"Điều đó có nghĩa là gì? Liệu nó có thay đổi những gì Ferguson đã làm cho CLB hay không?\", cầu thủ của Juventus nói với Sky Sports. \"Điều duy nhất tôi nghe được là Ferguson không được trả lương nữa. Ferguson sẽ mãi là Ferguson, sẽ luôn là huyền thoại của Man Utd\".</p><p style=\"text-align:right;\"><strong>Hồng Duy</strong></p>','trankhangctu@gmail.com','minhkhang7',NULL,'Cầu thủ Man City được khuyên trả lương để Ferguson ở lại Man Utd','https://vnexpress.net/cau-thu-man-city-duoc-khuyen-tra-luong-de-ferguson-o-lai-man-utd-4805551.html#:~:text=C%E1%BA%A7u%20th%E1%BB%A7%20Man%20City%20%C4%91%C6%B0%E1%BB%A3c%20khuy%C3%AAn%20tr%E1%BA%A3%20l%C6%B0%C6%A1ng,l%C3%A0m%20%C4%91%E1%BA%A1i%20s%E1%BB%A9%20to%C3%A0n%20c%E1%BA%A7u%20cho%20Man%20Utd.','\"Cựu hậu vệ Stuart Pearce đề xuất cầu thủ Man City trả lương cho Alex Ferguson để huyền thoại này tiếp tục làm đại sứ toàn cầu cho Man Utd sau khi hợp đồng của ông bị chấm dứt. Pearce cho rằng động thái này là đẳng cấp, thể hiện sự tôn trọng đối với Ferguson và là động lực cho Man City. Quyết định sa thải Ferguson đã gây phản ứng dữ dội từ các cựu cầu thủ và người hâm mộ Man Utd. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729270574/tagged-images/nznu8cp5qwe2f3q2j2b1.jpg','Cầu thủ Man City được khuyên trả lương để Ferguson ở lại Man Utd',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-06 20:46:33.391766',7,NULL,'2024-12-06 21:02:06.272277',17,1,NULL,NULL,'<p>Tin tức 6 Sanctus amet sed ipsum lorem</p>','tranminhkhang8888@gmail.com','admin','Tin tức chưa đủ tính xác thực và đúng đắng.','Tin tức 6 Sanctus amet sed ipsum lorem notification','',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1728914525/tagged-images/zsnaxikuvhvgct4n3pym.jpg','Tin tức 6 Sanctus amet sed ipsum lorem notification','admin',NULL,NULL),(_binary '',NULL,'2024-10-06 20:47:49.206422',8,1,'2024-11-14 20:52:19.032917',8,2,'2024-11-06 19:30:00.709676','https://res.cloudinary.com/dztroerja/video/upload/v1730896268/news-8.mp3.mp3','<p>Arab SaudiNovak Djokovic sẽ là đối thủ cuối trong sự nghiệp đánh đơn của Rafael Nadal, khi họ đối đầu ở Six Kings Slam hôm nay.</p><p>*Trận đấu bắt đầu khoảng 17h30 hôm nay 19/10, giờ Hà Nội.</p><p>Ba tháng trước, Nadal có lẽ đã chơi trận đánh đơn cuối cùng ở vòng hai Olympic Paris. Anh thua kình địch Novak Djokovic 1-6, 4-6 trong thế trận lép vế hoàn toàn. Trận đấu đó cho thấy khả năng cạnh tranh đỉnh cao của Nadal không còn, sau thời gian hai năm vật lộn với chấn thương và hoài nghi bản thân.</p><p>Các trận ở Six Kings Slam không nằm trong lịch của các tổ chức quần vợt quốc tế và sẽ không tính vào đối đầu giữa Nadal với Djokovic. Nhưng họ một lần nữa có duyên, khi gặp nhau ở trận tranh giải Ba hôm nay. Djokovic vì thế một lần nữa là người cuối cùng đấu Nadal trong một trận đánh đơn của một giải đấu cá nhân. Nadal còn tham dự VCK Davis Cup sau đây một tháng, nhưng đó là sự kiện đồng đội, và nhiều khả năng anh chỉ đủ sức đánh đôi.</p><figure class=\"image\"><img style=\"aspect-ratio:1020/574;\" src=\"data:image/jpeg;base64,\" width=\"1020\" height=\"574\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Nadal (phải) và Djokovic trong trận vòng hai Olympic Paris, trên sân Philippe Chatrier hồi tháng 7/2024. Ảnh: Reuters</i></span></p><p>Ở thời điểm này, khó kỳ vọng Nadal và Djokovic tạo ra một trận đấu kịch tính, mãn nhãn. Cả hai đều đang ở giai đoạn cuối cùng của sự nghiệp, khi sức chiến đấu đã giảm và động lực không còn nhiều. Djokovic vẫn trong top đầu ATP nhưng sẽ ưu tiên duy trì thể lực, sau khi dính một số chấn thương nhẹ gần đây. Ở trận gặp Sinner hai ngày trước, Nole bị đau vai và trước đó anh bị đau đầu gối khi dự Thượng Hải Masters.</p><p>Nếu dự Paris Masters và ATP Finals, Djokovic chắc chắn phải giữ cơ thể cẩn thận. Bên kia lưới, Nadal rơi vào tình trạng lực bất tòng tâm. Ở trận thua Alcaraz 3-6, 3-6, \"Vua đất nện\" gần như không thể di chuyển khi đối thủ đánh khó. Những cú trả của Nadal cũng thiếu lực và hiếm khi đạt tốc độ như ý muốn. Anh có mặt ở Arab Saudi chủ yếu vì vấn đề hình ảnh, kinh doanh và tiền thưởng. Nadal hiện là đại sứ toàn cầu của Liên đoàn Quần vợt Arab Saudi, nơi anh có thể sẽ hợp tác mở học viện trong thời gian tới.</p><p>Ngay sau trận đấu của Nadal và Djokovic, trận chung kết có tiền thưởng lớn nhất lịch sử sẽ diễn ra. Alcaraz và Sinner tranh số tiền lên đến 6,5 triệu USD, bằng một nửa tiền thưởng mùa này của Sinner. Thậm chí Djokovic từ đầu năm đến nay chỉ kiếm được 4,4 triệu USD, còn Holger Rune, tay vợt bị Alcaraz loại ở tứ kết, thì chỉ bỏ túi 2,7 triệu USD trong 10 tháng qua.</p><p>Không nghi ngờ Alcaraz và Sinner sẽ tạo nên một màn thư hùng đỉnh cao khác. Hồi đầu tháng, họ tạo nên trận chung kết ATP Tour hay bậc nhất lịch sử ở Bắc Kinh, nơi Alcaraz thắng 6-7 (6), 6-4, 7-6 (3) sau gần ba tiếng rưỡi thi đấu. Tay vợt Tây Ban Nha dẫn 6-4 về đối đầu, gồm ba trận toàn thắng trong năm nay. Do đó, đây là cơ hội để Sinner phục thù, đồng thời khẳng định vị thế của người sẽ dẫn đầu bảng điểm mùa này.</p><p>Sinner đang có chuỗi trận thăng hoa kể từ Cincinnati Masters, khi thắng 23 trong 24 trận, đoạt ba danh hiệu và kiếm đủ điểm giữ chắc ngôi số một tới hết năm – điều chưa tay vợt Italy nào làm được trong lịch sử. Trận thắng Djokovic ở bán kết Six Kings Slam là trận thắng thứ 66 của Sinner mùa này. Anh chưa từng dừng bước trước tứ kết của bất kỳ giải nào và dẫn đầu ATP Tour với bảy danh hiệu – gồm hai Grand Slam và ba Masters 1000.</p><p>Sinner ổn định nhưng cần thêm sự đột biến trong lối chơi để khắc chế Alcaraz, đối thủ lớn nhất hiện tại. Alcaraz đang có thành tích 12-1 kể từ Mỹ Mở rộng. Tay vợt Tây Ban Nha có thể thua bất ngờ trước những đối thủ bị đánh giá thấp hơn nhiều như Tomas Machac ở tứ kết Thượng Hải Masters tuần trước, nhưng luôn giữ được sự thăng hoa trong các trận đấu lớn. Ở một sự kiện mang tính biểu diễn như Six Kings Slam, Alcaraz có thể còn làm được những điều đặc biệt hơn với trái bóng, và gây bất ngờ cho Sinner.</p><p>\"Khi Alcaraz gặp Sinner, cơ hội chia đều và bất kỳ ai cũng có thể đánh bại người còn lại\", huyền thoại Mats Wilander bình luận trên Eurosport trước chung kết Six Kings Slam. Một điều mà người hâm mộ có thể chắc chắn là trận đấu nhiều khả năng kéo dài, với các loạt đôi công hấp dẫn. Trong 10 trận đối đầu của họ, chỉ ba lần người thua không giành được set nào.</p><p style=\"text-align:right;\"><strong>Vy Anh</strong></p>','minhkhang4','minhkhang6',NULL,'Chương cuối của cuộc chiến Nadal – Djokovic','https://vnexpress.net/chuong-cuoi-cua-cuoc-chien-nadal-djokovic-4805998.html','\"Trận đấu cuối cùng trong sự nghiệp đánh đơn của Rafael Nadal diễn ra tại Six Kings Slam, đối thủ của anh là Novak Djokovic. Mặc dù Nadal đã suy giảm phong độ, trận đấu vẫn thu hút sự chú ý bởi tính lịch sử. Djokovic cũng không ở trạng thái tốt nhất nhưng vẫn là đối thủ đáng gờm. Trận chung kết Six Kings Slam diễn ra giữa Alcaraz và Sinner, hai tay vợt trẻ hàng đầu thế giới. Alcaraz đang dẫn đầu đối đầu nhưng Sinner đang có chuỗi trận ấn tượng, hứa hẹn một trận đấu kịch tính.\"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729322495/tagged-images/lfewourvajkdjvlcouya.jpg','Chương cuối của cuộc chiến Nadal – Djokovic',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-06 20:50:34.035221',9,2,'2024-11-13 18:15:57.944735',10,1,NULL,NULL,'Tin tức 8 Sanctus amet sed ipsum lorem','trankhangctu@gmail.com','admin',NULL,'Tin tức 8 Sanctus amet sed ipsum lorem','',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/c_thumb,w_200,g_face/v1728212349/tagged-images/ahwbm9fb4mfpdxsxfypr.jpg','Tin tức 8 Sanctus amet sed ipsum lorem',NULL,NULL,NULL),(_binary '',1,'2024-10-06 20:51:06.028275',10,4,'2024-11-30 08:59:48.450767',66,2,'2024-11-05 14:40:33.103189','https://res.cloudinary.com/dztroerja/video/upload/v1730795663/news-10_pnxtje.mp3','<p>Chủ tịch Quốc hội Trần Thanh Mẫn thăm chính thức Lào và tham dự Đại hội đồng Liên Nghị viện ASEAN lần thứ 45 (AIPA-45) ngày 17-19/10.</p><p>Chuyên cơ chở Chủ tịch Quốc hội Trần Thanh Mẫn đến sân bay Wattay, thủ đô Vientiane chiều nay. Đây là chuyến thăm Lào đầu tiên của ông trên cương vị Chủ tịch Quốc hội.</p><p>Đoàn tháp tùng gồm Phó chủ tịch Quốc hội Nguyễn Thị Thanh; Chủ nhiệm Ủy ban Đối ngoại Vũ Hải Hà; Chủ nhiệm Ủy ban Văn hóa, Giáo dục Nguyễn Đắc Vinh; Chủ nhiệm Ủy ban Pháp luật Hoàng Thanh Tùng và các quan chức khác.</p><p>Trong khuôn khổ chuyến thăm, Chủ tịch Quốc hội Trần Thanh Mẫn dự kiến hội đàm với Chủ tịch Quốc hội Saysomphone Phomvihane, chào xã giao Tổng Bí thư, Chủ tịch nước Thongloun Sisoulith, hội kiến Thủ tướng Sonexay Siphandone và có nhiều hoạt động gặp gỡ tiếp xúc quan trọng khác.</p><figure class=\"image\"><img style=\"aspect-ratio:1020/816;\" src=\"data:image/jpeg;base64,\" width=\"1020\" height=\"816\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Chủ tịch Quốc hội Trần Thanh Mẫn tại sân bay ở Vientiane chiều 17/10. Ảnh: Thống Nhất</i></span></p><p>Chủ đề của AIPA-45 là \"Vai trò của Nghị viện trong việc tăng cường kết nối và tăng trưởng toàn diện của ASEAN\". Phó chủ nhiệm Ủy ban Đối ngoại của Quốc hội Lê Thu Hà cho biết AIPA-45 tập trung vào Chiến lược hợp tác về chính trị - an ninh, kinh tế, văn hóa - xã hội và kết nối hướng đến \"ASEAN tự cường, năng động, sáng tạo và lấy người dân làm trung tâm\".</p><p>Theo bà Hà, Việt Nam dự kiến đề xuất 4 sáng kiến/Nghị quyết tại các hội nghị tham gia. Đó là tăng cường vai trò của nghị sĩ trẻ ASEAN thông qua chuyển đổi số và đổi mới sáng tạo; tăng cường quyền, phúc lợi xã hội và cơ hội việc làm cho người cao tuổi trong khu vực ASEAN; thúc đẩy xóa bỏ bạo lực đối với phụ nữ và trẻ em gái trong ASEAN; nâng cao năng lực thể chế để kết nối giao thông, hàng không, cảng biển trong khu vực ASEAN.</p><p>Phó chủ tịch Quốc hội Lào Sounthone Xayachak cho rằng chuyến thăm của Chủ tịch Quốc hội Trần Thanh Mẫn thể hiện ủng hộ và là động lực mạnh mẽ đối với nhân dân Lào nói chung, Quốc hội Lào nói riêng.</p><p>Việt Nam - Lào thiết lập quan hệ ngoại giao năm 1962. Việt Nam là một trong những nhà đầu tư, đối tác thương mại lớn nhất của Lào, hiện có 256 dự án đầu tư tại Lào với tổng vốn 5,5 tỷ USD, vốn thực hiện lũy kế đến nay đạt 2,8 tỷ USD. Trong 7 tháng đầu năm, có 6 dự án được cấp phép mới với vốn đầu tư đạt 36,7 triệu USD, tăng 39% so với cùng kỳ năm 2023.</p><p>Kim ngạch thương mại Việt Nam - Lào năm 2023 đạt 1,6 tỷ USD. 8 tháng đầu năm 2024, kim ngạch thương mại hai nước đạt khoảng 1,3 tỷ USD.</p><p>Việt Nam dành cho Lào khoảng hơn 1.000 học bổng mỗi năm và đến nay có khoảng hơn 14.000 lưu học sinh Lào đang học tập tại hơn 170 cơ sở giáo dục của Việt Nam.</p><p>Hồi tháng 9, Tổng Bí thư, Chủ tịch nước Lào Thongloun Sisoulith và phu nhân thăm cấp nhà nước Việt Nam. Thủ tướng Phạm Minh Chính vừa kết thúc chuyến công du dự Hội nghị Cấp cao ASEAN lần thứ 44, 45 và các Hội nghị cấp cao liên quan tại Vientiane.</p><p style=\"text-align:right;\"><strong>Sơn Hà</strong></p>','trankhangctu@gmail.com','minhkhang7',NULL,'Chủ tịch Quốc hội đến Vientiane, bắt đầu thăm Lào','https://vnexpress.net/chu-tich-quoc-hoi-den-vientiane-bat-dau-tham-lao-4805029.html','\"Chủ tịch Quốc hội Trần Thanh Mẫn thăm chính thức Lào và tham dự Đại hội đồng Liên Nghị viện ASEAN lần thứ 45 (AIPA-45). Ông có các cuộc gặp gỡ quan trọng với lãnh đạo Lào, bao gồm Chủ tịch Quốc hội, Tổng Bí thư, Chủ tịch nước và Thủ tướng. Chuyến thăm nhằm tăng cường quan hệ hợp tác giữa Việt Nam và Lào, đặc biệt là trong lĩnh vực kinh tế, giáo dục và hợp tác quốc tế. Việt Nam cũng đề xuất 4 sáng kiến tại AIPA-45 nhằm thúc đẩy vai trò của nghị sĩ trẻ ASEAN, nâng cao quyền lợi cho người cao tuổi, xóa bỏ bạo lực đối với phụ nữ và trẻ em gái và nâng cao năng lực thể chế để kết nối giao thông, hàng không, cảng biển trong khu vực. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729322972/tagged-images/eqx4er5lee3ocpqoywiv.jpg','Chủ tịch Quốc hội đến Vientiane, bắt đầu thăm Lào',NULL,NULL,NULL),(_binary '',NULL,'2024-10-06 20:51:25.119329',11,3,'2024-12-02 19:57:34.949457',47,2,'2024-11-03 23:32:33.946027','https://res.cloudinary.com/dztroerja/video/upload/v1730795665/news-11_pgz3uy.mp3','<p>Chủ tịch Quốc hội Lào hội đàm với Chủ tịch Quốc hội Trần Thanh Mẫn tại Vientiane, mong muốn Việt Nam chia sẻ kinh nghiệm trong lĩnh vực nông nghiệp.</p><p>Trong cuộc hội đàm với Chủ tịch Quốc hội Lào Saysomphone Phomvihane tại thủ đô Vientiane chiều nay, Chủ tịch Quốc hội Trần Thanh Mẫn mong muốn thúc đẩy hơn nữa quan hệ giữa hai nước và hai Quốc hội.</p><p>Về công tác lập pháp, Chủ tịch Quốc hội Trần Thanh Mẫn cho biết sẽ hợp tác, chia sẻ với Lào về kinh nghiệm xây dựng sửa đổi hiến pháp, pháp luật. Việt Nam sẵn sàng chia sẻ thông tin, hỗ trợ Lào tổ chức thành công các hội nghị trong năm Chủ tịch ASEAN và Đại hội đồng Liên Nghị viện ASEAN 2024.</p><p>Ông Trần Thanh Mẫn đề nghị hai bên tăng cường trao đổi, chia sẻ kinh nghiệm về xây dựng hoàn thiện thể chế, hệ thống pháp luật, giám sát tối cao. Hai nước cần phối hợp chặt chẽ triển khai thỏa thuận song phương và hợp tác đầu tư, tạo thuận lợi cho doanh nghiệp Việt Nam đầu tư, kinh doanh tại Lào.</p><figure class=\"image\"><img style=\"aspect-ratio:680/408;\" src=\"https://i1-vnexpress.vnecdn.net/2024/10/17/f6c735f0ad72142c4d63-172916128-4264-8035-1729167925.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=_jnSbdRlIzOcqYYIGdcc_A\" alt=\"Chủ tịch Quốc hội Trần Thanh Mẫn tại lễ đón do Chủ tịch Quốc hội Lào Saysomphone Phomvihane chủ trì. Ảnh: Thống Nhất/TTXVN\" width=\"680\" height=\"408\"></figure><p><span style=\"font-size:12px;\"><i>Chủ tịch Quốc hội Trần Thanh Mẫn và Chủ tịch Quốc hội Saysomphone Phomvihane tại Vientiene hôm nay. Ảnh: Thống Nhất</i></span></p><p>Chủ tịch Quốc hội Trần Thanh Mẫn khẳng định Việt Nam luôn coi trọng và ưu tiên cao nhất trong giữ gìn, bảo vệ và vun đắp quan hệ hữu nghị vĩ đại, đoàn kết đặc biệt và hợp tác toàn diện Việt - Lào. \"Việt Nam trước sau như một, luôn sát cánh và ủng hộ mạnh mẽ, toàn diện công cuộc bảo vệ, xây dựng, đổi mới và phát triển của Lào\", ông nói.</p><p>Việt Nam và Lào cần phối hợp chặt chẽ, ủng hộ lẫn nhau tại các diễn đàn khu vực và quốc tế. Cơ quan lập pháp hai nước cần phát huy vai trò, nhằm lan tỏa thế mạnh hợp tác giữa hai nước về chính trị và quốc phòng, an ninh sang kinh tế và các lĩnh vực khác.</p><p>Về việc Campuchia rút khỏi cơ chế Tam giác Phát triển Campuchia - Lào - Việt Nam, ông Trần Thanh Mẫn cho rằng cơ chế này có vai trò quan trọng trong lịch sử xây dựng, phát triển ba nước nói chung và Campuchia nói riêng.</p><p>Việt Nam luôn trân trọng giá trị lịch sử trong quan hệ giữa ba nước và dành ưu tiên hàng đầu cho gìn giữ, vun đắp và phát triển mối quan hệ láng giềng hữu nghị, đoàn kết và hợp tác toàn diện với Lào và Campuchia.</p><p>Chủ tịch Quốc hội Lào đánh giá chuyến thăm sẽ giúp thắt chặt, vun đắp quan hệ hữu nghị vĩ đại, đoàn kết đặc biệt và hợp tác toàn diện giữa hai nước, nhấn mạnh Việt Nam đang nằm trong top đầu các nước đầu tư tại Lào với khoảng 241 dự án với tổng số vốn đầu tư khoảng 5,47 tỷ USD.</p><p>Ông Saysomphone Phomvihane bày tỏ ấn tượng với những thành tựu trong phát triển nông nghiệp của Việt Nam, trong đó có nhiều sản phẩm mang lại giá trị kinh tế cao, mong muốn Việt Nam chia sẻ kinh nghiệm trong lĩnh vực này.</p><p>Nhất trí với đề nghị của Chủ tịch Quốc hội Lào, Chủ tịch Quốc hội Trần Thanh Mẫn nhấn mạnh hai nước cần tăng cường hợp tác trên các lĩnh vực, trong đó có nông nghiệp.</p><p>Ông Saysomphone Phomvihane bày tỏ chia sẻ trước những mất mát nặng nề ở Việt Nam do bão Yagi gây ra. Chủ tịch Quốc hội Lào tin tưởng Việt Nam sẽ vượt qua khó khăn, khắc phục hậu quả bão lũ, đưa cuộc sống của người dân sớm ổn định.</p><p>Sau cuộc hội đàm, Chủ tịch Quốc hội Trần Thanh Mẫn và người đồng cấp Saysomphone Phomvihane đã chứng kiến lễ ký kết Bản ghi nhớ giữa Ủy ban Đối ngoại Quốc hội Việt Nam với Ủy ban Đối ngoại Quốc hội Lào, Biên bản ghi nhớ thiết lập quan hệ hợp tác hữu nghị giữa thành phố Hội An của Việt Nam và thành phố Luang Prabang của Lào.</p><figure class=\"image\"><img style=\"aspect-ratio:680/466;\" src=\"https://i1-vnexpress.vnecdn.net/2024/10/17/cc29b40a2c8895d6cc99-172916130-9363-3990-1729161319.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=KAC05wqmneS_kWQruF5mpQ\" alt=\"Quang cảnh buổi hội đàm giữa Chủ tịch Quốc hội Trần Thanh Mẫn và người đồng cấp phía Lào. Ảnh: Thống Nhất/TTXVN\" width=\"680\" height=\"466\"></figure><p><span style=\"font-size:12px;\"><i>Cuộc hội đàm giữa Chủ tịch Quốc hội Trần Thanh Mẫn và người đồng cấp Lào chiều nay. Ảnh: Thống Nhất</i></span></p><p>Trong cuộc hội kiến Thủ tướng Lào Sonexay Siphandone cùng ngày, Chủ tịch Quốc hội Trần Thanh Mẫn bày tỏ vui mừng khi Bộ Chính trị hai nước đã họp nhằm tháo gỡ khó khăn cho các dự án Việt Nam đầu tư tại Lào, hướng tới đưa vào vận hành thời tốt hơn trong thời gian tới.</p><p>Kim ngạch thương mại hai chiều trong 9 tháng đầu năm 2024 đạt 1,5 tỷ USD, nhưng ông Trần Thanh Mẫn cho rằng con số này còn khiêm tốn so với tiềm năng, vị thế và quan hệ hai nước, đề nghị tiếp tục có giải pháp nâng cao hiệu quả các cơ chế hợp tác.</p><p>Chủ tịch Quốc hội Việt Nam mong muốn hai bên tăng cường hơn nữa trụ cột hợp tác về quốc phòng, an ninh, nhằm đối phó hiệu quả với các thách thức an ninh truyền thống và phi truyền thống, xây dựng đường biên giới Việt - Lào hòa bình, hữu nghị, phòng chống tội phạm xuyên quốc gia, đặc biệt là tội phạm ma túy.</p><p>Thủ tướng Sonexay Siphandone cho rằng hợp tác về kinh tế, thương mại, đầu tư và kim ngạch song phương đã tăng so với 2023, nhưng chưa tương xứng với quan hệ đặc biệt, hợp tác tốt đẹp về mặt chính trị giữa Việt Nam và Lào, đề nghị hai bên thắt chặt hơn nữa để thúc đẩy hợp tác kinh tế song phương.</p><p style=\"text-align:right;\"><strong>Sơn Hà</strong></p>','trankhangctu@gmail.com','anonymousUser',NULL,'Lào đề nghị Việt Nam chia sẻ kinh nghiệm phát triển nông nghiệp','https://vnexpress.net/lao-de-nghi-viet-nam-chia-se-kinh-nghiem-phat-trien-nong-nghiep-4805472.html','\"Chủ tịch Quốc hội Việt Nam và Lào đã hội đàm tại Vientiane, nhấn mạnh mối quan hệ hữu nghị đặc biệt giữa hai nước. Việt Nam cam kết hỗ trợ Lào trong phát triển, đặc biệt là chia sẻ kinh nghiệm trong lĩnh vực nông nghiệp. Hai bên nhất trí thúc đẩy hợp tác kinh tế, đầu tư và thương mại, đồng thời tăng cường hợp tác về quốc phòng, an ninh. Cơ quan lập pháp hai nước sẽ tăng cường trao đổi kinh nghiệm xây dựng pháp luật, giám sát tối cao. Chuyến thăm cũng chứng kiến việc ký kết Bản ghi nhớ giữa Ủy ban Đối ngoại Quốc hội hai nước và Biên bản ghi nhớ thiết lập quan hệ hợp tác giữa thành phố Hội An và thành phố Luang Prabang. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729325359/tagged-images/ukigokasjo8t5nrjxyxo.jpg','Lào đề nghị Việt Nam chia sẻ kinh nghiệm phát triển nông nghiệp',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-06 21:54:12.920733',12,NULL,'2024-12-06 21:02:22.079713',12,1,NULL,NULL,'Tin tức 11 Sanctus amet sed ipsum lorem','tranminhkhang8888@gmail.com','admin','Tin tức không đầy đủ dẫn chứng, và không có nguồn tin tức','Tin tức 11 Sanctus amet sed ipsum lorem','',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1728914525/tagged-images/zsnaxikuvhvgct4n3pym.jpg','Tin tức 11 Sanctus amet sed ipsum lorem','admin',NULL,NULL),(_binary '',NULL,'2024-10-06 21:54:57.181311',13,1,'2024-12-06 17:49:55.329018',9,2,'2024-11-05 16:30:34.836768','https://res.cloudinary.com/dztroerja/video/upload/v1730799055/news-13.mp3.mp3','<p>Quý III, Sunshine Homes - đơn vị phát triển bất động sản của Sunshine Group - lãi hợp nhất sau thuế khoảng 7,7 tỷ đồng, giảm hơn 98% so với cùng kỳ năm 2023.</p><p>Theo báo cáo tài chính hợp nhất, Công ty cổ phần Phát triển Sunshine Homes (SSH) đạt doanh thu gần 65 tỷ đồng trong quý III, giảm gần 94% so với kỳ này năm trước.</p><p>Tương tự, thu từ hoạt động tài chính về gần 92 tỷ, còn lãi sau thuế là 7,7 tỷ đồng. Các mức này giảm lần lượt gần 96% và 98,5% so với cùng kỳ năm trước. Đây cũng là quý chủ đầu tư này báo doanh thu, lợi nhuận thấp nhất kể từ đầu năm 2021 đến nay.</p><p>Sunshine Homes là đơn vị phát triển bất động sản của Sunshine Group. Công ty này là chủ đầu tư một số dự án lớn tại Hà Nội, như Sunshine City nằm trong khu đô thị Ciputra.</p><p>Chủ đầu tư này giải thích lãi ròng bốc hơi do trong kỳ lãi gộp giảm, dù các chi phí khác đã đi xuống đáng kể. Cụ thể, lãi gộp của Sunshine Homes sụt 678 tỷ đồng, tương ứng kém hơn 94% do hoạt động chuyển nhượng dự án triển khai tại các công ty con giảm.</p><figure class=\"image image_resized\" style=\"width:74.11%;\"><img style=\"aspect-ratio:300/180;\" src=\"data:image/jpeg;base64,\" width=\"300\" height=\"180\"></figure><p>Lũy kế 9 tháng, công ty đạt doanh thu hơn 913 tỷ đồng, bằng 35% cùng kỳ năm trước. Lãi hợp nhất sau thuế cũng lùi về còn trên 361 tỷ đồng, chỉ bằng gần 30% cùng kỳ năm trước.</p><p>Đến hết 30/9, tổng tài sản của Sunshine Homes đạt khoảng 12.300 tỷ đồng, giảm hơn 890 tỷ so với đầu năm. Vốn chủ sở hữu 6.200 tỷ đồng, tăng 360 tỷ so với đầu năm.</p><p>Năm nay, Sunshine Homes đặt mục tiêu đạt doanh thu 4.000 tỷ đồng và lãi sau thuế ở mức hơn 1.000 tỷ. Như vậy, sau 3 quý, doanh nghiệp này mới đạt gần 23% và 36% kế hoạch doanh thu, lợi nhuận cả năm.</p><p>Tại phiên họp thường niên hồi quý II, công ty cho biết có kế hoạch ra mắt 5 dự án trong năm nay, gồm Crystal River, Royal Capital, Grand Capital, Phoenix và Heritage Ha Noi. Các dự án này có khoảng 2.000 căn hộ cao cấp, hơn 5.000 biệt thự, shophouse với tổng giá trị sản phẩm trên 200.000 tỷ đồng.</p><p style=\"text-align:right;\"><strong>Anh Tú</strong></p>','admin','anonymousUser',NULL,'Lợi nhuận Sunshine Homes giảm mạnh','https://vnexpress.net/loi-nhuan-sunshine-homes-giam-manh-4811058.html','\"Trong quý III, lợi nhuận của Sunshine Homes giảm mạnh 98% so với cùng kỳ năm trước, chỉ đạt 7,7 tỷ đồng. Doanh thu cũng sụt giảm 94%, xuống còn 65 tỷ đồng. Nguyên nhân chính là do hoạt động chuyển nhượng dự án giảm mạnh. Lũy kế 9 tháng, doanh thu và lợi nhuận của công ty giảm 65% và 70% so với cùng kỳ năm trước. Mặc dù vậy, công ty vẫn đặt mục tiêu doanh thu 4.000 tỷ đồng và lợi nhuận 1.000 tỷ đồng cho cả năm. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1730730784/tagged-images/emjqp9niquplzfqjcm5q.jpg','Lợi nhuận Sunshine Homes giảm mạnh',NULL,NULL,NULL),(_binary '',NULL,'2024-10-06 22:48:37.520535',14,1,'2024-12-06 22:24:20.070496',13,2,'2024-11-05 16:47:22.748605','https://res.cloudinary.com/dztroerja/video/upload/v1730800062/news-14.mp3.mp3','<p>Từ mùa thu năm 2026, tất cả trường Y ở Ontario được yêu cầu dành ít nhất 95% chỉ tiêu cho dân địa phương, còn lại cho sinh viên các khu vực khác của Canada.</p><p>Thông tin được nêu trong thông cáo báo chí ngày 25/10 của người đứng đầu tỉnh Ontario - ông Doug Ford.</p><p>\"Tôi vừa đến các trường cao đẳng, đại học, có 18% sinh viên từ khắp nơi trên thế giới đã chiếm chỗ của con em chúng tôi. Họ thậm chí không ở lại đây mà quay về nước sau tốt nghiệp\", ông Ford nói.</p><p>Ông Sylvia Jones, giới chức y tế địa phương, cũng đồng tình, cho rằng sinh viên Ontario cần được ưu tiên vì \"là những người nộp thuế\".</p><figure class=\"image\"><img style=\"aspect-ratio:680/383;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/03/355158227-644911490998446-4508-7812-4507-1730591307.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=4sHdCCg3L7GjNSwmz41SGg\" alt=\"Khuôn viên Đại học McMaster ở tỉnh Ontario. Ảnh: McMaster University Fanpage\" width=\"680\" height=\"383\"></figure><p><span style=\"font-size:12px;\"><i>Khuôn viên Đại học McMaster ở tỉnh Ontario. Ảnh: McMaster University Fanpage</i></span></p><p>Tuy nhiên, theo dữ liệu của Ontario, năm học 2023-2024, tỉnh này chỉ có 10 du học sinh ở các trường Y, chiếm một phần nhỏ 0,26% trong tổng số 2.833 sinh viên ngành này. Do đó, tuyên bố của ông Ford được cho là thiếu căn cứ và gây tranh cãi.</p><p>Gautham Kolluri, sáng lập cơ quan du học CIP, gọi kế hoạch của người đứng đầu tỉnh là \"hoàn toàn vô lý\". Kolluri cho biết hầu như không có sinh viên quốc tế nào được nhận vào các trường Y ở tỉnh này, bởi việc tuyển sinh rất cạnh tranh và ưu tiên người bản địa.</p><p>\"Tôi nghe nói chưa đến 1% được nhận nhưng chưa gặp hoặc thấy bất kỳ du học sinh nào\", Kolluri cho hay.</p><p>Chăm sóc sức khỏe hiện thuộc nhóm thiếu hụt nhân lực lao động nhất ở Canada. Nhóm này có nhiều nghề, phổ biến như trợ lý dược sĩ, kỹ thuật viên massage, hộ lý, y tá...</p><p>Số liệu từ Cơ quan Thống kê Canada cho thấy năm 2021, Ontario đón hơn 116.000 chuyên gia y tế có trình độ quốc tế (IEHPS) làm việc trong lĩnh vực này, chiếm gần một nửa toàn quốc.</p><p style=\"text-align:right;\"><strong>Bình Minh (Theo Global News, CBC)</strong></p>','admin','anonymousUser',NULL,'Một tỉnh ở Canada không cho sinh viên quốc tế học ngành Y','https://vnexpress.net/mot-tinh-o-canada-khong-cho-sinh-vien-quoc-te-hoc-nganh-y-4811134.html','\"Thủ tướng Ontario Doug Ford tuyên bố từ mùa thu năm 2026, các trường y ở tỉnh này sẽ dành 95% chỉ tiêu cho sinh viên địa phương. Ông Ford cho rằng du học sinh chiếm chỗ của người dân bản địa và không ở lại sau tốt nghiệp. Tuy nhiên, dữ liệu cho thấy chỉ có 10 du học sinh ở trường y Ontario năm 2023-2024, chiếm 0,26% tổng số sinh viên. Chuyên gia du học Gautham Kolluri cho rằng kế hoạch của ông Ford là hoàn toàn vô lý và việc tuyển sinh trường y rất cạnh tranh, ưu tiên người bản địa. Mặc dù vậy, ngành y tế ở Canada đang thiếu hụt nhân lực trầm trọng, và Ontario đã đón hơn 116.000 chuyên gia y tế quốc tế làm việc trong lĩnh vực này vào năm 2021. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1730732634/tagged-images/xnrubnigng393n4jb5mh.jpg','Một tỉnh ở Canada không cho sinh viên quốc tế học ngành Y',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-06 22:48:56.266007',15,NULL,'2024-11-13 18:16:05.351722',32,1,NULL,NULL,'Tin tức 14 Sanctus amet sed ipsum lorem','admin','admin',NULL,'Tin tức 14 Sanctus amet sed ipsum lorem','',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1728914525/tagged-images/zsnaxikuvhvgct4n3pym.jpg','Tin tức 14 Sanctus amet sed ipsum lorem',NULL,NULL,NULL),(_binary '',1,'2024-10-06 22:49:16.404688',16,4,'2024-12-07 07:08:58.824223',31,2,'2024-11-03 16:02:48.109827','https://res.cloudinary.com/dztroerja/video/upload/v1730795663/news-16_ic3wdu.mp3','<p>VN-Index chốt phiên 16/10 dưới ngưỡng 1.280 điểm khi thanh khoản giảm sâu, các cổ phiếu giằng co trong giai đoạn thiếu vắng thông tin hỗ trợ.</p><p>Giai đoạn chờ kết quả kinh doanh quý III thường là thời điểm giằng co của chứng khoán, với tâm lý nhà đầu tư phân hóa. Thị trường mở cửa phiên giữa tuần gần tham chiếu, đi ngang quanh ngưỡng này cho tới trước giờ nghỉ trưa.</p><p>Lực mua thận trọng, trong khi bên bán cũng không thoát hàng quyết liệt khiến các cổ phiếu đa phần dao động dưới ngưỡng 1%. Trong VN30, VHM tiếp tục sắc xanh nhờ thông tin mua cổ phiếu quỹ, nhưng phần còn lại của nhóm bất động sản đa số ở dưới tham chiếu. Diễn biến này tương tự với nhóm trụ đỡ khác của thị trường là ngân hàng, chứng khoán.</p><p>Sang phiên chiều, thị trường có nhịp biến động mạnh hơn. Áp lực bán tăng lên khiến VN-Index lùi sâu hơn dưới tham chiếu. Tuy nhiên, lực bán nhanh chóng bị hấp thu bởi cầu mua vào ở vùng giá thấp. Chốt phiên, chỉ số của sàn HoSE giảm 1,6 điểm, về dưới ngưỡng 1.280 điểm.</p><p>VN30-Index cũng hạ gần 2 điểm (0,15%), xuống 1.354 điểm. Trên sàn Hà Nội, HNX-Index và UPCOM-Index đóng cửa với thay đổi trong biên độ hẹp.</p><p>Thanh khoản toàn thị trường đạt hơn 14.600 tỷ đồng. Trong đó, sàn HoSE chỉ đạt hơn 13.000 tỷ đồng, giảm gần 4.000 tỷ so với phiên trước. Nhà đầu tư nước ngoài bán ròng hơn 330 tỷ đồng, phiên thứ 4 liên tiếp.</p><p>Cuối phiên, sàn HoSE có 153 cổ phiếu tăng giá, so với 209 mã giảm giá.</p><p>MWG là cổ phiếu đóng góp nhiều nhất cho VN-Index với 0,4 điểm khi mã này tăng 1,7%, lên 65.500 đồng. Ngược lại, SSB là cổ phiếu ghì chỉ số xuống nhiều nhất khi đóng cửa giảm hơn 4%.</p><p>Ngoài SSB, PLX chốt phiên mất hơn 2% thị giá, GAS giảm 1%, MBB, SSI, VRE, FPT, MSN, SHB đóng cửa dưới tham chiếu. Ngược lại, cùng với MWG, SAB, VNM có thêm hơn 1%. Các mã VHM, CTG, VCB, TPB giữ sắc xanh.</p><p>Ở nhóm vốn hóa trung bình, các cổ phiếu trong từng nhóm đa phần biến động trong biên độ hẹp, phân hóa. Trong nhóm bất động sản, DXG, SCR tăng, nhưng NLG, PDR, NVL chốt phiên trong sắc đỏ. Nhóm bán lẻ cũng tương tự khi FRT và DGW đóng cửa ở hai trạng thái.</p><p style=\"text-align:right;\"><strong>Minh Sơn</strong></p>','admin','tranminhkhang',NULL,'VN-Index chốt phiên 16/10 dưới ngưỡng 1.280 điểm khi thanh khoản giảm sâu, các cổ phiếu giằng co trong giai đoạn thiếu vắng thông tin hỗ trợ.',NULL,'\"VN-Index chốt phiên 16/10 giảm 1,6 điểm, xuống dưới 1.280 điểm do thanh khoản giảm mạnh (hơn 14.600 tỷ, giảm gần 4.000 tỷ so với phiên trước).  Thị trường giằng co, thiếu thông tin hỗ trợ, tâm lý nhà đầu tư phân hóa.  Phiên chiều, áp lực bán tăng nhưng nhanh chóng được hấp thụ.  VN30-Index giảm 0,15%.  Nhà đầu tư nước ngoài bán ròng 330 tỷ, phiên thứ 4 liên tiếp.  MWG tăng mạnh, đóng góp tích cực cho VN-Index, trong khi SSB giảm mạnh, kéo chỉ số xuống.  Nhóm ngân hàng, bất động sản, chứng khoán biến động trái chiều.  Nhiều cổ phiếu dao động dưới 1%.  HNX-Index và UPCOM-Index biến động nhẹ.  Các cổ phiếu vốn hóa trung bình phân hóa mạnh.\"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729324361/tagged-images/lplajpvg5ez9qtttcjwp.jpg','Chứng khoán chưa thoát sắc đỏ',NULL,NULL,'2024-12-07 07:08:56.848394'),(_binary '',NULL,'2024-10-06 23:14:19.257063',17,2,'2024-11-13 11:51:35.057951',72,2,'2024-11-05 15:37:00.255929','https://res.cloudinary.com/dztroerja/video/upload/v1730795666/news-17_ylggyj.mp3','<p>Việt Nam - Ngôi sao đang lên của châu Á của Brook Tayloy và Sam Korsmoe khám phá sự phát triển kinh tế Việt Nam trong 25 năm qua, đánh giá mức bứt phá tiếp theo.</p><p>Cuốn sách được xuất bản bằng tiếng Việt bởi Công ty Cổ phần Xuất bản và Giáo dục Quảng Văn cùng Nhà xuất bản Hồng Đức. Trước đó, sách xuất bản lần đầu bằng tiếng Anh bởi Silkworm Books International vào tháng 10/2023.</p><p>Tác giả cho rằng Việt Nam là con hổ kinh tế mới của châu Á, giống Hàn Quốc và Đài Loan (Trung Quốc). Trong 25 năm qua, Việt Nam phát triển từ một trong những quốc gia nghèo nhất châu Á trở thành nước có thu nhập trung bình cao, trung tâm sản xuất quan trọng của thế giới. Năm 2000, tổng thương mại toàn cầu của Việt Nam với thế giới là 30 tỷ USD và GDP đạt khoảng 31 tỷ USD. Đến cuối năm 2023, thương mại toàn cầu của Việt Nam tăng ở mức 683 tỷ USD, quy mô nền kinh tế khoảng 450 tỷ USD. Ngoài ra, tỷ lệ nghèo giảm dưới 1%, từ mức hơn 50% vào những năm 1990.</p><p>Đây là những xu hướng lịch sử được chứng minh bằng dữ liệu. Ngoài ra, trong cuốn sách, những câu hỏi về tương lai kinh tế Việt Nam được đặt ra: liệu Việt Nam có thể duy trì mức tăng trưởng cao như những năm qua không? Thương mại tự do và đầu tư trực tiếp nước ngoài có phải là con đường dẫn đến sự giàu có bền vững cho đất nước không? Việt Nam có thể phát triển và tiến bộ như các con hổ kinh tế Hàn Quốc và Đài Loan (Trung Quốc)?.</p><figure class=\"image\"><img style=\"aspect-ratio:660/439;\" src=\"https://i1-giaitri.vnecdn.net/2024/09/01/O-ng-Brook-Taylor-jpeg-5412-1725179834.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=b-5YzFo-X-pygn1UZD-z3w\" alt=\"Ông Brook Taylor có nhiều năm sinh sống và làm việc tại Việt Nam. Ảnh: NVCC\" width=\"660\" height=\"439\"></figure><p><span style=\"font-size:12px;\"><i>Ông Brook Taylor có nhiều năm sinh sống và làm việc tại Việt Nam. Ảnh: NVCC</i></span></p><p>Ông Brook Taylor và ông Sam Korsmoe là những chuyên gia nước ngoài sinh sống lâu năm tại Việt Nam. Brook Taylor đến từ New Zealand, sống và làm việc tại Việt Nam từ năm 1997, trong khi ông Sam Korsmoe đến từ Mỹ, bén duyên với Việt Nam từ năm 1990. Cả hai chứng kiến sự thay đổi của đất nước trong 25 năm qua và họ tò mò sự tăng trưởng này bền vững trong 25 năm tới hay không.</p><p>\"Dựa trên mọi chỉ số kinh doanh và kinh tế có thể đo lường, Việt Nam tăng trưởng liên tục trong 25 năm qua. Chúng tôi muốn nghiên cứu, viết về \'cách thức\' và \'lý do\' cho sự phát triển của Việt Nam. Nhưng quan trọng hơn, chúng tôi muốn biết liệu Việt Nam có thể thoát khỏi bẫy thu nhập trung bình trong tương lai hay không\", hai tác giả cho biết.</p><p>Việt Nam - Ngôi sao đang lên của châu Á (bản tiếng Anh và tiếng Việt) với 12 chương, bao gồm sáu nghiên cứu trường hợp và một dự báo về viễn cảnh kinh tế đến năm 2050. Cuốn sách cung cấp một cái nhìn bao quát, ngắn gọn về lịch sử Việt Nam, trên cơ sở đó tập trung vào tương lai đất nước cũng như những tiền đề để Việt Nam trở thành một \"con hổ kinh tế châu Á\" như Hàn Quốc và Đài Loan (Trung Quốc) đạt được trong thập niên 1980, 1990.</p><p>Giáo sư Carlyle Thayer từ Đại học New South Wales, Canberra viết lời mở đầu cho cuốn sách tiếng Anh. Ông nổi tiếng với những những nghiên cứu về nhiều vấn đề Việt Nam đương đại, công bố đều đặn nhiều cuốn sách về các chủ đề liên quan đến Việt Nam. Carlyle cho biết, cuốn sách này cho ông một cơ hội để đánh giá lại cách nhìn nhận và phân tích của mình với sự phát triển của Việt Nam, đặc biệt giúp ông đánh giá tương lai lâu dài.</p><p>Theo Giáo sư Thayer, cuốn sách sẽ lấp đầy khoảng trống trong nghiên cứu tại Việt Nam vì mang tính liên ngành, hơi thở đương đại và hướng tới tương lai.</p><p>Ông Brook Taylorcó hơn 30 năm kinh nghiệm trong lĩnh vực tài chính và quản lý, bao gồm 25 năm tại Việt Nam, 8 năm là lãnh đạo cấp cao tại các công ty kiểm toán thuộc Big 5. Ông cũng có 17 năm giữ chức vụ Giám đốc Điều hành và Tổng Giám đốc Công ty Quản lý Quỹ tại VinaCapital, một tập đoàn quản lý đầu tư đa ngành với hơn 3,8 tỷ USD tài sản quản lý tại Việt Nam.</p><p style=\"text-align:right;\"><strong>Thanh Thư</strong></p>','admin','ngochan',NULL,'Sách về 25 năm kinh tế Việt Nam tăng trưởng xuất bản',NULL,'\"Cuốn sách Việt Nam - Ngôi sao đang lên của châu Á phân tích sự phát triển kinh tế ấn tượng của Việt Nam trong 25 năm qua, từ một quốc gia nghèo khó trở thành nước có thu nhập trung bình cao, trung tâm sản xuất quan trọng. Cuốn sách đặt câu hỏi về khả năng duy trì tăng trưởng cao, vai trò của thương mại tự do và đầu tư nước ngoài trong tương lai. Tác giả phân tích tiềm năng để Việt Nam trở thành con hổ kinh tế châu Á tương tự Hàn Quốc và Đài Loan, đồng thời đưa ra dự báo cho nền kinh tế Việt Nam đến năm 2050. Cuốn sách cung cấp cái nhìn bao quát về lịch sử và tương lai của Việt Nam, dựa trên nghiên cứu liên ngành và dữ liệu thực tế. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729325220/tagged-images/psmdsbcxfyd4z89j3xl3.jpg','Sách về 25 năm kinh tế Việt Nam tăng trưởng xuất bản',NULL,NULL,NULL),(_binary '',NULL,'2024-10-06 23:14:35.001617',18,2,'2024-12-06 21:11:36.004147',25,2,'2024-11-05 15:24:45.173957','https://res.cloudinary.com/dztroerja/video/upload/v1730795117/news-18.mp3.mp3','<p>Bộ Tài chính đề xuất giảm một nửa thuế bảo vệ môi trường với xăng, 70% cho nhiên liệu bay và 40% với dầu hỏa đến hết năm sau.</p><p>Chính sách giảm thuế bảo vệ môi trường với xăng dầu được áp dụng từ tháng 4 năm 2022. Hiện mức thuế này vẫn được giảm 50%, tương ứng 2.000 đồng tính trên một lít xăng (trừ etanol) và 1.000 đồng với mỗi lít dầu diesel. Chính sách này hết hiệu lực cuối năm nay, kéo theo thuế bảo vệ môi trường với xăng dầu sẽ quay lại mức trần từ đầu năm sau.</p><p>Để đảm bảo mục tiêu tăng trưởng ổn định, Bộ Tài chính đề xuất kéo dài chính sách này đến hết năm sau. Việc này nhằm góp phần bình ổn giá bán xăng dầu trong nước, kiềm chế tăng giá tiêu dùng - CPI.</p><p>Theo đó, phương án giảm thuế bảo vệ môi trường năm 2025 được Bộ Tài chính đề xuất tương tự như chính sách đang áp dụng. Cụ thể, thuế bảo vệ môi trường với xăng, trừ etanol dự kiến trong 2025 vẫn là 2.000 đồng một lít; nhiên liệu bay, dầu diesel, dầu mazut, dầu nhờn là 1.000 đồng một lít; mỡ nhờn 1.000 đồng một kg; dầu hỏa 600 đồng một lít.</p><p>Từ 2026, thuế bảo vệ môi trường dự kiến quay về mức trần, theo quy định là xăng (trừ etanol) là 4.000 đồng một lít; nhiên liệu bay 3.000 đồng một lít; dầu diesel, dầu mazut, dầu nhờn là 2.000 đồng một lít; dầu hỏa 1.000 đồng một lít; mỡ nhờn là 2.000 đồng một kg.</p><figure class=\"image\"><img style=\"aspect-ratio:680/454;\" src=\"https://i1-kinhdoanh.vnecdn.net/2024/11/04/xang-dau-2-2022-Quynh-Tran-jpe-6693-2604-1730726516.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=hayuczVS_AeRlybcapM7qQ\" alt=\"Cây xăng góc đường Lý Chính Thắng - Trương Định (quận 3, TP HCM), tháng 2/2022. Ảnh: Quỳnh Trần\" width=\"680\" height=\"454\"></figure><p><span style=\"font-size:12px;\"><i>Cây xăng góc đường Lý Chính Thắng - Trương Định (quận 3, TP HCM), tháng 2/2022. Ảnh: Quỳnh Trần</i></span></p><p>Bộ Tài chính cho biết chính sách giảm thuế môi trường với xăng dầu thời gian qua kiểm soát lạm phát, ổn định kinh tế vĩ mô. Bởi việc điều chỉnh mức thuế này sẽ tác động trực tiếp đến giá bán lẻ xăng dầu trong nước. Do đó, đây cũng được xem là một công cụ để thực hiện kiểm soát lạm phát.</p><p>Theo nhà chức trách, việc duy trì chính sách giảm thuế trong năm 2024 đã giúp giá xăng dầu luôn ổn định dù giá thế giới có lúc tăng mạnh. Tính đến 31/10, xăng dầu đã qua 44 kỳ điều hành giá, trong đó có 23 phiên giảm, 18 phiên tăng và 3 phiên tăng giảm đan xen. \"Hiện, giá xăng dầu đã được kéo về mức thấp hơn so với cuối năm 2023\", Bộ Tài chính thông tin.</p><p>Với sản lượng tiêu thụ xăng, dầu, mỡ nhờn năm 2025 tương đương năm nay, Bộ Tài chính ước tính tổng ngân sách nhà nước giảm thu khoảng 44.224 tỷ đồng (gồm hơn 40.204 tỷ đồng giảm thuế bảo vệ môi trường và hơn 4.020 tỷ đồng thuế giá trị gia tăng - VAT).</p><p>Trước đó, số giảm thu ngân sách năm 2023 khoảng hơn 34.473 tỷ đồng. Riêng 9 tháng đầu năm 2024, số giảm ước tính khoảng 28.900 tỷ đồng (chưa bao gồm giảm thu thuế VAT).</p><p>Giảm thu ngân sách song Bộ Tài chính đánh giá đây sẽ là khoản hỗ trợ trực tiếp của Nhà nước để giúp người dân, doanh nghiệp phục hồi, phát triển sản xuất, kinh doanh, phát triển kinh tế - xã hội.</p><p style=\"text-align:right;\"><strong>Phương Dung</strong></p>','tranminhkhang8888@gmail.com','anonymousUser',NULL,'Đề xuất giảm tiếp thuế môi trường với xăng dầu hết năm 2025','https://vnexpress.net/de-xuat-giam-tiep-thue-moi-truong-voi-xang-dau-het-nam-2025-4812100.html','\"Bộ Tài chính đề xuất kéo dài chính sách giảm thuế bảo vệ môi trường đối với xăng dầu đến hết năm 2025 nhằm ổn định giá bán, kiềm chế lạm phát. Mức giảm tương tự năm 2024, gồm 50% với xăng, 70% với nhiên liệu bay và 40% với dầu hỏa. Từ năm 2026, thuế sẽ quay về mức trần. Việc giảm thuế giúp kiểm soát lạm phát, ổn định kinh tế vĩ mô. Tuy nhiên, ngân sách nhà nước sẽ giảm khoảng 44.224 tỷ đồng trong năm 2025. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1730739829/tagged-images/ski6hzy70tenazuch3wh.jpg','Đề xuất giảm tiếp thuế môi trường với xăng dầu hết năm 2025',NULL,NULL,NULL),(_binary '',1,'2024-10-06 23:15:58.205015',19,3,'2024-12-05 20:31:19.070503',24,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1732932105/news-19.mp3.mp3','<p>Khu công nghiệp VSIP II Quảng Ngãi (giai đoạn 1) thuộc Khu kinh tế Dung Quất dự kiến đưa vào kinh doanh từ quý IV/2025.</p><p>Thông tin được Công ty TNHH VSIP Quảng Ngãi nêu trong báo cáo đánh giá tác động môi trường (ĐTM) Khu công nghiệp VSIP II Quảng Ngãi đang tham vấn ý kiến.</p><p>Theo đó, dự án Đầu tư xây dựng và kinh doanh kết cấu hạ tầng khu công nghiệp VSIP II Quảng Ngãi (giai đoạn 1) thuộc khu kinh tế Dung Quất, nằm trên địa bàn hai xã Bình Thanh, Bình Hiệp, huyện Bình Sơn. Vị trí này cách cảng Dung Quất khoảng 23 km và sân bay Chu Lai 33 km về phía Bắc.</p><p>Dự án có quy mô gần 500 ha, một mặt giáp Quốc lộ 1A. Hiện trạng khu vực triển khai dự án chủ yếu là đất nông nghiệp, đất ở nông thôn, sông ngòi, thuỷ lợi. Dự án có nhu cầu chuyển đổi mục đích sử dụng đất khoảng 154 ha đất trồng cây lâu năm, gần 145 ha đất trồng lúa, hơn 60 ha đất rừng sản xuất... Ngoài ra, khoảng 17 ha đất ở nông thôn dự kiến bị ảnh hưởng với khoảng 130 hộ dân đang sinh sống.</p><p>Hiện Ban quản lý khu kinh tế Dung Quất và UBND huyện Bình Sơn đã xây dựng Khu tái định cư Bình Long gần 15 ha và khu nghĩa trang nhân dân Phượng Hoàng (giai đoạn 2) gần 5 ha để đáp ứng tiến độ dự án VSIP II Quảng Ngãi và khu công nghiệp đô thị, dịch vụ Bình Thanh.</p><figure class=\"image\"><img style=\"aspect-ratio:680/489;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/03/Hi-nh-a-nh-3-11-24-lu-c-12-01-1385-9242-1730613009.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=VARYEtilgmyVt-tV2KBi3w\" alt=\"Vị trí khu vực quy hoạch dự án Khu công nghiệp VSIP II Quảng Ngãi (giai đoạn 1). Ảnh: ĐTM\" width=\"680\" height=\"489\"></figure><p><span style=\"font-size:12px;\"><i>Vị trí khu vực quy hoạch dự án Khu công nghiệp VSIP II Quảng Ngãi (giai đoạn 1). Ảnh: ĐTM</i></span></p><p>Theo quy hoạch, khu công nghiệp VSIP II Quảng Ngãi gồm các hạng mục chính như khu công trình dịch vụ, công trình sản xuất, kho tàng, hạ tầng kỹ thuật... Dự án sẽ phát triển đa ngành, công nghiệp công nghệ cao, thân thiện môi trường gắn với khu đô thị - dịch vụ hỗ trợ. Các ngành được ưu tiên thu hút đầu tư gồm sản xuất ôtô, dệt may, chế biến thực phẩm, đồ uống, chế biến, chế tạo...</p><p>Tổng vốn đầu tư dự án gần 3.800 tỷ đồng. Quy mô công nhân dự kiến khoảng 49.000 lao động.</p><p>Thời hạn hoạt động của dự án là 50 năm. Chủ đầu tư cho biết giai đoạn thi công trong vòng 60 tháng (5 năm). Từ quý IV/2025, dự án có thể đưa vào vận hành, kêu gọi đầu tư và giao đất cho chủ dự án thứ cấp.</p><p>Hiện VSIP có hơn 14 dự án khu công nghiệp vận hành trên toàn quốc, tính từ 1996 đến nay. Bên cạnh Quảng Ngãi, thời gian qua, chủ đầu tư này cũng được chấp thuận chủ trương đầu tư thêm khu công nghiệp ở Thái Bình, Lạng Sơn, Hà Tĩnh, Bình Thuận.</p><p>Với vị trí chiến lược trong vùng kinh tế trọng điểm miền Trung, Quảng Ngãi hiện có 5 khu công nghiệp và 20 cụm công nghiệp đã đi vào hoạt động, trong đó có một khu kinh tế Dung Quất với quy mô hơn 45.000 ha. Theo quy hoạch tới 2030 được Chính phủ duyệt, Quảng Ngãi sẽ trở thành tỉnh công nghiệp theo hướng hiện đại với hai ngành chủ lực là lọc hóa dầu và luyện kim thép.</p><p style=\"text-align:right;\"><strong>Đình Trí</strong></p>','admin','khang2002',NULL,'Khu công nghiệp VSIP Quảng Ngãi gần 500 ha dự kiến vận hành từ 2025','https://vnexpress.net/khu-cong-nghiep-vsip-quang-ngai-gan-500-ha-du-kien-van-hanh-tu-2025-4811576.html','\"Khu công nghiệp VSIP II Quảng Ngãi (giai đoạn 1), quy mô gần 500ha, dự kiến hoạt động từ quý IV/2025.  Dự án nằm tại Bình Thanh, Bình Hiệp (Bình Sơn), gần cảng Dung Quất và sân bay Chu Lai.  Đất dự án chủ yếu là nông nghiệp, cần chuyển đổi khoảng 359 ha, ảnh hưởng 130 hộ dân.  Khu tái định cư đã được xây dựng.  Dự án đầu tư gần 3.800 tỷ đồng, tạo việc làm cho 49.000 người.  Thời gian thi công 5 năm.  VSIP II Quảng Ngãi sẽ phát triển đa ngành, ưu tiên công nghiệp công nghệ cao, thân thiện môi trường.  Dự án có thời hạn hoạt động 50 năm.  Chủ đầu tư là VSIP, có kinh nghiệm phát triển nhiều KCN trên toàn quốc.\"','https://res.cloudinary.com/dd1grolgr/image/upload/v1730730933/tagged-images/nw025p7v6l0ucw68wtew.jpg','Khu công nghiệp VSIP Quảng Ngãi gần 500 ha dự kiến vận hành từ 2025',NULL,NULL,'2024-11-30 09:01:17.104064'),(_binary '\0',NULL,'2024-10-13 17:01:48.205476',20,NULL,'2024-11-13 18:16:12.023602',16,1,NULL,NULL,'Tin tức 19 Sanctus amet sed ipsum lorem','admin','admin',NULL,'Tin tức 19 Sanctus amet sed ipsum lorem',NULL,NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1728914525/tagged-images/zsnaxikuvhvgct4n3pym.jpg','Tin tức 19 Sanctus amet sed ipsum lorem',NULL,NULL,NULL),(_binary '',NULL,'2024-10-16 23:06:24.663652',22,3,'2024-11-21 16:38:34.985055',10,2,'2024-11-06 19:33:44.335546','https://res.cloudinary.com/dztroerja/video/upload/v1730896506/news-22.mp3.mp3','<p>Giá đất nhiều quận huyện trong dự thảo mới nhất giảm nhiều so với trước, trong đó đường Đồng Khởi, Lê Lợi, Nguyễn Huệ còn 687 triệu một m2, thay vì 810 triệu như đề xuất cũ.</p><p>Nội dung được nêu tại dự thảo Quyết định sửa đổi, bổ sung Quyết định 02/2020 về bảng giá đất trên địa bàn TP HCM được Sở Tài nguyên và Môi trường hoàn thiện, trình UBND TP HCM hôm nay.</p><p>Theo đó, nếu chưa tính hệ số K (hệ số điều chỉnh) giá đất điều chỉnh dự kiến tăng 4-38 lần so với giá được quy định tại Quyết định 02/2020. Tuy nhiên, nhiều vị trí lại giảm hơn 2 lần so với dự thảo hồi tháng 7.</p><p>Cụ thể, với khu vực quận 1, những tuyến đường có giá cao nhất thành phố là Đồng Khởi, Lê Lợi, Nguyễn Huệ được điều chỉnh giảm xuống còn 687 triệu đồng mỗi m2 thay cho mức 810 triệu đồng ở dự thảo trước đó. Như vậy, mức giá này tăng 4,2 lần so với bảng giá đất hiện hành, nhưng giảm 16% so với giá đề xuất cũ.<br><img src=\"https://i1-vnexpress.vnecdn.net/2024/10/16/11duong-Dong-Khoi-TPHCM-4098-1-9607-8318-1729072458.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=8tQafr2lWwESMYm3NaAHzA\" alt=\"Tuyến đường Đồng Khởi, đoạn Nguyễn Du đến Tôn Đức Thắng, tập trung phần lớn khách sạn từ 3 đến 5 sao của TP HCM. Ảnh: Nguyễn Nam\" width=\"680\" height=\"499\"><br><span style=\"font-size:12px;\"><i>Tuyến đường Đồng Khởi, đoạn Nguyễn Du đến Tôn Đức Thắng, tập trung phần lớn khách sạn từ 3 đến 5 sao của TP HCM. Ảnh: Nguyễn Nam</i></span></p><p>Mức giá dự kiến ở một số tuyến đường lân cận như Đông Du là 409 triệu đồng mỗi m2; tuyến Hai Bà Trưng (tùy đoạn) có giá từ 350-450 triệu đồng, đường Tôn Đức Thắng (đoạn từ Công trường Mê Linh đến cầu Nguyễn Tất Thành) có giá 447 triệu đồng. Mức giá này tăng 3-4,5 lần so với giá đất tại Quyết định 02 nhưng thấp hơn so với dự thảo cũ 100-200 triệu đồng.</p><p>Khu vực quận 3, toàn bộ tuyến đường Nam Kỳ Khởi Nghĩa, Hai Bà Trưng, Nguyễn Thị Minh Khai, Công Trường Quốc Tế dự kiến là nơi có giá đất mới cao nhất quận, từ 305-340 triệu đồng mỗi m2, giảm 20-30% so với giá đề xuất trước và tăng khoảng 5 lần so với hiện tại.</p><p>Loạt tuyến đường giao thương sầm uất khác trên địa bàn này như Võ Văn Tần, Nguyễn Đình Chiểu, Cao Thắng, Pasteur... cũng được đề xuất mức giá mới còn 262-272 triệu đồng mỗi m2, giảm từ 8-15% so với giá đề xuất trước và tăng 5-6 lần so với hiện tại.</p><p>Thành phố Thủ Đức (gồm quận 2, quận 9 và Thủ Đức cũ) cũng là địa phương có thay đổi mạnh theo dự thảo bảng giá đất mới. Mức giá đất hiện hành tại khu vực này trung bình từ 5-8 triệu đồng mỗi m2. Tại dự thảo bảng giá đất điều chỉnh tháng 7, các tuyến đường như Trần Não, Lương Định Của lên đến 149 triệu đồng mỗi m2, tăng 11 lần. Còn theo dự thảo này, giá đất xuống còn 120 triệu đồng mỗi m2 (chỉ tăng 9 lần so với giá hiện tại). Đường 23 phường Long Thạnh Mỹ theo bảng giá điều chỉnh tháng 7 tăng 28 lần, hiện tại giá mới nhất được đề xuất chỉ tăng 22 lần.</p><p>Thay đổi nhiều nhất trong bảng giá đất điều chỉnh bổ sung lần này là giá đất tại 5 huyện vùng ven đã giảm khá mạnh. Cụ thể, giá đất một số tuyến đường từng chênh đến 40 lần là Đặng Công Bình, theo mức giá mới trong dự thảo còn 18,5 triệu đồng mỗi m2 thay cho mức 41 triệu đồng đề xuất trước đó. Đường Song Hành quốc lộ 22 giá cao nhất được đề nghị là 32 triệu đồng mỗi m2 thay cho mức đề xuất hồi tháng 7 là 71 triệu đồng mỗi m2, giá mới chỉ tăng gấp 20 lần thay cho mức 51 lần trước đó.</p><p>Hay đường Trần Đại Nghĩa (huyện Bình Chánh) hồi tháng 7 được đề xuất giá tăng đến 25 lần, từ 1,7 triệu đồng mỗi m2 lên đến 43 triệu đồng mỗi m2, nay theo bảng giá đất mới nhất còn 34 triệu đồng mỗi m2, tăng 20 lần.</p><p>Khu vực Củ Chi, tuyến đường Tỉnh lộ 7 từng có giá điều chỉnh tăng 30 lần so với hiện tại, theo bảng giá mới đã xuống 8,7 triệu đồng mỗi m2, tăng 24 lần...</p><p>Tìm hiểu từ VnExpress cũng cho thấy, giá đất trong dự thảo này đang thấp hơn so với giá giao dịch trên thị trường từ 25-50%. Ví dụ như tuyến đường Đồng Khởi, Nguyễn Huệ (quận 1), mức giá mới dự kiến là 687 triệu đồng một m2, trong khi theo khảo sát từ nhiều đơn vị nghiên cứu, giá nhà đất hai khu vực này được bán từ 1,2-2 tỷ đồng một m2.</p><p>Khu vực TP Thủ Đức, nhiều lô đất trên đường Trần Não, Lương Định Của thuộc phường Bình An đang chào giá bán 180-250 triệu đồng một m2, cao hơn 20-30% so với dự thảo bảng giá đất điều chỉnh mới (120 triệu đồng một m2). Tuyến đường Đặng Hữu Phổ thuộc phường Thảo Điền giá bán thực tế 155 triệu đồng một m2, cũng cao hơn 50% so với mức đề xuất 71 triệu đồng.</p><p>Khu vực quận 9 cũ, tuyến đường Đỗ Xuân Hợp có giá dự kiến mới là 66 triệu đồng mỗi m2 (trước đó là 81,7 triệu đồng một m2), nhưng giá giao dịch hiện tại trung bình 120 triệu đồng một m2.</p><p>Với các huyện ngoại thành như Nhà Bè, hai tuyến đường Phạm Hùng, Huỳnh Tấn Phát điều chỉnh tăng lên cao nhất là 56-64 triệu đồng mỗi m2 (đề xuất trước đó 70-78 triệu đồng một m2), thực tế giá đất trên những con đường này đều không dưới 100-120 triệu đồng một m2.</p><p>Hay huyện Hóc Môn, giá đất một số tuyến đường từng chênh đến 40 lần là Đặng Công Bình, theo mức giá điều chỉnh mới sẽ còn 18,5 triệu đồng mỗi m2 (tăng khoảng 20 lần so với giá hiện hành), thực tế giá nhà mặt tiền tuyến đường này trung bình vào khoảng 35 triệu đồng mỗi m2. Đường Song Hành quốc lộ 22 giá cao nhất là 32 triệu đồng mỗi m2 còn thực tế đất gần đường có giá bán từ 50-80 triệu đồng mỗi m2...</p><p>Như vậy, sau gần ba tháng lấy ý kiến các bên lẫn gặp nhiều tranh cãi trái chiều, ở dự thảo này, giá đất điều chỉnh đã giảm nhiều so với đề xuất ban đầu.</p><p>Bảng giá đất điều chỉnh lần này nếu được UBND thành phố thông qua sẽ sử dụng đến hết năm 2025. Cuối năm nay, cơ quan quản lý sẽ đánh giá lại để đảm bảo phù hợp tình hình kinh tế. Từ đầu năm 2026, thành phố sẽ áp dụng bảng giá đất hằng năm chung theo Luật đất đai.</p><p>UBND TP HCM khẳng định xây dựng bảng giá đất điều chỉnh tuân thủ các quy định. Đến nay, thành phố đã thực hiện đủ các bước về lập và chấp thuận đề nghị xây dựng; soạn thảo, lấy ý kiến rộng rãi và thẩm định dự thảo quyết định thay thế Quyết định 02. Các ý kiến góp ý đã được Sở Tài nguyên và Môi trường tiếp thu đầy đủ vào dự thảo.</p><p>Trước đó, TP HCM dự kiến ban hành bảng giá đất điều chỉnh áp dụng từ ngày 1/8 khi Luật Đất đai 2024 có hiệu lực. Tuy nhiên, việc này gặp nhiều phản ứng trái chiều khi cho rằng giá đất nhiều khu vực, đặc biệt các huyện ngoại thành tăng đột biến, tác động lớn đến người dân.</p><p>Theo đó, giá đất trong dự thảo bảng giá điều chỉnh tháng 7 tại nhiều địa bàn có xu hướng tăng trung bình từ 5-10 lần, một số địa phương thuộc khu vực ngoại thành và vùng ven TP HCM dự kiến điều chỉnh tăng đột biến từ 15-50 lần so với hiện tại (chưa nhân hệ số K). Tuy nhiên, sở khẳng định giá đất này mới chỉ bằng 70% thị trường.</p><p>Do không có bảng giá điều chỉnh, hàng nghìn hồ sơ đất đai bị ùn ứ vì tắc khâu tính thuế. Theo thống kê của Cục Thuế TP HCM, từ 1/8-22/9, đơn vị này đã tiếp nhận hơn 15.800 hồ sơ đất đai. Cơ quan này đã ba lần gửi kiến nghị đến UBND TP HCM, xin phương án giải quyết dứt điểm để tính nghĩa vụ tài chính cho dân. Ngày 21/9, UBND TP HCM cho phép tiếp tục sử dụng bảng giá đất hiện hành để tính thuế cho các hồ sơ phát sinh từ ngày 1/8, trong lúc chờ ban hành bảng giá đất mới.</p><p>Theo đánh giá của Thứ trưởng Tài chính Lê Tấn Cận, việc các giao dịch đất đai nghẽn đã ảnh hưởng đến thu ngân sách của thành phố, khiến 9 tháng đầu năm, địa phương này có mức thu xếp sau Hà Nội. Cụ thể, thu sử dụng đất của Hà Nội trong 9 tháng đạt gần 33.000 tỷ đồng, còn TP HCM chỉ khoảng 5.900 tỷ đồng, tức thấp hơn khoảng 27.000 tỷ đồng. Theo ông Cận, khi TP HCM ban hành được bảng giá đất điều chỉnh sẽ giúp thành phố có những triển vọng, phát triển tốt hơn để có nguồn thu ngân sách đảm bảo theo dự toán.</p><p>Cùng với giá đất ở, TP HCM dự kiến điều chỉnh bảng giá đất thương mại dịch vụ, sản xuất kinh doanh và đất khu công nghệ cao đều có xu hướng tăng. Đơn cử, đối với đất khu công nghệ cao nhưng dùng để sản xuất kinh doanh, không sử dụng cho thương mại dịch vụ, dự kiến giá tăng 7 lần từ 1,74 triệu đồng mỗi m2 lên 12,18 triệu đồng. Riêng hai vị trí đường D1,D2 Khu công nghệ cao tăng từ 2,16 triệu đồng mỗi 2 lên 15,12 triệu đồng. Trong khi đó, cũng trong Khu công nghệ cao nhưng đất dành cho thương mại dịch vụ tăng 9,1 lần, từ 2,32 triệu đồng mỗi m2 lên hơn 21 triệu đồng.</p><p style=\"text-align:right;\">Lê Tuyết - Phương Uyên</p>','admin','minhkhang6',NULL,'Bảng giá đất điều chỉnh ở TP HCM dự kiến cao nhất 687 triệu đồng','https://vnexpress.net/bang-gia-dat-dieu-chinh-o-tp-hcm-du-kien-cao-nhat-687-trieu-dong-4804962.html','\"Dự thảo bảng giá đất mới nhất tại TP HCM đã được điều chỉnh, giảm giá đất nhiều quận huyện, đặc biệt là các tuyến đường cao cấp ở quận 1. Tuy nhiên, giá đất vẫn tăng so với hiện tại nhưng thấp hơn so với dự thảo trước. Vùng ven TP HCM cũng giảm mạnh, giá đất tăng thấp hơn so với đề xuất trước. Giá đất dự thảo vẫn thấp hơn so với giá thị trường. TP HCM dự kiến áp dụng bảng giá mới từ cuối năm 2025, đồng thời điều chỉnh giá đất thương mại dịch vụ, sản xuất kinh doanh và khu công nghệ cao. \"','https://i1-vnexpress.vnecdn.net/2024/10/16/11duong-Dong-Khoi-TPHCM-4098-1-9607-8318-1729072458.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=OmhtORsiBJozOGc4sYdTDg','Bảng giá đất điều chỉnh ở TP HCM dự kiến cao nhất 687 triệu đồng',NULL,NULL,NULL);
INSERT INTO `news` VALUES (_binary '\0',NULL,'2024-10-17 17:33:33.551390',23,1,'2024-11-06 15:26:47.707201',2,2,'2024-11-03 17:27:55.482845','https://res.cloudinary.com/dztroerja/video/upload/v1730795664/news-23_nbd5cm.mp3','<p>Việt Nam sẽ tiếp tục tham vấn với Lào và Campuchia về thúc đẩy hợp tác giữa ba nước, sau khi Campuchia rút khỏi cơ chế Tam giác phát triển.</p><p>\"Trong 25 năm qua, cơ chế hợp tác Khu vực Tam giác phát triển Campuchia - Lào - Việt Nam (CLV) đã góp phần thúc đẩy quan hệ truyền thống, cũng như hợp tác kinh tế, thương mại, giao lưu nhân dân và góp phần thu hẹp khoảng cách phát triển, nâng cao đời sống người dân tại khu vực biên giới cũng như cả ba nước\", người phát ngôn Bộ Ngoại giao Phạm Thu Hằng ngày 17/10 bình luận về việc Campuchia rút khỏi cơ chế hợp tác Khu vực Tam giác phát triển CLV.</p><p>Người phát ngôn khẳng định mối quan hệ đoàn kết, gắn bó, hữu nghị và tin cậy giữa ba nước Việt Nam - Lào - Campuchia là \"tài sản quý báu của cả ba quốc gia, ba dân tộc\". Khu vực Tam giác phát triển CLV là một trong nhiều cơ chế hợp tác đang tồn tại giữa ba nước, trong đó mỗi cơ chế đều có giá trị và đóng góp riêng cho quan hệ hợp tác hữu nghị và sự phát triển giữa các bên.</p><p>\"Việt Nam đã, đang và sẽ tiếp tục tham vấn với Lào và Campuchia để tiếp tục thúc đẩy hợp tác giữa ba nước sâu rộng, thực chất, hiệu quả, phù hợp với nhu cầu phát triển trong giai đoạn mới, vì lợi ích của người dân ba nước và vì Cộng đồng ASEAN hòa bình, ổn định, hợp tác, phát triển\", bà Hằng nhấn mạnh.</p><figure class=\"image\"><img style=\"aspect-ratio:1020/650;\" src=\"data:image/jpeg;base64,\" width=\"1020\" height=\"650\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Người phát ngôn Bộ Ngoại giao Phạm Thu Hằng tại cuộc họp báo ngày 17/10. Ảnh: BNG</i></span></p><p>Tam giác Phát triển CLV là sáng kiến hợp tác tại khu vực biên giới ba nước Campuchia, Lào và Việt Nam gồm 13 tỉnh có đường biên giới hoặc có liên quan đến khu vực biên giới chung giữa ba nước là: Mondulkiri, Rattanakiri, Stung Treng và Kratié của Campuchia; Attapu, Salavan, Sekong và Champasak của Lào; Kon Tum, Gia Lai, Đắk Lắk, Đắk Nông, Bình Phước của Việt Nam. Sáng kiến thành lập do ông Hun Sen, khi đó là thủ tướng Campuchia, đề xuất và được chính thức công bố năm 1999.</p><p>Các lãnh đạo Campuchia ngày 20/9 tuyên bố nước này rút khỏi cơ chế. Theo Khmer Times, Chủ tịch Quốc hội Campuchia Khuon Sudary đã gửi thư thông báo cho Chủ tịch Quốc hội Trần Thanh Mẫn và Chủ tịch Quốc hội Lào Xaysomphone Phomvihane, bày tỏ đánh giá cao sự hợp tác và nỗ lực mà cả ba quốc gia đã đầu tư trong 25 năm qua, cho biết cơ chế đã mang lại nhiều lợi ích thiết thực, đặc biệt là đối với các cộng đồng ở những tỉnh biên giới.</p><p>\"Quyết định này phù hợp với sự thay đổi lớn hơn của chính phủ Campuchia trong các chiến lược ngoại giao và phát triển khu vực\", bà Khuon Sudary viết, đồng thời nhấn mạnh Campuchia cam kết duy trì quan hệ song phương chặt chẽ và hợp tác giữa ba nước thông qua những cơ chế đa phương khác.</p><p>Trong cuộc gặp tại New York ngày 24/9 cùng Phó thủ tướng, Bộ trưởng Ngoại giao Bùi Thanh Sơn và Ngoại trưởng Lào Saleumxay Kommasith, Phó thủ tướng, Ngoại trưởng Campuchia Sok Chenda Sophea khẳng định việc Campuchia rút khỏi Tam giác Phát triển CLV không ảnh hưởng đến những cơ chế hợp tác khác giữa ba nước, cả về song phương và đa phương.</p><p style=\"text-align:right;\"><strong>Phạm Giang - Thanh Danh</strong></p>','admin','admin',NULL,'Việt Nam lên tiếng về việc Campuchia rút khỏi Khu vực Tam giác phát triển CLV','https://vnexpress.net/viet-nam-len-tieng-ve-viec-campuchia-rut-khoi-khu-vuc-tam-giac-phat-trien-clv-4805393.html#:~:text=%22Trong%2025%20n%C4%83m%20qua%2C%20c%C6%A1%20ch%E1%BA%BF%20h%E1%BB%A3p%20t%C3%A1c,t%C3%A1c%20Khu%20v%E1%BB%B1c%20Tam%20gi%C3%A1c%20ph%C3%A1t%20tri%E1%BB%83n%20CLV.','','https://res.cloudinary.com/dd1grolgr/image/upload/v1729161105/tagged-images/m3iln2azbfnfkouzfmgz.jpg','Việt Nam lên tiếng về việc Campuchia rút khỏi Khu vực Tam giác phát triển CLV',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-19 14:34:13.164111',24,3,'2024-10-31 22:01:50.036167',3,2,NULL,NULL,'<p>Siêu trăng thứ ba và lớn nhất năm, xuất hiện ngày 17/10, quan sát được tại nhiều tỉnh thành cả nước.</p><figure class=\"image\"><img style=\"aspect-ratio:1200/800;\" src=\"https://i1-vnexpress.vnecdn.net/2024/10/17/1_1729180072-1729181706.jpg?w=1200&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=O84Wox56wal-jqwEmqObew\" width=\"1200\" height=\"800\"></figure><p>Siêu trăng thứ 3 trong năm 2024 xuất hiện, Mặt Trăng cách Trái Đất khoảng 357.364 km. Thời điểm tròn đầy nhất của trăng rằm lần này vào lúc 18h26 ngày 17/10 (theo giờ Việt Nam).</p><figure class=\"image\"><img style=\"aspect-ratio:1200/800;\" src=\"https://i1-vnexpress.vnecdn.net/2024/10/17/2_1729180073-1729181708.jpg?w=1200&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Wr8cjoIBFvn8puzXskUFmg\" width=\"1200\" height=\"800\"></figure><p>Hình ảnh ghi nhận trăng bắt đầu xuất hiện trên biển Đồng Châu tỉnh Thái Bình lúc 17h30. Ảnh: Trần Công</p><p><img src=\"https://i1-vnexpress.vnecdn.net/2024/10/17/3-JPG_1729180074-1729181711.jpg?w=1200&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=O-AFyTX5vuNjx9r6Q2NlsQ\" width=\"1200\" height=\"865\"><br>Cả ngày 17/10 thời tiết mây mù, trăng bắt đầu mọc lúc 17h20 nhưng bị mây che phủ, tới 17h30 trăng ló rạng. Thời điểm này trời vẫn chưa tối nên có thể nhìn thấy rõ trăng có màu vàng. Ảnh: Trần Công</p><p><img src=\"https://i1-vnexpress.vnecdn.net/2024/10/17/4-JPG_1729180074-1729181712.jpg?w=1200&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=gDmbSp5v5do4UH37LRFg5w\" width=\"1200\" height=\"809\"><br>Ở nhiều nơi của Hà Nội được chứng kiến siêu trăng, tuy nhiên, cũng có một số thời điểm mây mù che lấp. Trong ảnh trăng xuất hiện ở quận Hà Đông, Hà Nội lúc 20h. Ảnh: Ngọc Thành</p>','admin','minhkhang2',NULL,'Siêu trăng lớn nhất năm rực sáng bầu trời cả nước','https://vnexpress.net/sieu-trang-lon-nhat-nam-ruc-sang-bau-troi-ca-nuoc-4805526.html',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1729323247/tagged-images/mjqbrohilphnmi7ez2uy.jpg','Siêu trăng lớn nhất năm rực sáng bầu trời cả nước',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-19 14:36:42.990273',25,2,'2024-11-03 17:26:51.974202',4,2,'2024-11-03 17:25:54.778756','https://res.cloudinary.com/dztroerja/video/upload/v1730795665/news-25_cjydvg.mp3','<p>Nhiều bác sĩ Hàn Quốc trong lĩnh vực thẩm mỹ, da liễu, nha khoa, cấp cứu đã sang Việt Nam trong năm nay để tìm việc.</p><p>Hôm 18/10, tờ Nhật báo Chosun đưa tin giới chức y tế Hàn Quốc xác nhận nhiều bác sĩ nước này đang nộp đơn để làm việc tại các cơ sở y tế tại Việt Nam. Hơn 30 bác sĩ đã đến TP HCM để kiểm tra sức khỏe vào cuối tháng 9, hiện chuẩn bị cho kỳ thi tiếng Anh được tổ chức tại Đại học Y Dược TP HCM trong hai tháng tới.</p><p>Theo Chosun, Việt Nam không yêu cầu bác sĩ từ các nước có trình độ y tế cao phải nộp điểm kiểm tra trình độ chuyên môn, mà chỉ yêu cầu nộp giấy phép hành nghề được chứng nhận từ quốc gia sở tại. Tuy nhiên, họ vẫn phải trải qua kỳ thi tiếng Anh và kiểm tra sức khỏe. Quy trình này đã được nối lại sau ba năm gián đoạn vì đại dịch Covid-19.</p><p>Nhu cầu hành nghề tại Việt Nam của bác sĩ Hàn Quốc tăng cao đã tạo điều kiện cho các công ty dịch vụ hỗ trợ làm thủ tục, dịch thuật phát triển. Đại diện một công ty cho biết, ngoài các chuyên khoa phẫu thuật thẩm mỹ và da liễu vốn được ưa chuộng, nhiều bác sĩ chuyên khoa cấp cứu và nha khoa cũng quan tâm đến thị trường Việt Nam.</p><figure class=\"image\"><img style=\"aspect-ratio:680/414;\" src=\"https://i1-suckhoe.vnecdn.net/2024/10/19/zgso33yzjl4zfcrsgvt5acp5xy-172-6221-5134-1729276175.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=sALkCMror6qprYjwnHdfYw\" alt=\"Nhân viên y tế làm việc tại một bệnh viện trực thuộc đại học ở Seoul. Ảnh: Chosun\" width=\"680\" height=\"414\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Nhân viên y tế làm việc tại một bệnh viện trực thuộc đại học ở Seoul. Ảnh: Chosun</i></span></p><p>Năm nay, số lượng bác sĩ nội trú Hàn Quốc tìm kiếm cơ hội tại Việt Nam cũng tăng lên. Một số bác sĩ nội trú sau khi hành nghề tại các phòng khám tư nhân trong nước không hài lòng với điều kiện làm việc và quyết định tìm kiếm cơ hội ở nước ngoài.</p><p>Theo Chosun, một bệnh viện tư nhân tại Việt Nam đề xuất những chính sách riêng đối với bác sĩ Hàn Quốc, chẳng hạn tuần làm việc 44 giờ, mức lương hàng tháng là 30 triệu won (22.000 USD) và 800 USD tiền hỗ trợ nhà ở.</p><p>Trong khi căng thẳng giữa giới y khoa và chính phủ Hàn Quốc về việc tăng chỉ tiêu tuyển sinh trường y vẫn tiếp diễn, các bác sĩ nước này tỏ ra rất quan tâm đến cơ hội việc làm tại nước ngoài.</p><p>Tháng 8 năm ngoái, Hiệp hội Y học Cấp cứu Hàn Quốc đã tổ chức một hội nghị học thuật định kỳ, với các bài giảng như \"Làm bác sĩ ở Canada bằng giấy phép của Hàn Quốc\" hay \"Trở thành bác sĩ Mỹ\". Hội nghị nhận được đơn đăng ký học của 400 người, gồm bác sĩ nội trú và bác sĩ chuyên khoa cấp cứu.</p><p style=\"text-align:right;\"><strong>Thục Linh (Theo Chosun)</strong></p>','admin','admin',NULL,'Nhiều bác sĩ Hàn Quốc đến Việt Nam tìm việc','https://vnexpress.net/nhieu-bac-si-han-quoc-den-viet-nam-tim-viec-4805911.html','','https://res.cloudinary.com/dd1grolgr/image/upload/v1729323323/tagged-images/z3bzp9hxj8bxxwnf4s7o.jpg','Nhiều bác sĩ Hàn Quốc đến Việt Nam tìm việc',NULL,NULL,NULL);
INSERT INTO `news` VALUES (_binary '',NULL,'2024-10-19 14:40:23.864780',26,2,'2024-11-05 16:31:59.356904',13,2,'2024-11-05 16:31:53.308018','https://res.cloudinary.com/dztroerja/video/upload/v1730795665/news-26_skxuub.mp3','<p>TP HCMLên bàn mổ khi 11 tháng tuổi, là bệnh nhi thứ hai ở phía Nam được ghép gan, nay Thanh Giang trở thành sinh viên năm hai ngành marketing.</p><p>Ở tuổi 19, Giang cao 1m6, nặng khoảng 50 kg, có cuộc sống bình thường như các bạn đồng trang lứa. Cô duy trì uống thuốc chống thải ghép, thỉnh thoảng vào viện tái khám theo chỉ định bác sĩ.</p><p>Giang là một trong những người đầu tiên ở Việt Nam được ghép gan, ca thứ hai tại Bệnh viện Nhi đồng 2. Bệnh nhi ghép gan đầu tiên ở phía Nam là Lê Ngọc Xuân Quý, 21 tuổi, hiện là sinh viên năm 3 Trường Đại học FPT.</p><p>\"Khi ấy chưa có nhiều thông tin về ghép tạng, ban đầu nghe đến chữ ghép gan tôi như bị sốc tâm lý\", chị Thư, mẹ của Giang, ngụ quận 4, nói khi hội ngộ các bác sĩ nơi từng mổ ghép gan cho con, ngày 17/10.</p><p>Chào đời với bệnh lý teo đường mật bẩm sinh, Giang vàng da, chướng bụng, sức khỏe ngày càng yếu ớt, diễn tiến xơ gan giai đoạn cuối. Ghép gan là giải pháp duy nhất giúp cô bé tiếp tục cuộc sống. Nhờ sự phân tích, động viên của các bác sĩ, chị Thư có niềm tin để hiến đi một phần gan cứu con, bởi \"đây gần như là cánh cửa cuối cùng, chỉ biết cố gắng trao cơ hội cho con, còn thành công hay không thì là chuyện sau đó\".</p><p>Sau thời gian hậu phẫu, đón thôi nôi cùng các y bác sĩ trong bệnh viện, Giang trở về nhà, bắt đầu cuộc sống với việc duy trì thuốc chống thải ghép mỗi ngày. Nhờ \"món quà tái sinh\" từ mẹ, cô bé đến trường, chạy nhảy vui chơi cùng bạn bè. Một điều thuận lợi là những ca mổ ghép đầu tiên miễn phí, thuốc được tài trợ, gia đình không phải tốn kém quá nhiều chi phí.</p><figure class=\"image\"><img style=\"aspect-ratio:1020/680;\" src=\"data:image/png;base64,\" width=\"1020\" height=\"680\"></figure><p style=\"text-align:center;\"><span style=\"font-size:12px;\"><i>Bác sĩ mổ ghép gan tại Bệnh viện Nhi đồng 2. Ảnh: Bác sĩ cung cấp</i></span></p><p>Bước vào tuổi dậy thì, khi hiểu rõ hơn tình trạng sức khỏe của bản thân, Giang có những giai đoạn suy nghĩ tiêu cực. Cô không được ăn thực phẩm chiên rán, xào nhiều dầu mỡ, thực phẩm bán ngoài đường, cổng trường.</p><p>Những năm đầu sau ghép, thuốc chống thải ghép cũng phải dùng liều cao bởi khoảng thời gian đó dễ nhiễm trùng. Không ít lần, nữ sinh buồn tủi vì \"không được ăn những thứ bạn bè hay ăn, có bạn còn bảo con là đứa ghép gan\", khiến mẹ phải luôn cận kề giải thích, động viên.</p><p>Dần dần, Giang vượt qua những tâm lý tiêu cực, cảm thấy biết ơn vì mẹ đã hiến gan giúp mình tiếp tục cuộc sống quý giá. \"Nhìn lại quá trình đi cùng con, đồng hành cùng con, chứng kiến con từng bước trưởng thành, tôi thấy lựa chọn ghép gan là đúng đắn\", chị Thư nói.</p><p>TS.BS Trần Thanh Trí, Trưởng Khoa Gan Mật Tụy và Ghép gan, cho biết thời điểm năm 2006, việc ghép gan vẫn còn là chuyện rất lớn, ít thông tin, phải giải thích cho người nhà rất nhiều. Quá trình chăm sóc hậu phẫu cũng nhiều vất vả, các y bác sĩ chưa nhiều kinh nghiệm, phải cẩn trọng.</p><p>Đến nay, Bệnh viện Nhi đồng 2 đã ghép gan 41 ca, trong đó 33 em sống khỏe mạnh, 4 ca tử vong chủ yếu do bệnh lý nhiễm trùng, còn 4 trường hợp khác vừa ghép xong đang chăm sóc hậu phẫu. Ba năm qua, nơi này thực hiện 28 ca, gấp đôi số ca trong 15 năm trước đó. Bệnh viện đang đẩy nhanh tiến độ, tăng tốc ghép gan để thêm nhiều trẻ được sống.</p><p>Ghép gan là giải pháp duy nhất cứu sống trẻ suy, xơ gan giai đoạn cuối. Trong khi với suy thận, bệnh nhân chưa ghép có thể kéo dài sự sống nhờ chạy thận nhân tạo, thẩm phân phúc mạc. Để tăng số ca ghép, giảm số trẻ qua đời vì mòn mỏi chờ gan, các bác sĩ kỳ vọng có thêm nguồn tạng hiến từ người chết não. Đến nay, phía Nam chưa có trẻ nào được ghép gan từ nguồn hiến tình nguyện này. Ngoài ra, Việt Nam cần sớm cho phép hiến tạng nhân đạo ở trẻ em chết não dưới 18 tuổi, như nhiều nước trên thế giới.</p><p style=\"text-align:right;\"><strong>Lê Phương</strong></p>','admin','minhkhang7',NULL,'Bệnh nhi thứ hai ghép gan ở phía Nam khỏe mạnh sau 19 năm','https://vnexpress.net/benh-nhi-thu-hai-ghep-gan-o-phia-nam-khoe-manh-sau-19-nam-4805235.html','\"Thanh Giang, bệnh nhi thứ hai ở phía Nam được ghép gan, hiện là sinh viên năm hai ngành marketing.  Cô được ghép gan khi 11 tháng tuổi do bệnh lý teo đường mật bẩm sinh, được mẹ hiến một phần gan. Sau ca mổ, Giang sống khỏe mạnh, duy trì uống thuốc chống thải ghép, thỉnh thoảng tái khám.  Giang là một trong những người đầu tiên ở Việt Nam được ghép gan, ca thứ hai tại Bệnh viện Nhi đồng 2. Hiện nay, Bệnh viện Nhi đồng 2 đã thực hiện 41 ca ghép gan, trong đó 33 em sống khỏe mạnh. Các bác sĩ hy vọng tăng số ca ghép gan bằng cách tăng nguồn tạng hiến từ người chết não.  Việc hiến tạng nhân đạo ở trẻ em chết não dưới 18 tuổi cần được sớm cho phép tại Việt Nam.\"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729323564/tagged-images/vgdr7qiqkrv7dk7vzbgu.png','Bệnh nhi thứ hai ghép gan ở phía Nam khỏe mạnh sau 19 năm',NULL,NULL,NULL);
INSERT INTO `news` VALUES (_binary '\0',NULL,'2024-10-19 14:43:24.449734',27,1,'2024-10-31 22:02:08.511583',1,2,NULL,NULL,'<p>Trong phiên VN-Index trở lại sắc đỏ khi giảm hơn 1 điểm, nhóm vốn hóa vừa và nhỏ vẫn có một số đại diện bám trụ tốt, như SMC, YEG.</p><p>Chứng khoán hôm nay có diễn biến khá tích cực về điểm số trong phần lớn thời gian giao dịch. Buổi sáng, VN-Index giữ trọn sắc xanh, có lúc tăng gần 8 điểm với trợ lực từ cổ phiếu ngân hàng. Tuy nhiên áp lực bán lan rộng ở ngưỡng 1.290 điểm, càng gần giờ nghỉ trưa, chỉ số này càng về sát tham chiếu.</p><p>Đầu giờ chiều, thị trường rung lắc quanh giá mở cửa, nhưng sau đó lấy lại đà tăng nhờ các mã STB, VCB, VHM có lực cầu khá tốt. Tuy nhiên sau phiên ATC, chứng khoán đảo chiều.</p><p>Chốt ngày, VN-Index giảm hơn 1 điểm về khoảng 1.285,5 điểm. Toàn sàn HoSE có 211 mã giảm giá, còn bên tăng ghi nhận 157 cổ phiếu. Thị trường chịu ảnh hưởng lớn từ nhiều mã trụ như VPB, HPG, CTG, MSN...</p><p>Thanh khoản giảm nhẹ hơn 300 tỷ về khoảng 15.385 tỷ đồng. Đây đã là phiên thứ 11 liên tiếp, tổng giá trị giao dịch sàn HoSE duy trì mức dưới 20.000 tỷ. Đà xả hàng của khối ngoại kéo dài sang phiên thứ 6 khi hôm nay nhà đầu tư nước ngoài bán ròng hơn 150 tỷ đồng.</p><p>Nhìn chung ở cú đảo chiều cuối phiên, sắc đỏ xuất hiện dày đặc ở nhóm cổ phiếu vốn hóa lớn. Trong khi nhóm vừa và nhỏ vẫn có một số đại diện trụ tốt, nổi bật có SMC hay YEG.</p><p style=\"text-align:right;\"><strong>Tấn Đạt</strong></p>','admin','minhkhang2',NULL,'Cổ phiếu thép SMC tăng trần, YEG đạt thanh khoản lớn','https://vnexpress.net/chung-khoan-hom-nay-18-10-co-phieu-thep-smc-tang-tran-yeg-dat-thanh-khoan-lon-4805807.html',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1729323728/tagged-images/r8ezn1m84z0kzcmwi7jo.jpg','Cổ phiếu thép SMC tăng trần, YEG đạt thanh khoản lớn',NULL,NULL,NULL),(_binary '\0',NULL,'2024-10-19 14:48:45.942421',28,1,'2024-11-03 14:18:29.214162',13,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1730795666/news-28_bibn0q.mp3','<p>Máy dự báo của bác sĩ George Merryweather thế kỷ 19 gồm 12 chai thủy tinh, mỗi chai chứa một con đỉa sống, có thể rung chuông khi sắp bão.</p><figure class=\"image\"><img style=\"aspect-ratio:999/880;\" src=\"data:image/jpeg;base64,\" width=\"999\" height=\"880\"></figure><p><span style=\"font-size:12px;\"><i>Bản sao của máy dự báo bão tại Bảo tàng Whitby, Whitby, Anh. Ảnh: Badobadop/Wikimedia</i></span></p><p>Một số động vật có khả năng dự đoán sự thay đổi của thời tiết theo bản năng. Ví dụ, khi giông bão sắp đến, ếch nhái kêu, chim trở về tổ, bò, cừu và kiến trở nên bồn chồn.</p><p>George Merryweather, bác sĩ kiêm nhà phát minh người Anh thế kỷ 19, nhận thấy những con đỉa thuốc của mình có hành vi khác lạ khi thời tiết xấu đi. Đặt trong các lọ thủy tinh nhỏ chứa nước, đỉa sẽ nằm thư giãn dưới đáy khi thời tiết tốt, nhưng vài giờ trước khi bầu trời trở nên u ám và gió bắt đầu thổi, đỉa có dấu hiệu bồn chồn. Nếu trời sắp mưa, nó sẽ di chuyển ra khỏi nước, còn nếu giông bão sắp đến, đỉa sẽ cuộn tròn thành quả bóng và giữ nguyên trạng thái đó trong suốt cơn bão. Khi thời tiết ổn định, đỉa sẽ trở lại đáy lọ.</p><p>Merryweather quyết định khai thác khả năng này của đỉa bằng cách chế tạo một thiết bị dự báo bão được mô tả là \"Máy điện báo điện từ khí quyển, điều khiển bởi bản năng động vật\", gọi ngắn gọn là \"Máy dự báo bão\".</p><p>Máy dự báo bão gồm 12 chai thủy tinh, mỗi chai chứa một con đỉa sống trong khoảng 3,8 cm nước. Phần trên của chai thủy tinh có một mảnh xương cá voi đặt ở cổ chai, nối dây với một chiếc búa nhỏ dùng để gõ vào một chiếc chuông kim loại lớn. 12 chai xếp thành hình tròn xung quanh chiếc chuông kim loại.</p><p>Khi giông bão sắp đến, sự thay đổi áp suất khí quyển khiến đỉa bò ra khỏi nước, tiến đến cổ chai, đẩy xương cá voi ra khỏi vị trí và rung chuông. Nhiều chuông rung liên tiếp nghĩa là chiếc máy dự báo một cơn bão đang đến.</p><p>Trong một bài mô tả thiết bị, Merryweather cho biết, đỉa được đặt trong các chai thủy tinh thành vòng tròn để ngăn chúng cảm thấy đau khổ khi bị giam giữ một mình. Khoảng năm 1850, ông đã dành hơn một năm để thử nghiệm thiết bị và gửi thư cho chủ tịch Hội Triết học và Viện Whitby mỗi khi \"ban cố vấn đỉa\" dự báo có giông bão. Merryweather sau đó vận động chính quyền sử dụng thiết kế của ông quanh bờ biển Anh, nhưng họ lại quyết định sử dụng ống thủy tinh dự báo bão của Robert FitzRoy.</p><p>Máy dự báo bão của Merryweather không được ưa chuộng như ông mong đợi. Thậm chí thiết bị gốc trưng bày tại triển lãm Great Exhibition năm 1851 cũng bị mất. Một bản sao của máy dự báo thời tiết này hiện được trưng bày tại Bảo tàng Whitby, Anh.</p><p style=\"text-align:right;\"><strong>Thu Thảo (Theo Amusing Planet)</strong></p>','admin','minhkhang7',NULL,'Máy dự báo của bác sĩ George Merryweather thế kỷ 19 gồm 12 chai thủy tinh, mỗi chai chứa một con đỉa sống, có thể rung chuông khi sắp bão.','https://vnexpress.net/may-du-bao-bao-bang-dia-song-4805777.html',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1729324094/tagged-images/p1fa9hz2evpue8bccbx2.jpg','Máy dự báo bão bằng đỉa sống',NULL,NULL,NULL),(_binary '\0',1,'2024-10-19 14:51:05.385838',29,1,'2024-11-01 14:30:35.368873',4,2,NULL,NULL,'<p>Mỹ-Dầu từ tủy xương của con cá voi xanh chết do tàu đâm trúng hơn hai thập kỷ trước nhiều đến mức bảo tàng phải đặt thiết bị hứng.</p><p><img src=\"https://i1-vnexpress.vnecdn.net/2024/10/17/VNE-Blue-8345-1729160443.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Mi7x-3lOaUx5tR_CVJ4eGg\" alt=\"Bộ xương của cá voi xanh có biệt danh Kobo. Ảnh: Bảo tàng cá voi New Bedford\" width=\"680\" height=\"408\"><span style=\"font-size:12px;\"><i>Bộ xương của cá voi xanh có biệt danh Kobo. Ảnh: Bảo tàng cá voi New Bedford</i></span></p><p>Khi tới thăm Bảo tàng cá voi New Bedford ở đông nam Massachusetts, du khách cần đứng cẩn thận bên dưới bộ xương cá voi xanh dài 20 m. Đó là vì những chiếc xương cá voi vẫn rò rỉ dầu, dù con vật đã chết hơn hai thập kỷ. Mang tên Vua của đại dương xanh (Kobo), bộ xương cá voi xanh hiếm gặp được trưng bày ở bảo tàng từ năm 2000. Hiện tượng rò rỉ là kết quả do tủy xương cá voi chứa đầy dầu, nhiều hơn hẳn so với xương người, theo Popular Science.</p><p>\"Dầu ở tủy là một nguồn năng lượng đối với cá voi. Đặc biệt là cá voi tấm sừng, thường có một thời kỳ không kiếm ăn trong năm\", Robert Rocha, phó quản lý khoa học và nghiên cứu của Bảo tàng cá voi New Bedford, cho biết. \"Có năng lượng lưu giữ trong cơ và mỡ, nhưng năng lượng lưu giữ ở dầu và xương là nguồn dự trữ của chúng\".</p><p>Thông thường, xương cá voi mất đi lượng dầu này thông qua những quá trình tự nhiên khi chúng bị chôn vùi ở đáy biển và gặm nhấm bởi con hà và động vật khác. Tuy nhiên, Kobo được tìm thấy ở mũi tàu. Dù là động vật lớn nhất hành tinh, cá voi xanh vẫn không thể sánh bằng các tàu chở dầu khổng lồ và có thể bị tàu tình cờ đâm trúng.</p><p>Theo Rocha, Kono có thể chỉ khoảng 5 tuổi và ước tính nặng khoảng 36.287 kg. Nó vô tình bị một tàu chở hàng dài 148 m giết chết trên đường đi từ Bỉ tới Providence, đảo Rhode năm 1998. Xác con vật được các nhà khoa học kéo vào bờ và mổ xẻ để nghiên cứu. Nhóm thu gom không dành thời gian tách dầu ra khỏi bộ xương mà chỉ để ngoài nắng và xử lý chúng.</p><p>Năm 2010, bảo tàng lắp đặt một thiết bị hứng dầu để xem xét lượng dầu họ có thể thu thập. Thiết bị nằm gần phần mỏ, mõm và xương sống. Nó hứng dầu chảy nhỏ giọt vào bình thót cổ mỗi ngày và bảo tàng đã thu được 1.000 ml đặt trong hũ lưu trữ và 200 ml ở trong thiết bị hứng.</p><p>Dầu từ những bộ xương như vậy không được sử dụng để thắp đèn trong thời kỳ hoạt động đánh bắt cá voi diễn ra vào thế kỷ 19. Mãi tới khi các cơ sở đánh bắt và nhà máy xử lý mọc lên, ngư dân và binh lính mới có thể sử dụng dầu trong xương. Loại dầu này cũng được dùng trong thuốc nổ bởi một phụ phẩm của xà phòng dầu cá voi là glycerol. Khi glycerol trộn lẫn với nitric và axit sulfuric, tạo ra thuốc nổ nitroglycerin. Nitroglycerin từng được sử dụng như nhiên liệu đẩy cho đạn và tên lửa trong Thế chiến I và II.</p><p style=\"text-align:right;\"><strong>An Khang (Theo Popsci)</strong></p>','admin','minhkhang3',NULL,'Bộ xương cá voi xanh vẫn rò rỉ dầu 26 năm sau khi chết','https://vnexpress.net/bo-xuong-ca-voi-xanh-van-ro-ri-dau-26-nam-sau-khi-chet-4805092.html',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1729324210/tagged-images/wlwvan5ry9c7myheih2i.jpg','Bộ xương cá voi xanh vẫn rò rỉ dầu 26 năm sau khi chết',NULL,NULL,NULL),(_binary '',NULL,'2024-10-19 14:59:26.498911',30,3,'2024-11-23 10:24:46.981404',28,2,'2024-11-03 23:02:30.137690','https://res.cloudinary.com/dztroerja/video/upload/v1730795667/news-30_rmj9xg.mp3','<p>Đề tham khảo Toán thêm phần trả lời ngắn, học sinh khó đoán bừa, trong khi đề Văn với ngữ liệu ngoài sách giáo khoa sẽ tránh học tủ, để giành điểm 8-9 trở lên không dễ, theo các giáo viên.</p><p>Bộ Giáo dục và Đào tạo chiều 18/10 công bố đề minh họa, đáp án của 17 môn thi tốt nghiệp THPT 2025. Trong đó, đề hai môn bắt buộc là Toán và Văn được các giáo viên đánh giá tăng độ khó và độ phân hóa thí sinh so với các năm trước.</p><p style=\"text-align:center;\"><a href=\"https://vnexpress.net/cong-bo-de-tham-khao-17-mon-thi-tot-nghiep-thpt-2025-4805625.html\"><u>Đề minh họa, đáp án 17 môn thi tốt nghiệp THPT 2025</u></a></p><p>Đề tham khảo môn Toán được xây dựng theo cấu trúc, định dạng mà Bộ đã công bố từ trước, theo thầy Đỗ Bảo Châu, giáo viên Toán, trường Tiểu học, THCS và THPT FPT Hà Nam và nhóm giáo viên hệ thống Hocmai.</p><p>Đề gồm 34 câu, chia làm ba phần. Phần 1 gồm 12 câu trắc nghiệm nhiều phương án, thuộc cấp độ nhận biết và thông hiểu. Phần 2 với 4 câu, mỗi câu 4 ý, dạng trắc nghiệm đúng sai, sắp xếp theo cấp độ từ nhận biết đến vận dụng. Cuối cùng là 6 câu trắc nghiệm trả lời ngắn, đều ở cấp độ vận dụng.</p><p>Thầy Châu cho hay kiến thức chủ yếu nằm ở lớp 12, còn phần lớp 10 và 11 chỉ ở mức cơ bản. Điểm mới của đề thi là không có câu hỏi chứa tham số, không có hàm hợp và có thêm phần thống kê. Điều chỉnh này phù hợp với hình thức câu hỏi, giảm độ phức tạp để học sinh dễ dàng nắm bắt và xử lý các dạng bài tập hơn.</p><p>Tuy nhiên, học sinh sẽ khó lấy điểm ở phần bài tập yêu cầu trả lời ngắn, bởi không thể chọn bừa và trông chờ may mắn. Các em phải thực sự hiểu đề bài và biết cách làm mới giành điểm.</p><p>Một trong những mục tiêu của chương trình mới là tăng tính thực tiễn. Thầy Châu cho rằng đề minh họa đáp ứng được khi có các câu hỏi xác suất liên quan đến hoạt động tiếp thị, thiên văn và hệ thống định vị toàn cầu GPS.</p><p>\"Đây là điểm thú vị của đề thi, giúp học sinh có cảm giác mới mẻ, hào hứng, cũng tạo điều kiện để các em tư duy ngoài khuôn khổ sách giáo khoa\", thầy nói.</p><p>Theo tính toán của nhóm giáo viên Hocmai, đề tham khảo có 9 câu yêu cầu vận dụng, chiếm tỷ lệ 27%. Đây là những câu giúp phân hóa thí sinh, trong khi vẫn đảm bảo mục tiêu xét tốt nghiệp THPT.</p><p>Cụ thể hơn, thầy Châu nhận định mức điểm phổ biến mà thí sinh có thể đạt là 5-7. Trong đó, điểm 5-6 dành cho những em nắm vững kiến thức cơ bản lớp 12, biết giải quyết các phép tính đơn giản hoặc áp dụng công thức trực tiếp. Ngưỡng 7-8 đòi hỏi thí sinh có kiến thức chắc chắn, biết suy luận và vận dụng công thức linh hoạt.</p><p>Để lấy điểm từ 9 trở lên, học sinh còn cần thêm kỹ năng giải những bài tập khó. Những bài này thường yêu cầu người học phải tìm mối quan hệ giữa các yếu tố hoặc biết cách chuyển đổi về dạng quen thuộc.</p><figure class=\"image\"><img style=\"aspect-ratio:680/312;\" src=\"https://i1-vnexpress.vnecdn.net/2024/10/18/462557124-539627765376105-8112-5228-8322-1729264200.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=qCFcNLbV8NeTwRMhGIrRXA\" alt=\"Phần yêu cầu trả lời ngắn trong đề tham khảo môn Toán được các giáo viên đánh giá khó.\" width=\"680\" height=\"312\"></figure><p><span style=\"font-size:12px;\"><i>Phần yêu cầu trả lời ngắn trong đề tham khảo môn Toán được các giáo viên đánh giá khó.</i></span></p><p>Với môn Văn, thầy Hồ Tấn Nguyên Minh, Tổ trưởng môn Văn, trường THPT chuyên Lương Văn Chánh, Phú Yên, cho biết cấu trúc đề gồm hai phần Đọc hiểu và Làm văn với tỷ lệ điểm 4:6 thay vì 3:7 như trước đây. Thầy ủng hộ thay đổi này, bởi với học sinh đại trà, kỹ năng đọc hiểu cần nhiều hơn viết.</p><p>Ngoài ra, trước đây, câu nghị luận xã hội mặc định yêu cầu thí sinh viết đoạn văn, còn nghị luận văn học yêu cầu viết bài văn. Còn đề minh họa cho thấy có sự thay đổi linh hoạt, tùy vào thể loại văn bản ở phần Đọc hiểu. Ngữ liệu nằm ngoài sách giáo khoa, có sự liên kết giữa phần Đọc hiểu và Nghị luận văn học nên thí sinh chỉ phải xử lý một văn bản cho cả hai phần.</p><p>\"Những điểm mới này sẽ tác động tích cực đến việc dạy học môn Văn, tránh việc học tủ, ghi nhớ máy móc\", thầy Minh nhận định.</p><p>Tuy nhiên, thầy kỳ vọng cách đặt câu hỏi của đề mới mẻ, đột phá hơn.</p><p>\"Cách hỏi, dạng câu hỏi cơ bản vẫn như trước, chưa có thay đổi mang tính đột phá, vì thế chưa thể tạo cơ hội để học sinh phát huy khả năng sáng tạo, tiếng nói riêng\", thầy nhận xét.</p><p>Tổ Ngữ văn, Hệ thống giáo dục Hocmai cũng cho rằng đề thi đảm bảo các tiêu chí về việc lựa chọn ngữ liệu, ma trận câu hỏi, bám sát định hướng và mục tiêu chương trình mới nhưng không có nhiều thay đổi so với đề thi năm ngoái.</p><p>Còn so với đề minh hoạ Bộ công bố cuối năm 2023, câu hỏi nghị luận văn học đã có sự thay đổi từ \"làm rõ đặc điểm của thể loại\" sang \"phân tích nội dung\". Điều này giúp giảm áp lực tâm lý cho thí sinh bởi yêu cầu \"phân tích giá trị nội dung hoặc nghệ thuật của một tác phẩm văn học\" đã quen thuộc với các em trong nhiều năm. Trong khi đó, với yêu cầu \"làm rõ đặc điểm của thể loại\", thí sinh cần cần huy động nhiều kiến thức, khả năng đọc - hiểu thể loại tốt hơn.</p><p>Thầy Minh đánh giá với đề này, học sinh dễ đạt điểm trung bình nhưng khó có tình trạng \"mưa\" điểm 9 như năm vừa rồi. Với ngữ liệu ngoài sách, giáo viên phải chuyển trọng tâm từ việc dạy nội dung sang hướng dẫn phương pháp, cách thức làm bài, từ đó hình thành năng lực đọc hiểu và viết cho học sinh.</p><figure class=\"image\"><img style=\"aspect-ratio:680/453;\" src=\"https://i1-vnexpress.vnecdn.net/2024/10/18/z5577640575924-3e721201c625ded-4165-7686-1729256928.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=BfdUpjYA70EfgJBDZlQU7Q\" alt=\"Thí sinh dự thi tốt nghiệp THPT tại TP HCM, cuối tháng 6. Ảnh: Thanh Tùng\" width=\"680\" height=\"453\"></figure><p><span style=\"font-size:12px;\"><i>Thí sinh dự thi tốt nghiệp THPT tại TP HCM, cuối tháng 6. Ảnh: Thanh Tùng</i></span></p><p>2025 là năm lứa học sinh đầu tiên theo chương trình giáo dục phổ thông mới thi tốt nghiệp. Dự kiến, kỳ thi diễn ra trong hai ngày 26-27/6/2025. So với năm nay, số môn thi giảm hai, số buổi thi giảm một.</p><p>Công thức tính điểm xét tốt nghiệp THPT 2025 theo dự kiến của Bộ, gồm điểm học bạ ở lớp 10, 11 và 12 (50%) và điểm thi (50%). Những năm trước, kết quả học bạ chỉ chiếm 30% và chỉ dùng điểm lớp 12; 70% còn lại dựa vào điểm các môn thi tốt nghiệp THPT của thí sinh. Đạt từ 5 trở lên, thí sinh đỗ tốt nghiệp.</p><p>Bộ cho biết sẽ ban hành quy chế thi tốt nghiệp và tuyển sinh đại học năm 2025, muộn nhất vào tháng 11.</p><p style=\"text-align:right;\"><strong>Lệ Nguyễn - Tâm Hằng</strong></p>','admin','trankhangctu@gmail.com',NULL,'Đề tham khảo Toán, Văn thi tốt nghiệp THPT 2025 tăng độ khó',NULL,'\"Bộ Giáo dục và Đào tạo công bố đề minh họa môn Toán và Văn cho kỳ thi tốt nghiệp THPT 2025, đánh giá tăng độ khó và độ phân hóa so với năm trước. Đề Toán có phần trả lời ngắn, đòi hỏi học sinh phải thực sự hiểu bài, không thể đoán bừa. Đề Văn sử dụng ngữ liệu ngoài sách giáo khoa, giúp tránh học tủ. Đề minh họa Toán tập trung vào kiến thức lớp 12, có thêm phần thống kê, giảm độ phức tạp. Đề Văn có cấu trúc phần Đọc hiểu và Làm văn theo tỷ lệ 4:6, giúp tăng cường kỹ năng đọc hiểu. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1729324882/tagged-images/orm7icbjsg4zimnn1zsr.jpg','Đề tham khảo Toán, Văn thi tốt nghiệp THPT 2025 tăng độ khó',NULL,NULL,NULL),(_binary '',NULL,'2024-11-04 22:22:21.993894',31,1,'2024-12-06 21:27:33.672916',4,2,'2024-11-05 15:12:54.395203','https://res.cloudinary.com/dztroerja/video/upload/v1730794398/vk92wbh9xvoksd151xmy.mp3','<p>Thường vụ Quốc hội vừa ban hành các nghị quyết về sắp xếp đơn vị hành chính giai đoạn 2023-2025 với 21 địa phương, trong đó có Hải Phòng, Đà Nẵng, Thanh Hóa.</p><p>Tổng số đơn vị hành chính cấp huyện được sắp xếp là 25, cấp xã 756; giảm được 7 đơn vị cấp huyện, 373 đơn vị cấp xã.</p><p>Thường vụ Quốc hội đề nghị Chính phủ chỉ đạo các tỉnh, thành phố khẩn trương ban hành kế hoạch triển khai nghị quyết, trong đó tập trung giải quyết tốt vấn đề bố trí, sắp xếp cán bộ, công chức, viên chức, người hoạt động không chuyên trách dôi dư và trụ sở, tài sản công.</p><p>Các địa phương ưu tiên bố trí trụ sở công dôi dư làm trụ sở công an xã; sớm ổn định hoạt động của các cơ quan, tổ chức; bố trí ngân sách, hỗ trợ đầu tư phục vụ việc sắp xếp đơn vị hành chính, bảo đảm thực hành tiết kiệm, chống lãng phí.</p><p>Chính quyền tạo thuận lợi nhất cho cá nhân, tổ chức khi thay đổi giấy tờ có liên quan và các điều kiện cần thiết khác cho hoạt động của đơn vị hành chính vừa được sắp xếp, thành lập mới, hạn chế gây xáo trộn lớn.</p><figure class=\"image\"><img style=\"aspect-ratio:680/390;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/03/NA2-8462-1730619629.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=cjg9wFXh3qr0Xi9NJsI6Hg\" alt=\"TP Vinh (Nghệ An) được mở rộng sau sáp nhập nguyên trạng thị xã Cửa Lò. Ảnh: Đức Hùng\" width=\"680\" height=\"390\"></figure><p><span style=\"font-size:12px;\"><i>TP Vinh (Nghệ An) được mở rộng sau sáp nhập nguyên trạng thị xã Cửa Lò. Ảnh: Đức Hùng</i></span></p><p>Trước đó tháng 7/2023, Ủy ban Thường vụ Quốc hội thông qua Nghị quyết sắp xếp đơn vị hành chính cấp huyện, xã giai đoạn 2023-2030 nhằm giải quyết bất hợp lý về phân định địa giới, tinh gọn bộ máy, tinh giản biên chế, tạo thuận lợi cho quản lý nhà nước, doanh nghiệp, người dân.</p><p>Các huyện xã thuộc diện bắt buộc sáp nhập có diện tích và dân số dưới 70% tiêu chuẩn; huyện có diện tích dưới 20% và dân số dưới 200%; xã có diện tích dưới 20% và dân số dưới 300%. Năm 2025, các huyện xã mới sau sáp nhập sẽ tổ chức đại hội đảng bộ các cấp nhiệm kỳ 2025-2030. Bản đồ địa giới sau đó được chỉnh lý. Trụ sở huyện xã chưa được sử dụng sẽ thanh lý hoặc chuyển công năng, bán đấu giá tài sản, đất; kinh phí thu được bổ sung ngân sách địa phương.</p><p>Theo quy định, tiêu chuẩn huyện miền núi, vùng cao dân số 80.000 và diện tích 850 km2 trở lên; huyện đồng bằng từ 450 km2; quận từ 35 km2 với dân số ít nhất 150.000. Quy mô dân số của xã là 5.000 đến 8.000 trở lên, diện tích từ 30 km2.</p><p style=\"text-align:right;\"><strong>Sơn Hà</strong></p>','tranminhkhang8888@gmail.com','minhkhang1',NULL,'21 tỉnh thành sắp xếp đơn vị hành chính','https://vnexpress.net/21-tinh-thanh-sap-xep-don-vi-hanh-chinh-4811587.html','\"Thường vụ Quốc hội ban hành nghị quyết sắp xếp đơn vị hành chính giai đoạn 2023-2025 cho 21 địa phương, trong đó có Hải Phòng, Đà Nẵng, Thanh Hóa. 25 đơn vị hành chính cấp huyện và 756 đơn vị cấp xã được sắp xếp, giảm 7 đơn vị cấp huyện và 373 đơn vị cấp xã. Chính phủ được yêu cầu chỉ đạo các tỉnh, thành phố triển khai nghị quyết, ưu tiên bố trí trụ sở công dôi dư làm trụ sở công an xã, ổn định hoạt động của các cơ quan, tổ chức, và hỗ trợ đầu tư phục vụ việc sắp xếp đơn vị hành chính. Các địa phương tạo thuận lợi cho cá nhân, tổ chức thay đổi giấy tờ và hoạt động của đơn vị hành chính mới. TP Vinh (Nghệ An) được mở rộng sau sáp nhập thị xã Cửa Lò. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1730733100/tagged-images/xr4sbfpsai5ey5y7pynh.jpg','21 tỉnh thành sắp xếp đơn vị hành chính',NULL,NULL,NULL),(_binary '',NULL,'2024-11-05 13:38:51.585738',32,1,'2024-11-05 15:30:31.656966',3,2,'2024-11-05 15:07:52.640495','https://res.cloudinary.com/dztroerja/video/upload/v1730794122/ntwlietolxv55o3uzmuo.mp3','<p>Nhằm giữ giá rẻ, các công ty thiết bị điện mặt trời Trung Quốc luôn nhanh chóng dời nhà máy khỏi các nước xuất xứ bị Mỹ áp thuế.</p><p>Trung Quốc chiếm khoảng 80% thị phần thiết bị năng lượng mặt trời toàn cầu và phần lớn còn lại thuộc về các trung tâm xuất khẩu tại châu Á, theo công ty nghiên cứu thị trường SPV Market Research. Điều này hoàn toàn trái ngược với hai thập kỷ trước, khi Mỹ dẫn đầu ngành này.</p><p>Kể từ khi Mỹ bắt đầu áp thuế lên mặt hàng thiết bị điện mặt trời năm 2012, kim ngạch nhập khẩu mặt hàng này đã tăng 3 lần, đạt mức kỷ lục 15 tỷ USD vào 2023. Năm ngoái, gần như không có sản phẩm nào nhập trực tiếp từ Trung Quốc nhưng khoảng 80% đến từ Thái Lan, Malaysia, Việt Nam và Campuchia - nơi có các nhà máy thuộc sở hữu của các công ty Trung Quốc.</p><p>Bất chấp nhiều đợt áp thuế của Mỹ trong hơn một thập kỷ qua nhằm kiềm chế sự phát triển của ngành thiết bị điện mặt trời Trung Quốc, các công ty nước này đã có chiến thuật thích ứng linh hoạt. Theo đó, họ liên tục giảm sản lượng tại các trung tâm sản xuất bị Mỹ áp thuế và di chuyển đến những địa điểm mới, theo Reuters.</p><figure class=\"image\"><img style=\"aspect-ratio:680/453;\" src=\"https://i1-kinhdoanh.vnecdn.net/2024/11/04/AFP-20240626-20499926278883246-5212-8285-1730705922.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=JJPC2NIx2WGo3CbSOu-T_A\" alt=\"Công nhân làm việc trong dây chuyền sản xuất mô-đun quang điện ở Liên Vân Cảng, Giang Tô ngày 24/6. Ảnh:AFP\" width=\"680\" height=\"453\"></figure><p><span style=\"font-size:12px;\"><i>Công nhân làm việc trong dây chuyền sản xuất mô-đun quang điện ở Liên Vân Cảng, Giang Tô ngày 24/6. Ảnh: AFP</i></span></p><p>Năm ngoái, Washington đã áp thuế lên các sản phẩm năng lượng mặt trời nhập từ Thái Lan, Malaysia, Việt Nam, Campuchia và tiếp tục tăng mức thuế thêm vào tháng 10, sau khi nhận được khiếu nại từ các nhà sản xuất trong nước. Vì vậy, nguồn tin của Reuters cho hay một số nhà máy năng lượng mặt trời lớn do Trung Quốc sở hữu tại Việt Nam đang giảm sản lượng, trong khi cơ sở mới được mở nơi khác.</p><p>Trong 18 tháng qua, ít nhất 4 dự án có liên kết với Trung Quốc đã bắt đầu hoạt động tại Indonesia và Lào, cùng với hai dự án khác được công bố. Tổng cộng công suất sản xuất tấm pin hoặc tế bào quang điện đạt 22,9 gigawatt (GW).</p><p>Phần lớn sản lượng này sẽ được bán sang Mỹ, thị trường năng lượng mặt trời lớn thứ hai thế giới và là thị trường mang lại lợi nhuận cao nhất. Giá năng lượng mặt trời tại Mỹ trung bình cao hơn 40% so với tại Trung Quốc trong bốn năm qua, theo dữ liệu từ PVinsights.</p><p>\"Đây là một cuộc chơi mèo vờn chuột khổng lồ\", William A. Reinsch, cựu quan chức thương mại dưới thời chính quyền Clinton và cố vấn cấp cao tại Trung tâm Nghiên cứu Chiến lược và Quốc tế, nhận xét. \"Việc di dời không quá khó khăn. Bạn chỉ cần xây dựng lại và tiếp tục. Cách các quy định được thiết kế thường khiến Mỹ luôn chậm một bước\", ông nói thêm.</p><p>Các nhà sản xuất năng lượng mặt trời Mỹ nhiều lần đệ đơn khiếu nại lên chính phủ rằng họ không thể cạnh tranh với các sản phẩm giá rẻ của Trung Quốc. Họ cáo buộc chúng được trợ cấp không công bằng từ Bắc Kinh. Tuy nhiên, các công ty năng lượng mặt trời Trung Quốc phản biện rằng khả năng làm chủ công nghệ của họ giúp cạnh tranh về giá.</p><p>Thuế quan là chủ đề lớn trong cuộc bầu cử Mỹ, khi cựu Tổng thống Donald Trump đề xuất áp thuế lên tất cả mặt hàng nhập khẩu nhằm thúc đẩy sản xuất trong nước, bao gồm mức thuế 60% đối với các sản phẩm từ Trung Quốc. Đối thủ của ông, Phó tổng thống Kamala Harris cho rằng kế hoạch của Trump sẽ làm tăng chi phí cho người tiêu dùng Mỹ.</p><p>Các nhà lập pháp từ cả hai đảng đều ủng hộ việc thắt chặt thuế quan lên các thiết bị điện mặt trời Trung Quốc nhằm phát triển chuỗi cung ứng nội địa. \"Trong tương lai, công chúng Mỹ cần yêu cầu việc thực thi thuế quan chặt chẽ hơn, đặc biệt là ngăn chặn Trung Quốc sử dụng các quốc gia thứ ba để né luật thương mại của Mỹ,\" Hạ nghị sĩ đảng Cộng hòa John Moolenaar, Chủ tịch Ủy ban Chọn lọc về Trung Quốc tại Hạ viện, nói với Reuters.</p><p>Beny Adi Purwanto, quan chức thuộc Bộ Công nghiệp Indonesia, cho biết các nhà sản xuất thiết bị điện mặt trời đang đổ xô sang nước này. Ví dụ, nhà máy tại Indonesia của Thornova Solar sản xuất mô-đun năng lượng và tế bào quang điện với công suất 2,5 GW mỗi loại, chuyên phục vụ thị trường Bắc Mỹ.</p><p>Dự án khác có thể kể đến như nhà máy sản xuất mô-đun của China Lesso Group công suất 2,4 GW. Hay New East Solar, công ty liên kết với Trung Quốc đã công bố việc xây dựng nhà máy sản xuất 3,5 GW tấm pin và tế bào quang điện.</p><p>Quản lý tại một công ty năng lượng mặt trời Mỹ cho biết quá trình chuyển sản xuất sang Indonesia diễn ra rất nhanh, khi nhà cung cấp đang ngập đơn hàng lớn từ những công ty Trung Quốc muốn xuất khẩu sang Mỹ. Kim ngạch thiết bị năng lượng mặt trời từ Indonesia bán sang Mỹ đã tăng gần gấp đôi, đạt 246 triệu USD tính đến tháng 8.</p><p>Lào cũng là điểm đến mới của Imperial Star Solar (có nguồn gốc từ Trung Quốc) nhưng phần lớn sản xuất tại Campuchia. Họ đã mở nhà máy tấm wafer tại Lào vào tháng 3, kế hoạch tăng công suất lên 4 GW. Lúc đó, công ty tuyên bố rằng động thái này giúp họ tránh được thuế quan của Mỹ.</p><p>Một cái tên khác là SolarSpace đã mở nhà máy sản xuất tế bào năng lượng mặt trời công suất 5 GW tại Lào vào tháng 9/2023. Tuy vậy, họ phủ nhận mục đích chuyển năng lực sản xuất sang Lào liên quan đến thuế quan Mỹ. Xuất khẩu thiết bị điện mặt trời từ Lào sang Mỹ chưa có trong năm ngoái nhưng đã đạt khoảng 48 triệu USD vào 8 tháng đầu năm nay.</p><p>Một số công ty khác còn đi xa hơn. JinkoSolar đã ký hợp đồng gần một tỷ USD với các đối tác tại Arab Saudi để xây dựng nhà máy sản xuất 10 GW tế bào và mô-đun năng lượng mặt trời tại quốc gia Trung Đông này.</p><p>Việc xây dựng các nhà máy sản xuất năng lượng mặt trời tại Mỹ của các công ty Trung Quốc cũng đang bùng nổ. Theo phân tích của Reuters, các công ty Trung Quốc sẽ có ít nhất 20 GW công suất sản xuất pin năng lượng mặt trời ngay tại nước này trong năm tới, đủ để phục vụ khoảng một nửa thị trường Mỹ.</p><p style=\"text-align:right;\"><strong>Phiên An (theo Reuters)</strong></p>','tranminhkhang8888@gmail.com','tranminhkhang8888@gmail.com',NULL,'Thiết bị điện mặt trời Trung Quốc chơi \'mèo vờn chuột\' với Mỹ','https://vnexpress.net/thiet-bi-dien-mat-troi-trung-quoc-choi-meo-von-chuot-voi-my-4811919.html','\"Để tránh thuế của Mỹ, các công ty thiết bị điện mặt trời Trung Quốc đã nhanh chóng chuyển nhà máy sang các nước khác ở châu Á như Thái Lan, Malaysia, Việt Nam và Campuchia.  Mặc dù Mỹ tăng cường thuế quan nhưng các công ty Trung Quốc vẫn tìm cách né tránh bằng cách di dời sản xuất và mở nhà máy mới ở các nước khác như Indonesia và Lào.  Đây là một cuộc chơi mèo vờn chuột khi Trung Quốc liên tục thích nghi với chiến lược thuế của Mỹ.  Mặc dù các nhà sản xuất Mỹ kêu gọi chính phủ tăng cường kiểm soát, Trung Quốc vẫn đang mở rộng sản xuất tại Mỹ và các thị trường khác để duy trì vị thế dẫn đầu trong ngành năng lượng mặt trời.\"','https://i1-kinhdoanh.vnecdn.net/2024/11/04/AFP-20240626-20499926278883246-5212-8285-1730705922.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=kMLQctrSG0pGexpvlVXL1A','Thiết bị điện mặt trời Trung Quốc chơi \'mèo vờn chuột\' với Mỹ',NULL,NULL,NULL),(_binary '',NULL,'2024-11-05 13:59:26.385794',33,1,'2024-12-06 21:25:13.029058',1,2,'2024-11-07 17:49:39.441048','https://res.cloudinary.com/dztroerja/video/upload/v1730976633/news-33.mp3.mp3','<p>Viêm não Nhật Bản thường gặp trong mùa hè, song có thể xuất hiện vào mùa mưa do muỗi truyền bệnh phát triển, để lại di chứng nặng cho bệnh nhân.</p><p>BS.CKI Bạch Thị Chính, Giám đốc Y khoa Hệ thống tiêm chủng VNVC, cho biết như trên, thêm rằng bệnh viêm não Nhật Bản do virus gây ra với trung gian truyền bệnh là muỗi Culex. Bệnh gây nhiễm trùng cấp tính hệ thần kinh trung ương với tỷ lệ tử vong khoảng 30%. Một số trường hợp có thể mất khả năng ngôn ngữ hoặc không nói được, mất trí nhớ...</p><p>Theo Tổ chức Y tế Thế giới (WHO), virus viêm não Nhật Bản là nguyên nhân chính gây viêm não do virus ở nhiều quốc gia châu Á, ước tính 100.000 ca lâm sàng mỗi năm. 24 quốc gia thuộc khu vực Đông Nam Á và Tây Thái Bình Dương ghi nhận viêm não Nhật Bản lưu hành, khiến hơn 3 tỷ người có nguy cơ bị nhiễm trùng.</p><figure class=\"image\"><img style=\"aspect-ratio:680/453;\" src=\"https://i1-suckhoe.vnecdn.net/2024/11/04/vnvc-tre-tiem-vaccine-17307156-4511-2825-1730715835.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=cbRO6KGVdiezWudTjWcHoA\" alt=\"Trẻ em dưới 15 tuổi dễ mắc viêm não Nhật Bản. Ảnh: Vecteezy\" width=\"680\" height=\"453\"></figure><p><span style=\"font-size:12px;\"><i>Trẻ em dưới 15 tuổi dễ mắc viêm não Nhật Bản. Ảnh: Vecteezy</i></span></p><p>Tại Việt Nam, virus lưu hành toàn quốc, nhiều nhất ở các tỉnh đồng bằng và trung du miền Bắc. Bệnh thường gặp ở trẻ em dưới 15 tuổi. Người lớn cũng có thể mắc bệnh, nguy cơ cao hơn với người chưa được tiêm phòng hoặc tiếp xúc với virus khi du lịch, đến vùng có dịch, gần ruộng lúa nước, cánh đồng, vườn cây...</p><p>Theo bác sĩ Chính, triệu chứng viêm não Nhật Bản dễ nhầm lẫn với cúm, dẫn tới điều trị muộn, tăng tỷ lệ di chứng. Bệnh nhân có biểu hiện sốt đột ngột 39-40 độ C, kém đáp ứng hạ sốt, thường kèm theo ớn lạnh, tiêu chảy, sau đó là đau đầu, buồn nôn. Trẻ nhỏ mắc bệnh thường quấy khóc, vật vã mê sảng hoặc li bì, co giật, tăng trương lực cơ, rối loạn thần kinh thực vật như vã mồ hôi, mạch nhanh.</p><p>Hiện viêm não Nhật Bản chưa có thuốc đặc hiệu, chủ yếu điều trị triệu chứng như hạ nhiệt tích cực, chống suy hô hấp - thở máy, chống phù não, cân bằng nước, điện giải... Ngoài ra, bác sĩ sẽ dựa vào điện giải đồ và đường máu để điều chỉnh rối loạn nếu có, ngăn bội nhiễm, đảm bảo dinh dưỡng.</p><p>Viêm não Nhật Bản có tỷ lệ tử vong lên đến 30% và di chứng lên tới 50%. Các di chứng vĩnh viễn về nhận thức, hành vi hoặc thần kinh, như co giật, mất thính lực hoặc thị lực, các vấn đề về ngôn ngữ, trí nhớ... Nghiên cứu của Bệnh viện Nhi Trung ương vào tháng 11/2023, trên 71 bệnh nhân viêm não Nhật Bản dưới 16 tuổi điều trị nội trú cho thấy 55% gặp di chứng về tinh thần và vận động do khi nhập viện bị suy hô hấp hoặc sốt trên 7 ngày, liệt chi...</p><p>Ngoài để lại di chứng, bệnh cũng gây gánh nặng kinh tế cho người bệnh và gia đình. Nghiên cứu do các chuyên gia từ Path, Viện Vệ sinh dịch Tễ Trung ương, WHO Việt Nam thực hiện, khảo sát trên 242 bệnh nhân Việt Nam trong vòng 6 tháng, công bố năm 2023 cho thấy việc điều trị viêm não Nhật Bản tốn trung bình gần 3.400 USD từ khi nhập viện đến 90 ngày sau khi ra viện. Quá trình điều trị di chứng kéo dài, mỗi năm tốn trung bình 300-400 USD. Mỗi năm, các hộ gia đình mất hơn 64 ngày làm việc để thuê người hoặc tự chăm sóc bệnh nhân trong giai đoạn cấp tính, đồng thời vay tiền để trang trải các chi phí liên quan.</p><figure class=\"image\"><img style=\"aspect-ratio:680/446;\" src=\"https://i1-suckhoe.vnecdn.net/2024/11/04/vnvc-tre-tiem-vac-xin-viem-nao-5253-7610-1730715836.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=KOMXHK3m2P5PCIWMNKPiWA\" alt=\"Trẻ đến thăm khám và tiêm chủng vaccine ngừa bệnh viêm não Nhật Bản tại VNVC. Ảnh: Mộc Thảo\" width=\"680\" height=\"446\"></figure><p><span style=\"font-size:12px;\"><i>Trẻ đến thăm khám và tiêm chủng vaccine ngừa bệnh viêm não Nhật Bản tại VNVC. Ảnh: Mộc Thảo</i></span></p><p>Để phòng viêm não Nhật Bản, mọi người cần dọn dẹp nhà ở, môi trường sống sạch sẽ, diệt bọ gậy, tránh để bị muỗi đốt. Khi đi ngủ cần mắc màn, thường xuyên sử dụng các biện pháp xua, diệt muỗi, không cho trẻ em chơi gần chuồng gia súc để phòng muỗi đốt.</p><p>Biện pháp phòng bệnh hiệu quả và đơn giản nhất là tiêm vaccine. Việt Nam có vaccine phòng bệnh viêm não Nhật Bản, được triển khai trong cả chương trình tiêm chủng mở rộng và dịch vụ. Mỗi loại vaccine lại có lịch tiêm chủng khác nhau. Trong chương trình tiêm chủng mở rộng, vaccine dùng cho trẻ từ 12 tháng tuổi, bao gồm ba mũi cơ bản. Đây là vaccine bất hoạt, cần phải tiêm nhắc mỗi ba năm để duy trì miễn dịch hiệu quả.</p><p>Trong kênh tiêm chủng dịch vụ hiện có vaccine viêm não Nhật Bản sống giảm độc lực - tái tổ hợp thế hệ mới, có thể tiêm phòng sớm cho trẻ từ 9 tháng tuổi với số mũi tiêm ít hơn. Trẻ từ 9 tháng đến 18 tuổi chỉ cần một mũi cơ bản và một mũi nhắc lại cách nhau một năm. Người trưởng thành từ 18 tuổi trở lên tiêm một mũi. Nếu trẻ đã từng tiêm 3 mũi cơ bản vaccine viêm não Nhật Bản trong chương trình tiêm chủng mở rộng, có thể tiêm nhắc cho trẻ với một vaccine viêm não Nhật Bản sống giảm độc lực thế hệ mới.</p><p style=\"text-align:right;\"><strong>Hạ Lam</strong></p>','tranminhkhang8888@gmail.com','minhkhang',NULL,'Nguy cơ nhiễm viêm não Nhật Bản trong mùa mưa','https://vnexpress.net/nguy-co-nhiem-viem-nao-nhat-ban-trong-mua-mua-4812066.html','\"Viêm não Nhật Bản do muỗi truyền bệnh gây ra, nguy hiểm với tỷ lệ tử vong 30% và di chứng 50%. Bệnh thường gặp ở trẻ dưới 15 tuổi, gây sốt cao, đau đầu, buồn nôn, co giật và có thể dẫn đến mất trí nhớ, liệt, tàn phế. Bệnh chưa có thuốc đặc hiệu, điều trị triệu chứng, tốn kém và ảnh hưởng nặng nề đến người bệnh và gia đình. Phòng bệnh bằng cách diệt muỗi, mắc màn, tiêm vaccine. Vaccine viêm não Nhật Bản có trong chương trình tiêm chủng mở rộng và dịch vụ, bảo vệ hiệu quả khỏi bệnh. \"','https://res.cloudinary.com/dd1grolgr/image/upload/v1730789845/tagged-images/mofktoufny3oc6jkhw1f.jpg','Nguy cơ nhiễm viêm não Nhật Bản trong mùa mưa','manage-kinh-te',NULL,NULL),(_binary '',1,'2024-11-05 15:51:13.459492',34,3,'2024-12-06 21:23:58.563309',13,2,'2024-11-05 16:11:33.809308','https://res.cloudinary.com/dztroerja/video/upload/v1730797926/news-34.mp3.mp3','<p>Hiếu Ngọc, lớp 12 Hóa 1, trường THPT chuyên Hà Nội - Amsterdam, đạt điểm SAT tuyệt đối 1600/1600 sau lần thi thứ hai.</p><p>Lương Minh Hiếu Ngọc đạt kết quả này ở đợt thi hôm 19/10. Theo College Board - tổ chức sở hữu bài thi, hàng năm có khoảng hai triệu học sinh trên thế giới thi SAT. Số thí sinh đạt từ 1400 điểm trở lên chiếm 7%. Từ mốc 1530 trở lên, người thi lọt top 1% cao nhất thế giới.</p><p>\"Nhận kết quả, em run lên vì bất ngờ\", Ngọc nhớ lại.</p><p>Bài thi SAT gồm hai phần Toán và Đọc - Viết, đều 800 điểm. Ở phần Toán, Ngọc cho biết nội dung kiến thức trải dài từ các năm cấp hai, gồm lượng giác, số học, hình học... Còn bài thi Đọc - Viết chia làm hai module với các chủ đề về khoa học, lịch sử, văn học.</p><p>Trước đó hai tháng, Ngọc thi SAT lần đầu, chỉ đạt 1490 điểm. Ở lần thi vừa qua, nữ sinh có vài câu không chắc chắn ở phần Đọc - Viết nên không nghĩ đạt điểm tối đa.</p><p>\"Để giành mức điểm này, em nghĩ ngoài năng lực còn có cả sự may mắn. Với em, kết quả đã ghi nhận sự nỗ lực và quyết tâm đạt mục tiêu của bản thân\", nữ sinh nhìn nhận.</p><figure class=\"image\"><img style=\"aspect-ratio:680/473;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/04/ngoc-3517-1730698283.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=KKwFts5A01qBrYp3kox_DQ\" alt=\"Lương Minh Hiếu Ngọc. Ảnh: Nhân vật cung cấp\" width=\"680\" height=\"473\"></figure><p><span style=\"font-size:12px;\"><i>Lương Minh Hiếu Ngọc trong ảnh kỷ yếu. Ảnh: Nhân vật cung cấp</i></span></p><p>Hiếu Ngọc cho hay bắt đầu học SAT từ hồi tháng 4. Ban đầu, em tự học bằng cách tham khảo kinh nghiệm trong các nhóm ôn luyện. Sau đó, Ngọc đăng ký học ở trung tâm cho bài bản. Ngoài hoàn thành bài tập mà thầy giao, nữ sinh tự học trên nền tảng giáo dục trực tuyến miễn phí - Khan Academy.</p><p>Theo Ngọc, để học tốt, thí sinh cần tập trung luyện tư duy, hiểu rõ vấn đề, biết tại sao sai hay đúng thay vì chỉ quan tâm đến đáp án. Do đó, mỗi khi làm bài tập, em sẽ đọc kỹ lại sau khi làm xong, để xem có thể chọn câu trả lời nào khác hay không.</p><p>Nữ sinh cho hay vì đề thường có từ vựng mới, nên trong quá trình học, em chú ý tra cứu, ghi chép và ôn tập cẩn thận. Việc nắm chắc ngữ pháp, có vốn từ rộng và khả năng đọc hiểu tiếng Anh rất quan trọng.</p><p>Với môn Toán, Ngọc tìm những đề thi mới nhất để nhận định xu hướng ra đề. Em bắt đầu bằng cuốn Panda Math với các dạng bài cơ bản, sau đó luyện đề thực tế để có kỹ năng làm bài.</p><p>Dạy Ngọc từ năm lớp 8, thầy Nguyễn Hồng Hải, giáo viên chủ nhiệm lớp 12 Hóa 1, hiểu rõ tính cách và tinh thần học tập quyết liệt của học trò. Thầy nhận xét Ngọc chăm chỉ, học miệt mài và không bị phân tán bởi xung quanh.</p><p>Em hai lần giành giải nhất kỳ thi chọn học sinh giỏi quốc gia môn Hóa năm lớp 11 và 12, lọt vào vòng ôn luyện để chọn đội tuyển thi Olympic quốc tế. Ngoài ra, nữ sinh đạt 7.5 IELTS</p><p>\"Ngọc là một trong những học sinh xuất sắc của tôi. Em ấy có khả năng tự học hiếm thấy. Học tới đâu thấm đến đó\", thầy Hải nói.</p><p>Ngọc cho biết sẽ dùng điểm SAT và IELTS để đăng ký xét tuyển vào các đại học trong và ngoài nước, theo đuổi ngành Hóa Dược.</p><p style=\"text-align:right;\"><strong>Bình Minh</strong></p>','tranminhkhang8888@gmail.com','minhkhang',NULL,'Nữ sinh đạt điểm SAT tuyệt đối','https://vnexpress.net/nu-sinh-dat-diem-sat-tuyet-doi-4811755.html','\"Lương Minh Hiếu Ngọc, học sinh lớp 12 Hóa 1 trường THPT chuyên Hà Nội - Amsterdam, đã đạt điểm SAT tuyệt đối 1600/1600 sau lần thi thứ hai. Hiếu Ngọc là một trong số ít học sinh đạt điểm số này, nằm trong top 1% cao nhất thế giới. Nữ sinh chia sẻ bí quyết học tập hiệu quả, bao gồm tự học, luyện đề thực tế, tra cứu từ vựng và chú trọng kỹ năng đọc hiểu tiếng Anh. Hiếu Ngọc cũng đạt giải nhất kỳ thi học sinh giỏi quốc gia môn Hóa hai năm liên tiếp và 7.5 IELTS. Nữ sinh dự định sử dụng kết quả SAT và IELTS để xét tuyển vào các trường đại học trong và ngoài nước, theo đuổi ngành Hóa Dược. \"','https://i1-vnexpress.vnecdn.net/2024/11/04/ngoc-3517-1730698283.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=jzE_IWRLqndcd-v9niT7JQ','Nữ sinh đạt điểm SAT tuyệt đối','admin',NULL,NULL),(_binary '',NULL,'2024-11-05 15:54:19.074640',35,NULL,'2024-12-06 22:26:54.650362',2,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733498765/news-35.mp3.mp3','<p>Sau bầu cử Mỹ, vàng được dự đoán theo xu hướng tăng vì rủi ro địa chính trị, còn chứng khoán cần thêm 2-3 năm để phản ánh rõ nét.</p><p>Với vai trò then chốt của Mỹ trong nền kinh tế toàn cầu, cùng những bất ổn địa chính trị hiện nay, cuộc bầu cử tổng thống sắp tới được nhiều người xem là một bước ngoặt với những tác động sâu rộng. Trong bối cảnh này, nhà đầu tư đang quan tâm cuộc đua vào Nhà Trắng ảnh hưởng thế nào tới các kênh đầu tư, nhất là vàng và chứng khoán.</p><p>Giá vàng sẽ có xu hướng tăng dù ai đắc cử</p><p>Bài phân tích gần đây của Hội đồng Vàng thế giới (WGC) chỉ ra trong lịch sử, các cuộc bầu cử Mỹ không có ảnh hưởng đáng kể hoặc ngay lập tức đến giá vàng thế giới.</p><p>Dẫu vậy, bất kể ứng cử viên chiến thắng là ai, rủi ro địa chính trị ngắn hạn vẫn tăng cao. Điều này khiến các nhà đầu tư cảm nhận sự cần thiết phải phòng ngừa rủi ro cho danh mục đầu tư của họ và có thể đóng vai trò là chất xúc tác cho kim loại quý tăng.</p><figure class=\"image\"><img style=\"aspect-ratio:680/446;\" src=\"https://i1-kinhdoanh.vnecdn.net/2024/11/02/vang-4495-1730547576.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Hqtp4U_6_VPB8-k58_BeJw\" alt=\"Ngân hàng bán vàng ở Hà Nội, ngày 3/6. Ảnh: Giang Huy\" width=\"680\" height=\"446\"></figure><p>Ngân hàng bán vàng ở Hà Nội, ngày 3/6. Ảnh: Giang Huy</p><p>Hội đồng Vàng thế giới nhấn mạnh, yếu tố quan trọng không nằm ở việc đảng nào có ứng cử viên giành chiến thắng vì lịch sử không ghi nhận tác động nhất quán của việc này đến giá vàng. Thay vào đó, mấu chốt nằm ở các chính sách kinh tế tài khóa và tiền tệ mà tổng thống tương lai đưa ra phù hợp như thế nào với đặc tính của kênh tài sản này. Giá vàng còn phản ứng với các động lực chính là hướng đi của đồng đôla, lãi suất hoặc nhận thức của thị trường về các rủi ro.</p><p>Điều này được chứng minh bằng thực tế là diễn biến giá vàng không có sự đồng nhất trong các nhiệm kỳ của một đảng.</p><p>Trang thống kê dữ liệu tài chính Visual Capitalist chỉ ra, dưới thời Tổng thống George H. W. Bush của đảng Cộng hòa, vàng giảm 19%, nhưng đến nhiệm kỳ của George W. Bush, giá lại tăng tới 215%. Tương tự, giai đoạn ông Bill Clinton của đảng Dân chủ làm tổng thống, kim loại quý sụt 20%, rồi đến thời của ông Barack Obama, giá vẫn tích lũy thêm 44%.</p><p>Tương tự, trong báo cáo của Elara Capital, quỹ đầu tư có kinh nghiệm về vàng hơn 10 năm qua, giá có thể vẫn ở mức cao bất kể ai giành chiến thắng. Họ dự báo vàng tăng 10% trong 12 tháng tới, nhưng nhấn mạnh các yếu tố kích thích sẽ là nguy cơ thâm hụt tài khóa lớn của Mỹ và diễn biến của lợi suất USD.</p><p>Từ góc độ kỹ thuật, nhóm chuyên gia của cổng thông tin tài chính FXEmpire lưu ý rằng thị trường vàng đang ở giao điểm của ngưỡng kháng cự dài hạn quan trọng. Tuy có xu hướng tăng, giá vẫn có thể trải qua đợt điều chỉnh đáng kể trước khi tiếp tục kỷ lục mới. Mức kháng cự mạnh trên thị trường vàng là 2.800-3.000 USD.</p><p>Với giá vàng Việt Nam, kết quả bầu cử Mỹ tác động như thế nào? Trước hết cần hiểu rằng ở thị trường trong nước, giá vàng có sự phân tách rõ rệt giữa vàng miếng SJC và nhẫn trơn 24K.</p><p>Giá vàng nhẫn thường đi song song với diễn biến trên thị trường thế giới. Do đó, nó có xu hướng chạy theo chính sách của mỗi thời kỳ Tổng thống Mỹ cũng như tùy thuộc vào hướng đi của đồng đôla, lãi suất hoặc nhận thức về các rủi ro của nhà đầu tư.</p><p style=\"text-align:right;\"><strong>Tấn Đạt</strong></p>','tranminhkhang8888@gmail.com','anonymousUser',NULL,'Kịch bản giá vàng và chứng khoán sau kỳ bầu cử Mỹ','https://vnexpress.net/kich-ban-gia-vang-va-chung-khoan-sau-ky-bau-cu-my-4811459.html','\"Cuộc bầu cử Mỹ sắp tới tác động mạnh đến thị trường tài chính toàn cầu.  Giá vàng dự báo tăng do rủi ro địa chính trị gia tăng, bất kể ai thắng cử.  Tuy nhiên, tác động của bầu cử lên giá vàng không nhất quán trong lịch sử.  Các chính sách kinh tế tài khóa và tiền tệ của tổng thống mới sẽ là yếu tố quyết định.  Chứng khoán cần thêm thời gian (2-3 năm) để phản ánh kết quả bầu cử.  Giá vàng có thể tăng 10% trong 12 tháng tới do thâm hụt tài khóa Mỹ và biến động USD.  Thị trường vàng có thể điều chỉnh trước khi đạt mức cao mới (2.800-3.000 USD).  Giá vàng trong nước, đặc biệt vàng nhẫn, sẽ phản ánh diễn biến giá vàng thế giới.\"','https://i1-kinhdoanh.vnecdn.net/2024/11/02/a-nh-settop-1730548593-9209-1730548658.png?w=680&h=408&q=100&dpr=1&fit=crop&s=rwM9R4EZqWXLuSYKILNq9A','Kịch bản giá vàng và chứng khoán sau kỳ bầu cử Mỹ','admin',NULL,'2024-12-06 22:25:38.863910'),(_binary '',NULL,'2024-11-10 22:39:39.766912',36,NULL,'2024-12-06 22:11:49.160715',1,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733497906/news-36.mp3.mp3','<p>Phung phí cơ hội ở cuối trận, Việt Nam thua Indonesia 0-2 tại chung kết futsal AFF Cup 2024.</p><p>* Ghi bàn: Syaifullah 8’, Xavier 39’.</p><p>Việt Nam bước vào sân Terminal 21 Korat ở Thái Lan với bất lợi thể lực. Từ đầu giải, đội thi đấu năm trận, nhiều hơn một so với Indonesia. Trong hai trận gần nhất, Việt Nam mất nhiều sức khi thắng Thái Lan 3-2 ở lượt cuối vòng bảng rồi ngược dòng trước Australia 5-4 sau hiệp phụ ở bán kết.</p><p>Trước chung kết, HLV Diego Giustozzi cảnh báo các học trò về sự nguy hiểm của pivo (tiền đạo) Evan Soumilena – có thể hình tốt và khéo léo, và điều này thể hiện ngay từ đầu trận. Soumilena gây khó cho Việt Nam bằng những pha tì đè, lùi quay lưng rồi xoay hay nhả bóng để dứt điểm nguy hiểm.</p><figure class=\"image\"><img style=\"aspect-ratio:680/493;\" src=\"https://i1-thethao.vnecdn.net/2024/11/10/viet-nam-indonesia-chung-ket-f-8391-2256-1731244432.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=j_31QdVBlAyLY7t3zr9dKw\" alt=\"Châu Đoàn Phát (áo đỏ) tranh chấp với Muhammad Syaifullah ở trận chung kết Việt Nam thua Indonesia 0-2, tại futsal AFF Cup 2024. Ảnh: FFI\" width=\"680\" height=\"493\"></figure><p><span style=\"font-size:12px;\"><i>Châu Đoàn Phát (áo đỏ) tranh chấp với Muhammad Syaifullah ở trận chung kết Việt Nam thua Indonesia 0-2, tại futsal AFF Cup 2024. Ảnh: FFI</i></span></p><p>Phút thứ tư, Soumilena xoay lưng nhận bóng nhưng không giữ mà giật ngay sang trái khiến Nhan Gia Hưng lỡ đà. Nhưng fixo (hậu vệ) Việt Nam vẫn kịp xoạc cản cú sút. Ba phút sau, Soumilena tì đè lùi bóng rồi nhả cho đồng đội dứt điểm chệch cột trái.</p><p>Indonesia còn có bài thủ môn Ahmad Habiebie dâng cao để phối hợp hoặc dứt điểm bất ngờ. Phút thứ tám, thủ môn Indonesia sút từ giữa sân vào góc trái khiến đồng nghiệp Phạm Văn Tú phải đổ người đẩy bóng chịu phạt góc. Ngay sau đó, từ đường chuyền của Rio Pangestu, Samuel Eko bỏ bóng thông minh cho Guntur Ariwibowo sút vào cột phải, nơi có Muhammad Syaifullah đứng đợi để đệm bóng vào lưới mở tỷ số.</p><p>Sau đó, Việt Nam gặp nhiều khó khăn trong tấn công, khi Indonesia đeo bám tốt và chơi quyết liệt không ngại phạm lỗi. Tỷ số còn suýt nhân đôi khi Châu Đoàn Phát mất bóng hai lần ở phút 13, nhưng đối thủ không thể tận dụng. Cơ hội nguy hiểm cuối hiệp thuộc về Trần Thái Huy với pha lắc từ phải vào giữa, rồi sút góc gần nhưng thủ môn bắt gọn.</p><p>Sang hiệp hai, Indonesia vẫn nhập cuộc tốt hơn. Evan Soulimena suýt ghi bàn sau pha tì đè xoay người, rồi giả sút lừa hai cầu thủ Việt Nam, nhưng cú sút bị Phạm Văn Tú cản phá bằng chân.</p><figure class=\"image\"><img style=\"aspect-ratio:680/514;\" src=\"https://i1-thethao.vnecdn.net/2024/11/10/viet-nam-indonesia-chung-ket-f-3957-6980-1731244432.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=eVQGcNEWw_AxxyaHva2oaQ\" alt=\"Ala Vũ Ngọc Ánh (trái) trong trận Việt Nam thua Indonesia 0-2 ở chung kết futsal AFF Cup 2024. Ảnh: FFI\" width=\"680\" height=\"514\"></figure><p><span style=\"font-size:12px;\"><i>Ala Vũ Ngọc Ánh (trái) trong trận Việt Nam thua Indonesia 0-2 ở chung kết futsal AFF Cup 2024. Ảnh: FFI</i></span></p><p>Kể từ đó, Việt Nam dồn ép tốt và tạo ra nhiều cơ hội ăn bàn hơn. Phút 27, Thịnh Phát suýt chệch cột. Một phút sau, Đinh Công Viên vê bóng gầm giày qua một cầu thủ rồi chuyền ngang, để Ngọc Ánh đặt lòng sệt trong thế trống trải nhưng Habiebie bắt gọn. Đến phút 33, Ngọc Ánh một lần nữa tiếc nuối sau pha đảo chân qua người, nhưng cú sút chân trái căng lại chưa hiểm để thành bàn.</p><p>Hai cơ hội đáng tiếc nhất của Việt Nam đến trong năm phút cuối. Phút 35, Châu Đoàn Phát chuyền xỏ háng thuận lợi, nhưng Thịnh Phát ở cột xa lại không thắng được Habiebie. Chiến thuật power-play thì đem đến cơ hội ở phút 37, nhưng hai cú sút của Nhan Gia Hưng và Mạnh Dũng đều không qua được thân hình của thủ môn Indonesia.</p><p>Chiến thuật đẩy thủ môn lên tấn công khiến khung thành không còn người trấn giữ. Và ở pha mất bóng phút 39 của Việt Nam, Muhammad Xavier dứt điểm từ sân nhà, ấn định chiến thắng 2-0.</p><p>Indonesia lần thứ hai vô địch futsal AFF Cup, sau năm 2010 (không có Thái Lan). Trong khi đó, Việt Nam lần thứ ba về nhì, các năm 2009, 2012 và 2024. Tính riêng tại futsal AFF Cup, Indonesia cũng cân bằng thành tích đối đầu trước Việt Nam, với năm thắng, năm thua và một hòa.</p><p>Đội hình xuất phát</p><p>Việt Nam: Phạm Văn Tú, Châu Đoàn Phát, Trần Thái Huy, Nguyễn Thịnh Phát, Nhan Gia Hưng</p><p>Dự bị: Hồ Văn Ý, Huỳnh Mi Woen, Nguyễn Mạnh Dũng, Đinh Công Viên, Nguyễn Đa Hải, Vũ Ngọc Anh, Từ Minh Quang, Trần Nhật Trung</p><p>Indonesia: Ahmad Habiebie, Firman Adriansyah, Ardiansyah Nur, Evan Soumilena, Wendy Brian Ick</p><p>Dự bị: Muhammad Nayaruddin, Muhammad Xavier, Mochammad Rahmattulah, Israr Megantara, Samuel Eko, Rio Pangestu, Muhammad Syaifullah, Guntur Ariwibowo, Romi Humandri.</p><p style=\"text-align:right;\"><strong>Hiếu Lương</strong></p>','tranminhkhang8888@gmail.com','tranminhkhang8888@gmail.com',NULL,'Việt Nam thua Indonesia ở chung kết futsal AFF Cup 2024','https://vnexpress.net/viet-nam-thua-indonesia-o-chung-ket-futsal-aff-cup-2024-4814382.html','\"Việt Nam thua Indonesia 0-2 ở chung kết futsal AFF Cup 2024.  Indonesia ghi bàn ở phút 8 và 39.  Việt Nam thi đấu với bất lợi thể lực sau nhiều trận đấu căng thẳng.  Soumilena của Indonesia gây khó khăn cho hàng phòng ngự Việt Nam.  Việt Nam tạo ra nhiều cơ hội nhưng không tận dụng thành công.  Những pha bỏ lỡ đáng tiếc ở cuối trận khiến Việt Nam thất bại.  Indonesia vô địch, còn Việt Nam về nhì. Đây là lần thứ ba Việt Nam giành ngôi Á quân AFF Cup Futsal.  Indonesia và Việt Nam có thành tích đối đầu cân bằng trong lịch sử giải đấu.\"','https://res.cloudinary.com/dd1grolgr/image/upload/v1731253152/tagged-images/wfhiqw04tkafziy9uuly.jpg','Việt Nam thua Indonesia ở chung kết futsal AFF Cup 2024','manage-the-thao',NULL,'2024-12-06 22:10:48.760568'),(_binary '\0',NULL,'2024-11-10 22:59:28.152929',37,NULL,'2024-11-10 23:14:02.303884',NULL,2,NULL,NULL,'<p>Thủ thành huyền thoại Hàn Quốc Lee Woon-jae được HLV Kim Sang-sik đề xuất làm HLV thủ môn đội tuyển Việt Nam, trước thềm AFF Cup 2024.</p><p>\"HLV Kim Sang-sik giới thiệu tôi khi LĐBĐ Việt Nam (VFF) tìm kiếm HLV thủ môn toàn thời gian cho ĐTQG\", Lee Woon-jae nói với báo Hàn Quốc Sisajournal ngày 9/11. \"Ông ấy nói đây là cơ hội tuyệt vời, và tôi đã nhận lời\".</p><p>Đang trong quá trình đàm phán nên VFF chưa công bố thông tin. Nếu thành công, cựu thủ môn sinh năm 1973 sẽ bắt đầu công việc khi ĐTQG tập huấn tại Hàn Quốc, từ ngày 23/11. Lee cho biết: \"Tôi sẽ chia sẻ mọi thứ mình biết cho các tuyển thủ Việt Nam để giúp họ chinh phục mục tiêu, tại AFF Cup vào tháng 12\".</p><figure class=\"image\"><img style=\"aspect-ratio:680/380;\" src=\"https://i1-thethao.vnecdn.net/2024/11/09/lee-woon-jae-han-quoc-2516-1731141564.png?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=p65rcXc_sTnINjLjmgVB4g\" alt=\"Thủ môn Lee Woon-jae ở đội tuyển Hàn Quốc. Ảnh: Yonhap\" width=\"680\" height=\"380\"></figure><p><span style=\"font-size:12px;\"><i>Thủ môn Lee Woon-jae ở đội tuyển Hàn Quốc. Ảnh: Yonhap</i></span></p><p>Lee Woon-jae là thủ môn huyền thoại của Hàn Quốc, từng dự bốn kỳ World Cup 1994, 2002, 2006 và 2010. Ông thi đấu 133 trận cho ĐTQG, trở thành thủ môn Hàn Quốc duy nhất gia nhập \"Century Club\" (tri ân các cầu thủ thi đấu trên 100 trận cho ĐTQG). Thành tựu lớn nhất ông đạt được giai đoạn này là đứng thứ tư World Cup 2002, đứng thứ ba Asian Cup 2000 và 2007.</p><p>Lee và Kim Sang-sik là đồng đội ở đội tuyển Hàn Quốc từ năm 2000 đến 2007. Tại Asian Cup 2007, cả hai cùng Woo Sung-yong và Lee Dong-gook vướng vào bê bối trốn đi uống rượu ở Indonesia, dẫn đến bị cấm lên đội tuyển một năm.</p><p>Ở cấp CLB, Lee Woon-jae gắn bó chính với hai CLB là Suwon Samsung Bluewings (1996-2010) và Jeonnam Dragons (2011-2012), với 451 trận. Ông vô địch Cup CLB châu Á (nay là AFC Champions League Elite) mùa 2001-2002, vô địch K-League 1 bốn lần (1998, 1999, 2004, 2008), FA Cup ba lần (2002, 2009, 2010).</p><p>Lee cũng giành nhiều danh hiệu cá nhân, gồm đội hình châu Á tiêu biểu tại World Cup vào năm 2002, cầu thủ xuất sắc K-League 2008. Ngoài ra, ông bốn lần lọt đội hình tiêu biểu K-League 1 (1999, 2002, 2004, 2008) và đội hình tiêu biểu Asian Cup 2007.</p><figure class=\"image\"><img style=\"aspect-ratio:680/591;\" src=\"https://i1-thethao.vnecdn.net/2024/11/09/hlv-kim-sang-sik-lee-woon-jae-8380-8934-1731141564.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=-nwWQd0JSLPwIT_jou_EPA\" alt=\"HLV Kim Sang-sik (trái) và HLV thủ môn Lee Woon-jae (phải) khi làm việc tại Jeonbuk Hyundai Motors. Ảnh: Jeonbuk\" width=\"680\" height=\"591\"></figure><p><span style=\"font-size:12px;\"><i>HLV Kim Sang-sik (trái) và HLV thủ môn Lee Woon-jae (phải) khi làm việc tại Jeonbuk Hyundai Motors. Ảnh: Jeonbuk</i></span></p><p>Sau mùa 2012, Lee Woon-jae giải nghệ, chuyển sang làm HLV thủ môn U23 Hàn Quốc (2013 - 2015), đội tuyển Hàn Quốc (1/2016 - 6/2016). Ông cũng làm việc ở CLB cũ Suwon (2017-2018), U23 Trung Quốc (2018-2020), rồi đồng hành trong ban huấn luyện của HLV Kim Sang-sik tại Jeonbuk Hyundai Motors (12/2020 – 6/2023).</p><p>Trước đó, HLV thủ môn của đội tuyển Việt Nam là ông Ngô Việt Trung và Trần Minh Quang. Tuy nhiên, vị trí này được đánh giá chưa đủ chất lượng để huấn luyện những thủ môn như Đặng Văn Lâm hay Nguyễn Filip. ĐTQG từng có một HLV thủ môn Hàn Quốc là ông Kim Hyun-tae, dưới thời HLV Park Hang-seo, từ tháng 10/2020 đến 11/2021. Ông Kim còn làm việc ở các cấp độ trẻ như U15, U19 và U23.</p><p>Kế hoạch tập huấn của đội tuyển Việt Nam tại Hàn Quốc trong khoảng 10 ngày, từ ngày 23/11 tại thành phố Gyeongju, tỉnh Gyeongsangbuk. Đến ngày 9/12, đội làm khách trước Lào ở trận ra quân bảng B AFF Cup 2024. Sau đó, đội gặp Indonesia (sân nhà) ngày 15/12, Philippines (khách) 18/12 và Myanmar (nhà) 21/12.</p><p>Mục tiêu dành cho HLV Kim Sang-sik là lọt vào chung kết.</p><p style=\"text-align:right;\"><strong>Trung Thu</strong></p>','trankhangctu@gmail.com','admin',NULL,'HLV bốn lần dự World Cup sắp gia nhập tuyển Việt Nam','https://vnexpress.net/hlv-bon-lan-du-world-cup-sap-gia-nhap-tuyen-viet-nam-4814133.html',NULL,'https://res.cloudinary.com/dd1grolgr/image/upload/v1731254297/tagged-images/ke9kqijwjikxl40prfap.png','HLV bốn lần dự World Cup sắp gia nhập tuyển Việt Nam','admin',NULL,NULL),(_binary '\0',NULL,'2024-11-10 23:02:45.176444',38,NULL,'2024-11-10 23:14:14.614797',NULL,2,NULL,NULL,'<p>Trường Đại học Công thương TP HCM (HUIT) xét tuyển thêm 5 tổ hợp mới, trong đó 4 tổ hợp khối C.</p><p>Ông Phạm Thái Sơn, Giám đốc Trung tâm Tuyển sinh và Truyền thông của trường, ngày 4/11 cho biết tin trên. Thay đổi nhằm tạo điều kiện cho những thí sinh có nền tảng khối C tiếp cận nhiều ngành, nghề của trường.</p><p>\"Việc này còn giúp trường chọn lọc được những sinh viên có năng lực và nền tảng phù hợp với từng ngành học\", ông Sơn nói.</p><p>Các tổ hợp được bổ sung là C00 (Văn, Sử, Địa), C01 (Văn, Toán, Lý), C02 (Văn, Toán, Hóa), C14 (Toán, Văn, Giáo dục Kinh tế và pháp luật), chủ yếu thuộc nhóm luật, quản trị kinh doanh, khách sạn.</p><p>Ngoài ra, trường cũng thêm tổ hợp khác gồm ba môn Toán, Tin học và Tiếng Anh. Đây là tổ hợp lần đầu xuất hiện, do chương trình giáo dục phổ thông mới có môn Tin học. Trường dùng tổ hợp này để xét tuyển ngành Công nghệ thông tin, An toàn thông tin và Khoa học dữ liệu.</p><p style=\"text-align:center;\"><a href=\"https://vnexpress.net/dai-hoc-cong-thuong-tp-hcm-lan-dau-tuyen-khoi-c-4812089-p2.html\"><span style=\"color:hsl(210, 75%, 60%);\"><u>Danh sách ngành và tổ hợp tuyển sinh 2025 dự kiến</u></span></a></p><figure class=\"image\"><img style=\"aspect-ratio:680/453;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/04/951e2422-17fe-46f3-8da2-e1ee62-5808-1302-1730720650.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=47aax8RpItIHt2b_O4OIuQ\" alt=\"Học sinh nghe tư vấn tuyển sinh của trường Đại học Công thương TP HCM, tháng 3/2024. Ảnh: HUIT\" width=\"680\" height=\"453\"></figure><p><span style=\"font-size:12px;\"><i>Học sinh nghe tư vấn tuyển sinh của trường Đại học Công thương TP HCM, tháng 3/2024. Ảnh: HUIT</i></span></p><p>Mỗi năm, trường Đại học Công thương TP HCM tuyển khoảng 7.000 sinh viên. Hồi đầu tháng 10, trường cho biết dự kiến dành 15-20% chỉ tiêu để xét học bạ năm tới, giảm 10% so với năm nay.</p><p>50-60% chỉ tiêu sẽ được dành để để xét điểm thi tốt nghiệp THPT, tương đương những năm gần đây. Phần còn lại, trường dự kiến xét bằng điểm đánh giá năng lực của Đại học Quốc gia TP HCM và Đại học Sư phạm TP HCM.</p><p>Năm 2023, điểm chuẩn theo kết quả thi tốt nghiệp của trường Đại học Công thương TP HCM từ 17 đến 24,5, cao nhất ở ngành Marketing, kế đó là Thương mại điện tử, Logistics và quản lý chuỗi cung ứng với 23,75 điểm.</p><p style=\"text-align:right;\"><strong>Thanh Hằng</strong></p>','trankhangctu@gmail.com','admin',NULL,'Đại học Công thương TP HCM lần đầu tuyển khối C','https://vnexpress.net/dai-hoc-cong-thuong-tp-hcm-lan-dau-tuyen-khoi-c-4812089.html',NULL,'https://i1-vnexpress.vnecdn.net/2024/11/04/951e2422-17fe-46f3-8da2-e1ee62-5808-1302-1730720650.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=j0xjYmBulH-dlvt6wCPMeA','Đại học Công thương TP HCM lần đầu tuyển khối C','admin',NULL,NULL),(_binary '',NULL,'2024-11-10 23:04:57.974035',39,3,'2024-12-06 21:28:49.176882',7,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1732288405/news-39.mp3.mp3','<p>Dư nợ tín dụng đến hết tháng 10 ước tính tăng trưởng trên 10%, cao hơn so với tốc độ cùng kỳ năm ngoái.</p><p>Thông tin này được Thống đốc Ngân hàng Nhà nước Nguyễn Thị Hồng nêu tại báo cáo gửi đại biểu Quốc hội. Theo đó, bà Hồng cho biết tăng trưởng tín dụng đến ngày 31/10 đạt 10,08% so với cuối năm 2023. So với cùng kỳ năm ngoái, tín dụng tăng 16,65%.</p><p>Năm nay, Ngân hàng Nhà nước đặt mục tiêu tăng trưởng tín dụng khoảng 15%. Đà tăng hiện tại, theo Thống đốc phù hợp với chỉ tiêu này, đáp ứng nhu cầu vốn, hỗ trợ ổn định kinh tế vĩ mô, kiểm soát lạm phát.</p><p>Dù vậy, lãnh đạo ngành ngân hàng nhận sức hấp thụ vốn tín dụng của doanh nghiệp và người dân còn thấp. Bởi sau Covid-19, nhiều doanh nghiệp thu hẹp hoặc ngừng sản xuất do thiếu đơn hàng, giải thể, đóng cửa, sức khỏe tài chính bị giảm sút. Còn người dân có xu hướng thắt chặt, giảm chi tiêu dẫn đến cầu tín dụng thấp.</p><p>Trong bối cảnh tăng trưởng tín dụng toàn hệ thống vẫn thấp, Thống đốc Nguyễn Thị Hồng cho biết cơ quan quản lý chủ động điều chỉnh chỉ tiêu cho từng ngân hàng, mà không yêu cầu họ phải gửi đề nghị cấp thêm.</p><figure class=\"image\"><img style=\"aspect-ratio:680/500;\" src=\"https://i1-kinhdoanh.vnecdn.net/2024/11/10/VPBank-ThanhTung28-6371-1731240570.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=OsMTNuXLKzuTk-_IoAg5OA\" alt=\"Giao dịch tại chi nhánh một ngân hàng ở TP HCM, tháng 10/2022. Ảnh: Thanh Tùng\" width=\"680\" height=\"500\"></figure><p><span style=\"font-size:12px;\"><i>Giao dịch tại chi nhánh một ngân hàng ở TP HCM, tháng 10/2022. Ảnh: Thanh Tùng</i></span></p><p>Thực tế, giai đoạn đầu năm nay, mức tăng trưởng tín dụng của các nhà băng không đồng đều, có đơn vị tăng thấp, thậm chí âm trong khi một số tổ chức tín dụng tăng sát chỉ tiêu được giao. Cuối tháng 8, cơ quan quản lý đã cấp thêm hạn mức tăng trưởng tín dụng cho ngân hàng đạt 80% chỉ tiêu tín dụng được giao từ đầu năm.</p><p>Bên cạnh đó, Ngân hàng Nhà nước cũng yêu cầu các nhà băng hướng tín dụng vào các lĩnh vực ưu tiên, động lực tăng trưởng kinh tế. Việc này nhằm hạn chế nợ xấu gia tăng và phát sinh, đảm bảo an toàn hoạt động của hệ thống.</p><p>Cũng theo báo cáo của Ngân hàng Nhà nước, 10 tháng đầu năm, cơ quan này giữ nguyên lãi suất điều hành. Nhà chức trách tiếp tục yêu cầu các ngân hàng tiết giảm chi phí để hạ lãi suất cho vay. Các nhà băng cũng phải công khai mức lãi cho vay bình quân, chênh lệch lãi tiền gửi và cho vay để giúp khách hàng dễ tiếp cận vốn.</p><p>Tính đến ngày 20/10, mặt bằng lãi suất cho vay giảm 0,76% so với cuối năm 2023. Song, theo cơ quan này, việc giảm lãi suất trong thời gian tới \"rất khó khăn\". Nguyên nhân do lãi suất cho vay có xu hướng giảm sâu thời gian qua. Nhu cầu vốn tín dụng tiếp tục tăng sẽ áp lực với mặt bằng lãi suất. Trong khi đó, việc giảm lãi suất tiền đồng trong nước sẽ làm tăng áp lực lên tỷ giá và thị trường ngoại tệ.</p><p>Chưa kể, Ngân hàng Nhà nước cho rằng sức ép về cung ứng vốn của hệ thống với nền kinh tế vẫn còn lớn trong bối cảnh huy động từ thị trường trái phiếu doanh nghiệp, chứng khoán khó khăn. Điều này tiềm ẩn rủi ro kỳ hạn, thanh khoản lớn với hệ thống ngân hàng do phải huy động ngắn hạn cho vay trung dài hạn.</p><p style=\"text-align:right;\"><strong>Phương Dung</strong></p>','trankhangctu@gmail.com','minhkhang2',NULL,'Tín dụng tăng hơn 10%','https://vnexpress.net/tin-dung-tang-hon-10-4814385.html','\"Dư nợ tín dụng tháng 10 tăng trưởng trên 10%, cao hơn cùng kỳ năm ngoái.  Tín dụng tăng 10,08% so với cuối năm 2023 và 16,65% so với cùng kỳ năm trước.  Mục tiêu tăng trưởng tín dụng cả năm là 15%, hiện tại đang phù hợp với mục tiêu.  Tuy nhiên, sức hấp thụ vốn tín dụng còn thấp do khó khăn của doanh nghiệp và người dân sau Covid-19.  Ngân hàng Nhà nước điều chỉnh chỉ tiêu cho từng ngân hàng, cấp thêm hạn mức cho những ngân hàng đạt 80% chỉ tiêu.  Ngân hàng Nhà nước giữ nguyên lãi suất điều hành, yêu cầu giảm lãi suất cho vay và công khai thông tin lãi suất. Lãi suất cho vay giảm 0,76% nhưng việc giảm tiếp rất khó khăn do nhiều áp lực.  Cung ứng vốn cho nền kinh tế vẫn còn lớn, tiềm ẩn rủi ro thanh khoản.\"','https://i1-kinhdoanh.vnecdn.net/2024/11/10/VPBank-ThanhTung28-6371-1731240570.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=tISK7LY70hmvJwgh8o-QJA','Tín dụng tăng hơn 10%','admin',NULL,'2024-11-22 22:12:56.683716'),(_binary '',1,'2024-11-10 23:07:15.601046',40,3,'2024-12-06 21:25:04.163842',14,2,'2024-11-10 23:15:23.309524','https://res.cloudinary.com/dztroerja/video/upload/v1731255337/news-40.mp3.mp3','<p>Ăn theo khung giờ, giảm số bữa ăn trong ngày và nạp nhiều calo vào đầu ngày là 3 chiến lược giảm cân hiệu quả, theo một nghiên cứu mới được công bố.</p><p>Các nhà khoa học tại Đại học Bond, Australia, đã tổng hợp và phân tích lại dữ liệu từ 29 thử nghiệm lâm sàng trước đó về 3 biện pháp can thiệp chế độ ăn uống này. Tất cả thử nghiệm đều so sánh 3 phương pháp này với nhóm đối chứng được chăm sóc tiêu chuẩn hoặc tư vấn dinh dưỡng.</p><p>Các nhà khoa học nhận thấy cả 3 biện pháp can thiệp đều giúp người tham gia giảm một lượng cân đáng kể, chỉ bằng cách thay đổi thời gian ăn chứ không phải thay đổi thành phần dinh dưỡng trong chế độ ăn.</p><p>Ăn theo khung giờ</p><p>Các chuyên gia cho biết gần đây giới khoa học ngày càng quan tâm đến \"chiến lược ăn theo giờ\" - thường được gọi là nhịn ăn gián đoạn - trong đó mọi người thay đổi \"thời điểm\" thay vì \"thành phần\" của chế độ ăn để giảm cân.</p><p>Ăn theo khung giờ giới hạn thời gian ăn trong ngày, ví dụ ăn trong 8 giờ, 16 giờ còn lại để nhịn ăn.</p><p>Các chuyên gia dinh dưỡng cho biết điều này giúp hệ tiêu hóa được nghỉ ngơi, do đó cơ thể có thể tập trung vào các chức năng khác. Nó cũng có thể dẫn đến ketosis, trong đó gan tạo ra ketone làm năng lượng từ tế bào mỡ, thay vì dựa vào đường trong chế độ ăn để làm nhiên liệu.</p><figure class=\"image\"><img style=\"aspect-ratio:680/453;\" src=\"https://i1-suckhoe.vnecdn.net/2024/11/04/pexels-ella-olsson-572949-1640-7970-7638-1730713132.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=NJz-7osL8M8_6Cc6APgc1A\" alt=\"Theo nghiên cứu, giảm số bữa ăn mỗi ngày dường như hiệu quả nhất trong 3 biện pháp. Ảnh minh hoạ: Pexels\" width=\"680\" height=\"453\"></figure><p><span style=\"font-size:12px;\"><i>Theo nghiên cứu, giảm số bữa ăn mỗi ngày dường như hiệu quả nhất trong 3 biện pháp. Ảnh minh hoạ: Pexels</i></span></p><p>Giảm số bữa ăn</p><p>Giảm số bữa ăn mỗi ngày, hoặc bỏ bớt bữa, có thể có tác dụng tương tự như ăn theo khung giờ, giúp cơ thể có thời gian nhịn ăn lâu hơn.</p><p>Ăn nhiều calo vào đầu ngày</p><p>Lựa chọn ăn nhiều calo vào đầu ngày có thể là một chiến lược giảm cân hiệu quả vì đó là lúc hệ tiêu hóa hoạt động hiệu quả nhất trong việc xử lý thức ăn, đặc biệt là đường, và sử dụng nó làm nhiên liệu thay vì dự trữ.</p><p style=\"text-align:right;\"><strong>Mỹ Ý (Theo Newsweek)</strong></p>','trankhangctu@gmail.com','minhkhang',NULL,'Cách ăn giúp giảm cân hiệu quả','https://vnexpress.net/cach-an-giup-giam-can-hieu-qua-4812013.html','\"Một nghiên cứu mới cho thấy 3 chiến lược ăn uống hiệu quả để giảm cân bao gồm: ăn theo khung giờ, giảm số bữa ăn và nạp nhiều calo vào đầu ngày. Nghiên cứu này phân tích dữ liệu từ 29 thử nghiệm lâm sàng trước đó và nhận thấy cả 3 phương pháp đều giúp giảm cân đáng kể, chỉ bằng cách thay đổi thời gian ăn chứ không phải thành phần dinh dưỡng. Ăn theo khung giờ giới hạn thời gian ăn trong ngày, giảm số bữa ăn giúp cơ thể có thời gian nhịn ăn lâu hơn, và ăn nhiều calo vào đầu ngày tận dụng khả năng tiêu hóa hiệu quả nhất của cơ thể. \"','https://i1-suckhoe.vnecdn.net/2024/11/04/pexels-ella-olsson-572949-1640-7970-7638-1730713132.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=XjxkX_jYYg4OlIAP3W-Jhg','Cách ăn giúp giảm cân hiệu quả','admin',NULL,NULL),(_binary '',NULL,'2024-11-10 23:09:55.597418',41,3,'2024-12-07 07:08:48.243258',10,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1732288366/news-41.mp3.mp3','<p>Nhiều người thường tỉnh giấc lúc 3 giờ sáng, nếu tâm lý không tốt có thể khó ngủ lại và nguyên nhân là do chu kỳ giấc ngủ gây ra hiện tượng này.</p><figure class=\"image\"><img style=\"aspect-ratio:680/409;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/10/chat-luong-giac-ngu-9190-1731233726.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=cIWSPr-fg-PJgkzViBnMxQ\" alt=\"Nhiều người thường thức giấc lúc 3h sáng và khó ngủ lại. Ảnh: Marcos Mesa Sam Wordley/Shutterstock\" width=\"680\" height=\"409\"></figure><p><span style=\"font-size:12px;\"><i>Nhiều người thường thức giấc lúc 3h sáng và khó ngủ lại. Ảnh: Marcos Mesa Sam Wordley/Shutterstock</i></span></p><p>Trong suốt một đêm, con người đều trải qua một vài chu kỳ giấc ngủ. Mỗi chu kỳ bắt đầu bằng giấc ngủ nhẹ, sau đó chuyển sang giấc ngủ sâu hơn khi chúng ta bước vào giấc ngủ sóng chậm. Tiếp theo giai đoạn hoạt động mạnh hơn được gọi là giấc ngủ mắt chuyển động nhanh (REM), sau đó rất có thể sẽ thức dậy trước khi ngủ lại.</p><p>Toàn bộ quá trình này mất khoảng 4 tiếng, có nghĩa là nếu bạn thường đi ngủ vào khoảng 11 giờ tối, bạn sẽ thấy mình tỉnh táo trở lại vào khoảng 3 giờ sáng. Để không bị gián đoạn giấc ngủ và hoàn toàn tỉnh táo trở lại, cách tốt nhất là không để mình rơi vào vòng xoáy suy nghĩ tiêu cực.</p><p>Các nghiên cứu cho thấy con người có xu hướng ít lý trí hơn trong những suy nghĩ về đêm so với ban ngày, đó là lý do tại sao các vấn đề luôn có vẻ khó khăn hơn nhiều vào lúc 3 giờ sáng.</p><p>Giáo sư Greg Murray, Giám đốc Trung tâm Sức khỏe Tâm thần tại Đại học Công nghệ Swinburne, Australia, trong bài viết năm 2021 trên The Conversation, cho rằng thức giấc lúc 3h sáng không phải là một thói quen tốt nên duy trì.</p><p>Theo các chuyên gia về giấc ngủ, nguyên nhân là do những suy nghĩ miên man vào sáng sớm có liên quan đến căng thẳng, mặc dù không hoàn toàn trực tiếp. Ông Murray giải thích, căng thẳng không khiến chúng ta thức giấc nhiều hơn vào ban đêm, nhưng nó khiến chúng ta nhận thức rõ hơn về việc đó.</p><p>Theo Colin Espie, giáo sư y học giấc ngủ tại Khoa Khoa học Thần kinh Lâm sàng Nuffield tại Đại học Oxford, khi mọi người thức dậy vào ban đêm, điều hiện lên trong đầu họ thường là điều gì đó đã xảy ra vào ngày hôm trước hoặc điều gì đó sẽ xảy ra vào ngày hôm sau. Do đó \"việc lập danh sách việc cần làm có thể khiến não bộ chủ động xử lý mọi việc mà không đánh thức bạn dậy\", ông nói.</p><p>Theo Nature Neuroscience, những giấc ngủ quá ngắn và không sâu khiến một loại protein gây mất trí nhớ (beta amyloid protein) tích tụ trong não. Dần dần beta-amyloid protein với hàm lượng cao sẽ gây rối loạn giấc ngủ. Như vậy mất ngủ không chỉ ảnh hưởng tới trí nhớ của bạn vào ngày hôm sau mà còn làm tăng nguy cơ mắc bệnh Alzheimer.</p><p>Các nghiên cứu trước đây cũng cho thấy giấc ngủ sâu sẽ lọc sạch beta amyloid trong não bộ. Thiếu ngủ sẽ ngăn chặn quá trình thanh lọc chất này khiến trí nhớ ngày càng tệ đi. Vì vậy các nhà nghiên cứu khuyến cáo cần lên kế hoạch công việc, chế độ dinh dưỡng, tập thể dục... để giấc ngủ không bị gián đoạn.</p><p style=\"text-align:right;\"><strong>Bảo Anh (Tổng hợp)</strong></p>','trankhangctu@gmail.com','tranminhkhang',NULL,'Lý do nhiều người thức giấc lúc 3 giờ sáng','https://vnexpress.net/ly-do-nhieu-nguoi-thuc-giac-luc-3-gio-sang-4814370.html','\"Nhiều người tỉnh giấc lúc 3 giờ sáng do chu kỳ giấc ngủ tự nhiên.  Chu kỳ này gồm giấc ngủ nhẹ, sâu và REM, lặp lại khoảng 4 tiếng một lần.  Thức giấc lúc 3 giờ sáng thường liên quan đến suy nghĩ tiêu cực và căng thẳng.  Suy nghĩ đêm thường thiếu lý trí, khiến vấn đề trở nên trầm trọng hơn.  Căng thẳng không gây thức giấc nhiều hơn, nhưng khiến ta nhận thức rõ hơn việc thức giấc.  Những suy nghĩ miên man thường về ngày hôm trước hoặc hôm sau.  Lập danh sách việc cần làm có thể giúp xử lý công việc trong đầu mà không đánh thức người ta.  Ngủ không đủ giấc làm tăng tích tụ beta amyloid, gây hại cho trí nhớ và tăng nguy cơ Alzheimer.  Giấc ngủ sâu giúp loại bỏ beta amyloid.  Lên kế hoạch công việc, dinh dưỡng, và vận động giúp cải thiện giấc ngủ.\"','https://i1-vnexpress.vnecdn.net/2024/11/10/chat-luong-giac-ngu-9190-1731233726.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=ZHRLnxrCdg6evWarkjCrWg','Lý do nhiều người thức giấc lúc 3 giờ sáng','admin',NULL,'2024-11-22 22:12:23.007537'),(_binary '',NULL,'2024-11-10 23:12:21.140781',42,2,'2024-11-23 09:13:44.443969',20,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1732288361/news-42.mp3.mp3','<p>Bỏ quy định phải ký quỹ 100% trước khi mua cổ phiếu từ tuần này nhưng nhà đầu tư nước ngoài vẫn bán ròng gần 3.500 tỷ đồng.</p><p>Thống kê của Sở Giao dịch chứng khoán TP HCM (HoSE) cho thấy trong tuần 4-8/11, nhà đầu tư nước ngoài đã mua vào gần 5.712 tỷ đồng và bán ra khoảng 9.182 tỷ đồng. Chênh lệch giữa chiều mua và bán âm khoảng 3.469 tỷ đồng. Suốt tuần qua, khối ngoại bán ròng liên tục và đã là tuần thứ 7 liên tiếp. Họ tập trung xả hàng ở nhóm cổ phiếu vốn hóa lớn như MSN hay VHM.</p><p>Khối ngoại duy trì xu hướng rút vốn dù đây là tuần đầu tiên Thông tư số 68/2024 của Bộ Tài chính có hiệu lực. Thông tư này quy định nhà đầu tư nước ngoài mua cổ phiếu không cần có đủ tiền (non pre-funding) khi đặt lệnh như trước đây.</p><p>Theo Chứng khoán Kiến Thiết Việt Nam (CSI), khối ngoại bán ròng trong bối cảnh áp lực tỷ giá tăng cao ở tuần Tổng thống Donald Trump tái đắc cử - nguyên nhân giúp đồng USD lên cao.</p><p>Nhìn lại từ đầu năm đến nay, nhà đầu tư nước ngoài chỉ ưu tiên gom hàng duy nhất trong tháng 1. Còn lại, họ đã bán ròng liên tiếp từ tháng 2 tới nay với giá trị lũy kế gần 80.000 tỷ đồng, tức khoảng 3 tỷ USD. Xu hướng rút vốn hạ nhiệt trong tháng 8-9 nhưng đã tăng trở lại trong tháng 10.</p><p>Tại diễn đàn đầu tư mới đây, ông Lê Anh Tuấn - Giám đốc Đầu tư Dragon Capital - nói có ba nguyên nhân dẫn đến tình trạng nhà đầu tư nước ngoài rút vốn, không chỉ ở năm nay mà đã 3-4 năm qua. Thứ nhất, Việt Nam vẫn là thị trường cận biên. Theo chuyên gia, nếu kéo dài tình trạng này, các quỹ đầu tư bị động sẽ sớm rời đi.</p><p>Thứ hai, tỷ lệ chiết khấu về định giá của thị trường cận biên hiện tại so với thị trường Mỹ khoảng 31-35%, so với mức bình quân trong quá khứ khoảng 25%. Điều này có nghĩa nhà đầu tư đang thích thị trường Mỹ hơn, khiến dòng vốn có xu hướng rút ra.</p><p>Ông Tuấn cũng đề cập đến việc nhà đầu tư nước ngoài dán nhãn thị trường chứng khoán Việt Nam giống Trung Quốc, mà những thị trường giống Trung Quốc có mức rút vốn rất mạnh trong giai đoạn 3-5 năm vừa qua. Chuyên gia cho rằng cần thêm thời gian để khối ngoại thay đổi quan điểm này.</p><figure class=\"image\"><img style=\"aspect-ratio:680/453;\" src=\"https://i1-kinhdoanh.vnecdn.net/2024/11/09/chungkhoan-15-JPG-1592-1731125266.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=vz6NH13fg9ONX8QojvdHgw\" alt=\"Nhà đầu tư quan sát bảng giá tại một công ty chứng khoán ở quận 1 (TP HCM), tháng 10/2024. Ảnh: An Khương\" width=\"680\" height=\"453\"></figure><p><span style=\"font-size:12px;\"><i>Nhà đầu tư quan sát bảng giá tại một công ty chứng khoán ở quận 1 (TP HCM), tháng 10/2024. Ảnh: An Khương</i></span></p><p>Trong bối cảnh đà bán ròng của khối ngoại tại hàng loạt cổ phiếu vốn hóa lớn đi kèm áp lực cung vẫn khá chủ động, Chứng khoán Rồng Việt (VDSC) khuyến nghị nhà đầu tư tạm thời vẫn cần thận trọng và chờ tín hiệu cung cầu rõ nét hơn của VN-Index trong vùng thăm dò 1.250-1.260 điểm. Tín hiệu cung cầu này sẽ có tác động đến bước đi tiếp theo của thị trường.</p><p>\"Nhà đầu tư cần chậm lại và quan sát để đánh giá trạng thái của thị trường. Hiện tại, độ ổn định thấp và rủi ro tiềm ẩn nên cần cân nhắc quản trị danh mục hợp lý, tránh rơi vào trạng thái quá mua\", VDSC đưa ra lời khuyên.</p><p>Dự báo trong ngắn hạn, nhóm phân tích CSI nhận thấy tín hiệu tích cực từ việc Cục Dự trữ liên bang Mỹ (Fed) vừa hạ lãi suất thêm 0,25%. Đây là đợt cắt giảm thứ hai liên tiếp của chu kỳ nới lỏng. Do đó, họ dự đoán áp lực tỷ giá phần nào khó tăng mạnh trong các tuần tới và kỳ vọng điều này sẽ giúp khối ngoại giảm tốc độ bán ròng.</p><p>Tuy chưa tạo ra bước ngoặt tức thời, việc bỏ quy định bắt buộc ký quỹ với nhà đầu tư nước ngoài được các bên đánh giá tích cực, tạo tiền đề cho chứng khoán Việt Nam được nâng hạng. Trong buổi làm việc mới đây với Ủy ban Chứng khoán (SSC), ông Young Lee - Giám đốc Điều hành hoạt động kinh doanh cổ phiếu khu vực châu Á của Morgan Stanley - cho rằng những quy định mới tại Thông tư số 68/2024 đã giúp thị trường Việt Nam phù hợp hơn với các yêu cầu bắt buộc của FTSE Russell.</p><p>Đại diện Morgan Stanley cho rằng chứng khoán Việt Nam khi nâng hạng lên thị trường mới nổi có thể giúp thu hút 800 triệu USD từ các nhà đầu tư thụ động sử dụng bộ chỉ số FTSE và 2 tỷ USD từ các nhà đầu tư thụ động sử dụng bộ chỉ số khác. Đồng thời, khi thị trường nâng hạng, các quỹ chủ động sẽ tham gia tích cực hơn và dự kiến sẽ có khoảng 4-6 tỷ USD vào Việt Nam.</p><p style=\"text-align:right;\"><strong>Tất Đạt</strong></p>','trankhangctu@gmail.com','anonymousUser',NULL,'Khối ngoại bán ròng gần 3.500 tỷ đồng trong tuần đầu giao dịch không ký quỹ','https://vnexpress.net/khoi-ngoai-ban-rong-gan-3-500-ty-dong-trong-tuan-dau-giao-dich-khong-ky-quy-4814061.html','\"Tuần qua, nhà đầu tư nước ngoài bán ròng gần 3.500 tỷ đồng, là tuần thứ 7 liên tiếp.  Mặc dù Thông tư 68/2024 bỏ quy định ký quỹ 100%, xu hướng rút vốn vẫn tiếp diễn.  Khối ngoại tập trung bán cổ phiếu vốn hóa lớn.  Từ đầu năm, khối ngoại bán ròng gần 80.000 tỷ đồng.  Ba nguyên nhân chính được đưa ra là: Việt Nam là thị trường cận biên, định giá chênh lệch so với thị trường Mỹ, và thị trường bị đánh đồng với Trung Quốc.  Các chuyên gia khuyến nghị nhà đầu tư thận trọng, chờ tín hiệu rõ ràng hơn.  Việc bỏ quy định ký quỹ được đánh giá tích cực, tạo điều kiện nâng hạng thị trường, thu hút thêm vốn đầu tư.  Giảm lãi suất của Fed có thể giúp giảm tốc độ bán ròng của khối ngoại.\"','https://i1-kinhdoanh.vnecdn.net/2024/11/09/chungkhoan-15-JPG-1592-1731125266.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=VL-eCTEcwZyGxfHwOR3fKg','Khối ngoại bán ròng gần 3.500 tỷ đồng trong tuần đầu giao dịch không ký quỹ','admin',NULL,'2024-11-22 22:12:04.390103'),(_binary '',NULL,'2024-11-13 17:41:32.815060',43,6,'2024-12-06 21:22:32.828653',18,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1732290876/news-43.mp3.mp3','<p>Tỷ lệ lấp đầy gần 100%, không có nguồn cung mới trong khi nhu cầu thuê cao khiến mặt bằng bán lẻ ở trung tâm TP HCM ngày càng khan hiếm.</p><p>Ghi nhận của VnExpress cho thấy hầu hết trung tâm thương mại lâu năm trên địa bàn quận 1 như Saigon Center, Parkson Lê Thánh Tôn, Vincom, Diamond Plaza... đều trong trạng thái lấp đầy gần 100% khách thuê. Một số nơi còn vài chỗ trống thì có diện tích thuê nhỏ, vị trí tầng hầm hay khu vực tầng cao.</p><p>Đại diện một thương hiệu F&amp;B nổi tiếng tại TP HCM cho biết có kế hoạch mở thêm một cửa hàng tại trung tâm thương mại trên đường Đồng Khởi và mở rộng diện tích thuê tại một địa điểm trên đường Lê Lợi. Tuy nhiên, cả hai nơi này đều không đáp ứng yêu cầu về diện tích thuê.</p><p>\"Chúng tôi cần mở rộng không gian kinh doanh nhưng đang gặp khó với các dự án ở trung tâm quận 1\", đại diện doanh nghiệp cho hay.</p><p>Tương tự, một thương hiệu cà phê lớn mới đây cũng phải thay đổi kế hoạch kinh doanh vì không tìm được mặt bằng thuê phù hợp. \"Các trung tâm thương mại ở khu vực đắc địa hiện rất khó tìm mặt bằng. Chúng tôi cần thuê nơi rộng rãi nhưng phần lớn đều kín chỗ\", đại diện chuỗi cà phê nói.</p><figure class=\"image\"><img style=\"aspect-ratio:680/453;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/04/IMG-8266-2817-1730710086.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=HQBgQLgb5WAMv4I3u7jx8g\" alt=\"Trung tâm thương mại Diamond Plaza quận 1, TP HCM. Ảnh: Phong Anh\" width=\"680\" height=\"453\"></figure><p><span style=\"font-size:12px;\"><i>Trung tâm thương mại Diamond Plaza quận 1, TP HCM. Ảnh: Phong Anh</i></span></p><p>Báo cáo thị trường mới đây của Công ty tư vấn bất động sản Avison Young Việt Nam cũng cho thấy khối đế bán lẻ tại các khách sạn lớn ở quận 1 như Rex Arcade, MPlaza Saigon, Times Square, Terra Royal... đang có tỷ lệ lấp đầy là 100%, không còn mặt bằng trống. Tình trạng tương tự cũng diễn ra với các trung tâm thương mại cao cấp như Diamond Plaza, Saigon Center, Vincom Center Đồng Khởi...</p><p>Theo đơn vị này, tổng nguồn cung bán lẻ của TP HCM đến hết quý III đạt gần 1,5 triệu m2, trong đó 75% ở khu vực ngoại thành. Khu trung tâm (quận 1) không có nguồn cung mới.</p><p>Số liệu của Công ty nghiên cứu thị trường CBRE cũng chỉ ra ba năm qua, khu CBD TP HCM (khu trung tâm hành chính, thương mại) không có dự án bán lẻ mới nào triển khai. Tính đến tháng 10, tổng diện tích bán lẻ của thành phố vào khoảng 1,2 triệu m2, trong đó khu trung tâm chiếm chưa đến 10% nguồn cung.</p><p>Ít chịu sự cạnh tranh về nguồn cung trong khi danh sách khách chờ thuê từ nhóm \"hàng hiệu\" lại khá đông, điều này khiến các chủ đầu tư dự án bán lẻ khu vực trung tâm thành phố luôn tự tin neo giá cao.</p><p>Theo Avison Young, quý vừa qua, giá thuê mặt bằng bán lẻ trung tâm quận 1 khoảng 275-300 USD mỗi m2 một tháng (tương đương 7 triệu đồng mỗi m2). Còn số liệu của Savills cho rằng giá chào thuê trung bình tại tầng trệt của trung tâm thương mại trọng điểm khu quận 1, quận 3 đang ở mức 230 USD mỗi m2 một tháng, tăng 2,7% so với cùng kỳ năm trước.</p><p>Đánh giá về sức hút của các trung tâm thương mại, ông David Jackson, Tổng giám đốc Avison Young Việt Nam, cho biết các nơi này luôn là điểm đến được lựa chọn đầu tiên của nhiều nhãn hàng danh tiếng khi đặt chân vào thị trường TP HCM. Sự cạnh tranh giữa các thương hiệu để có được không gian tại khu vực trung tâm rất khốc liệt, hầu như đều phải đăng ký khá lâu để có chỗ thuê.</p><p>Ông David Jackson dẫn chứng, mới đây thương hiệu thời trang, mỹ phẩm cao cấp là Longchamp, Lush và thương hiệu đồ chơi Popmart đều cùng chọn một trung tâm thương mại ở quận 1 để mở cửa hàng đầu tiên dù nhận được nhiều lời mời hấp dẫn hơn tại các dự án ngoại thành.</p><p>Đồng quan điểm, bà Võ Thị Phương Mai, Trưởng phòng dịch vụ mặt bằng bán lẻ CBRE Việt Nam, nhận định khu CBD nói riêng và TP HCM nói chung đều thiếu hụt nghiêm trọng nguồn cung bán lẻ. Nhiều năm qua, thành phố hầu như không có dự án mới và chỉ cải thiện phần nào trong năm nay.</p><p>Riêng khu vực quận 1 không có dự án mới nào. Quỹ đất để phát triển dự án ở đây cũng đã cạn dần nên tình trạng khan hiếm sẽ còn tiếp diễn. Sắp tới chỉ có 1-2 khối đế đưa vào vận hành và phần lớn đều đã có khách đặt thuê trước. Vì vậy sẽ ngày càng khó tìm thuê một mặt bằng bán lẻ tại khu vực quận 1, ngay cả các khu lân cận như trung tâm quận 7, quận 3 cũng không còn dễ kiếm.</p><p>Mặc dù thị trường bán lẻ trung tâm TP HCM đang được hưởng lợi từ nguồn cung khan hiếm, bà Võ Thị Phương Mai nhìn nhận việc thiếu dự án mới đang khiến các mặt bằng bán lẻ này có tính trải nghiệm kém hơn so với những dự án mới triển khai. Nhiều thương hiệu lớn về mảng thời trang, ẩm thực, phong cách sống đang bắt đầu dịch chuyển dần ra các dự án ở vùng ngoại thành, nơi đáp ứng được yêu cầu về mặt bằng thuê diện tích lớn nhằm tăng tính trải nghiệm cho khách hàng.</p><p>Dự báo về giá thuê bất động sản bán lẻ thời gian tới, bà Mai cho rằng vẫn khó giảm vì nguồn cung không có sự cải thiện trong khi các thương hiệu lớn có kế hoạch tham gia vào thị trường Việt Nam vẫn muốn giữ chỗ ở những nơi đắc địa. Dẫu vậy, theo bà, mức giá không tăng quá nhiều do thị trường đã ở ngưỡng bão hòa và ngành bán lẻ đang đối mặt với nhiều thách thức.</p><p style=\"text-align:right;\"><strong>Phương Uyên</strong></p>','tranminhkhang8888@gmail.com','khang2002',NULL,'Mặt bằng bán lẻ trung tâm TP HCM giá cao vẫn kín chỗ','https://vnexpress.net/mat-bang-ban-le-trung-tam-tp-hcm-gia-cao-van-kin-cho-4811975.html','\"Mặt bằng bán lẻ trung tâm TP.HCM cực kỳ khan hiếm do tỷ lệ lấp đầy gần 100%.  Quận 1, đặc biệt các trung tâm thương mại lớn như Saigon Center, Diamond Plaza, gần như kín chỗ.  Nhiều thương hiệu F&B, cà phê lớn gặp khó khăn tìm mặt bằng phù hợp, thậm chí phải thay đổi kế hoạch.  Không có nguồn cung mới trong ba năm qua, quỹ đất hạn chế.  Giá thuê cao ngất ngưởng, khoảng 275-300 USD/m²/tháng.  Thậm chí các khu vực lân cận như quận 3, quận 7 cũng khó tìm được mặt bằng.  Thiếu nguồn cung mới khiến trải nghiệm mua sắm kém hơn, một số thương hiệu lớn chuyển hướng ra ngoại thành.  Dự báo giá thuê khó giảm do nguồn cung vẫn khan hiếm.\"','https://i1-vnexpress.vnecdn.net/2024/11/04/IMG-8266-2817-1730710086.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=HQBgQLgb5WAMv4I3u7jx8g','Mặt bằng bán lẻ trung tâm TP HCM giá cao vẫn kín chỗ',NULL,'manage-bat-dong-san','2024-11-22 22:53:40.869629'),(_binary '',NULL,'2024-11-13 17:43:44.481887',44,3,'2024-12-06 22:20:46.079743',5,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733494253/news-44.mp3.mp3','<p>Hồng thạch mini Trung Quốc (24-26 trái một kg) có màu đỏ bắt mắt đang hút khách Việt dù giá cao cấp đôi hàng nội địa.</p><p>Lần đầu nhập về khoảng 100 kg hồng mini Trung Quốc, chị Nguyễn Thị Hồng ở Cầu Giấy, Hà Nội, cho biết toàn bộ số hàng đã bán hết trong ngày. Loại này mỗi ký khoảng 24-26 trái, khi chín quả dẻo như thạch, vị ngọt đậm và thơm. Giá bán dao động 80.000-100.000 đồng một kg.</p><p>Tại TP HCM, loại hồng này cũng được bày bán ở các chợ truyền thống và trên mạng xã hội, với giá từ 100.000-120.000 đồng một kg, cao gấp 2-3 lần hồng trứng của Việt Nam.</p><figure class=\"image\"><img style=\"aspect-ratio:680/438;\" src=\"https://i1-kinhdoanh.vnecdn.net/2024/11/09/hong-1731139561-7065-1731140557.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=kAPdg5tXvO-xhFVh3D-byA\" alt=\"Hồng thạch trân trâu Trung Quốc được đựng trong các rành nhựa. Ảnh: Hồng Châu\" width=\"680\" height=\"438\"></figure><p><span style=\"font-size:12px;\"><i>Hồng thạch trân trâu Trung Quốc được đựng trong các rành nhựa. Ảnh: Hồng Châu</i></span></p><p>Mặc dù giá cao, hồng thạch mini vẫn được nhiều người ưa chuộng. Theo chị Hồng Nga, một thương lái nhập khẩu tại cửa khẩu quốc tế Lào Cai, ban đầu chị nhập thử 5 tấn, thấy sức tiêu thụ tốt nên ngày càng nhập nhiều hơn. Ngoài Hà Nội và Lào Cai, chị phân phối hàng tới TP HCM và Đà Nẵng.</p><p>Hồng thường được đóng trong thùng hoặc rành 12 kg, với giá khoảng 360.000 đồng (tương đương 30.000 đồng một kg) tại cửa khẩu Lào Cai. Khách sỉ phải mua ít nhất 2 rành hồng và chịu phí vận chuyển.</p><figure class=\"image\"><img style=\"aspect-ratio:680/408;\" src=\"https://i1-kinhdoanh.vnecdn.net/2024/11/09/hong2-1731139712-2223-1731140557.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=vVzyBL0e5bvY1qupuQaIjw\" alt=\"Hồng thạch Trung Quốc mỗi kg khoảng 24-26 quả. Ảnh: Nhân vật cung cấp\" width=\"680\" height=\"408\"></figure><p><span style=\"font-size:12px;\"><i>Hồng thạch Trung Quốc mỗi kg khoảng 24-26 quả. Ảnh: Nhân vật cung cấp</i></span></p><p>Tại Trung Quốc, loại quả này thường được trồng ở các vùng có khí hậu lạnh, đặc biệt là tỉnh Sơn Đông và Thiểm Tây, có giá bán khoảng 10-15 nhân dân tệ (35.000-55.000 đồng) một kg.</p><p>Trước đây, hồng thạch trân châu chủ yếu tiêu thụ tại Trung Quốc do dễ hư hỏng khi vận chuyển. Tuy nhiên, nhờ các cải tiến trong bảo quản và đóng gói, sản phẩm này đã xuất khẩu sang nhiều nước như Việt Nam, Hàn Quốc và Nhật Bản.</p><p>Lãnh đạo chợ đầu mối nông sản Thủ Đức cho hay hồng Trung Quốc nhập về chợ thường là loại giòn; riêng hồng thạch trân châu chủ yếu nhập qua Lào Cai và bán trực tiếp cho các đầu mối hoặc người tiêu dùng. \"Đây là mặt hàng mới, lần đầu xuất hiện tại Việt Nam nên người tiêu dùng chọn sản phẩm có tem truy xuất nguồn gốc và từ nhà cung cấp uy tín để đảm bảo chất lượng\", ông khuyến cáo.</p><p>Hiệp hội Rau quả Việt Nam cũng cho rằng cần tăng cường việc kiểm tra chất lượng nhập khẩu, đồng thời giám sát chặt chẽ tại các đường mòn, lối mở để ngăn hàng kém chất lượng xâm nhập thị trường.</p><p>Trong 9 tháng đầu năm, Việt Nam đã chi 700 triệu USD để nhập khẩu rau quả từ Trung Quốc, tăng 39% so với cùng kỳ năm ngoái, với các mặt hàng phổ biến gồm nho, táo, hồng và hành tỏi.</p><p style=\"text-align:right;\"><strong>Hồng Châu</strong></p>','tranminhkhang8888@gmail.com','minhkhang6',NULL,'Hồng thạch trân châu Trung Quốc hút khách Việt','https://vnexpress.net/hong-thach-tran-chau-trung-quoc-hut-khach-viet-4814123.html','\"Hồng thạch mini Trung Quốc (24-26 quả/kg), vị ngọt đậm, dẻo như thạch, đang bán chạy tại Việt Nam dù giá cao (80.000-120.000đ/kg), gấp 2-3 lần hồng nội địa.  Hàng nhập khẩu chủ yếu từ Sơn Đông và Thiểm Tây, Trung Quốc.  Lượng tiêu thụ lớn, các thương lái nhập khẩu với số lượng ngày càng nhiều.  Giá tại cửa khẩu Lào Cai thấp hơn, khoảng 30.000đ/kg.  Người tiêu dùng nên chọn hàng có nguồn gốc rõ ràng.  Việt Nam nhập khẩu nhiều rau quả từ Trung Quốc, trong đó có hồng.  Cần kiểm soát chất lượng nhập khẩu để ngăn ngừa hàng kém chất lượng.  Hồng thạch dễ hư hỏng nên việc bảo quản và vận chuyển được cải thiện.\"','https://i1-kinhdoanh.vnecdn.net/2024/11/09/hong2-1731139712-2223-1731140557.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=vVzyBL0e5bvY1qupuQaIjw','Hồng thạch trân châu Trung Quốc hút khách Việt',NULL,'manage-kinh-doanh','2024-12-06 21:10:15.708055'),(_binary '',NULL,'2024-11-13 17:47:27.182659',45,3,'2024-12-06 22:24:25.211558',5,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733494876/news-45.mp3.mp3','<p>Với nghiên cứu đăng trên tạp chí Q1 cùng điểm học tập xuất sắc, Phúc Tiên giành giải thưởng Nữ sinh khoa học công nghệ 2024.</p><p>Nguyễn Ngọc Phúc Tiên, sinh viên năm thứ ba khoa Kỹ thuật điện, Viện Kỹ thuật và Khoa học Máy tính của Đại học VinUni, là một trong 20 nữ sinh giành giải thưởng này của Trung ương Đoàn.</p><p>\"Em tự hào khi là người đầu tiên của trường được giải\", Tiên, 21 tuổi, nói.</p><figure class=\"image\"><img style=\"aspect-ratio:680/445;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/12/tien1-1824-1731407612.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=haC1eoXhQp7nomxUOcxQJQ\" alt=\"Nguyễn Ngọc Phúc Tiên nhận giải thưởng Presidents List dành cho sinh viên xuất sắc năm 2023. Ảnh: Nhân vật cung cấp\" width=\"680\" height=\"445\"></figure><p><span style=\"font-size:12px;\"><i>Nguyễn Ngọc Phúc Tiên nhận giải thưởng President\'s list dành cho sinh viên xuất sắc, năm 2023. Ảnh: Nhân vật cung cấp</i></span></p><p>Nữ sinh kể ngày nhỏ thích những bộ phim về phát minh, khoa học viễn tưởng và vũ trụ. Niềm yêu thích đó lớn dần khiến em say mê học và đỗ vào chuyên Lý, trường THPT chuyên Trần Văn Giàu, Long An. Thời phổ thông, nữ sinh từng giành giải nhì học sinh giỏi tỉnh, huy chương bạc kỳ thi Olympic truyền thống 30/4...</p><p>Tiên sau đó trúng tuyển ngành Kỹ thuật máy tính của Đại học Bách khoa TP HCM. Hết năm đầu, nữ sinh chuyển sang Đại học VinUni với học bổng 90%.</p><p>Xác định theo đuổi con đường nghiên cứu nên ngay khi mới vào trường, Tiên xin vào phòng thí nghiệm của TS Trần Thị Mai, giảng viên Vật lý của Viện Kỹ thuật và Khoa học máy tính. Ban đầu, em phụ dọn dẹp, cân hóa chất, chủ yếu quan sát thầy cô và anh, chị khóa trên do chưa có kiến thức và kinh nghiệm.</p><p>Để tăng thêm hiểu biết về ngành, em chịu khó đọc sách, báo, công bố quốc tế và xem bài giảng miễn phí của các giáo sư nước ngoài trên mạng. Dần dần, Tiên trở thành trợ lý cho các dự án của phòng thí nghiệm.</p><p>Vào học kỳ II, em được TS Mai giao nghiên cứu chế tạo các cảm biến trở kháng nhanh, dùng một lần, dựa trên vật liệu nano lai mới MoS₂ để phát hiện DNA của Escherichia coli. Đề tài này Tiên làm một mình, dưới sự hướng dẫn của cô Mai và một thầy giáo ở trường Đại học Bách khoa TP HCM.</p><p>Nữ sinh cho biết khó nhất là phần vật liệu và xử lý tín hiệu. Nhiều lần sai do thiếu kinh nghiệm, Tiên phải làm đi làm lại thí nghiệm suốt ba tháng.</p><p>\"Em rất căng thẳng nhưng cô Mai luôn động viên em đừng bỏ cuộc\", Tiên nhớ lại. \"Em báo cáo tiến độ hàng tuần và nếu sai, cô luôn cho cơ hội làm lại\".</p><p>TS Mai cho hay học trò có các tố chất của một nhà nghiên cứu. Ngoài năng lực, động lực, Tiên dám theo đuổi và kiên trì với mục tiêu. Dù ban đầu kiến thức về khoa học vật liệu và sinh học còn hạn chế, Tiên chưa từng lung lay.</p><p>\"Em ấy đã dành nhiều thời gian để đọc tài liệu chuyên sâu và lặp lại các thí nghiệm một cách tỉ mỉ\", cô Mai nói. Cô cũng bất ngờ với kỹ năng viết, phân tích và tư duy logic của Tiên.</p><figure class=\"image\"><img style=\"aspect-ratio:680/423;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/12/tien2-3823-1731407612.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=McnzhufQQrZFCzgPoUO8nA\" alt=\"Tiên nhận giải poster thuyết trình nghiên cứu xuất sắc tại hội thảo quốc tế về vật liệu ở Quảng Bình mới đây. Ảnh: Nhân vật cung cấp\" width=\"680\" height=\"423\"></figure><p><span style=\"font-size:12px;\"><i>Tiên nhận giải poster thuyết trình nghiên cứu xuất sắc tại hội thảo quốc tế về vật liệu ở Quảng Bình. Ảnh: Nhân vật cung cấp</i></span></p><p>Cuối cùng, kết quả nghiên cứu của Tiên được đăng trên tạp chí Plos One hồi tháng 2. Đây là tạp chí Q1 - nhóm 25% tạp chí tốt nhất trong một lĩnh vực.</p><p>Theo cô Mai, việc phát hiện nhanh chóng và chính xác vi khuẩn gây bệnh rất quan trọng trong kiểm soát an toàn thực phẩm. Các kỹ thuật phát hiện truyền thống, như khuếch đại dựa trên trình tự axit nucleic và phản ứng chuỗi polymerase, mất nhiều thời gian, đòi hỏi thiết bị chuyên dụng cùng nhân viên được đào tạo.</p><p>Nghiên cứu của Tiên đã chế tạo được một cảm biến đơn giản, giá thành thấp, mang đến một hướng đi hứa hẹn để phát hiện DNA (phân tử mang thông tin di truyền) hiệu quả và chính xác. Kết quả nghiên cứu cũng có tiềm năng ứng dụng rộng rãi trong công nghệ sinh học và chẩn đoán y khoa.</p><p>Việc có bài báo quốc tế khi mới học năm thứ hai là động lực để Tiên đăng ký giải thưởng Nữ sinh khoa học công nghệ.</p><p>Ngoài nghiên cứu, Tiên hai năm liên tiếp giành giải President\'s list cho sinh viên xuất sắc của trường. Ở năm thứ hai, em là người duy nhất được học bổng hiệu trưởng, trị giá 60 triệu đồng. Tiên cũng đạt giải nhất nghiên cứu khoa học cấp trường, huy chương đồng một cuộc thi Vật lý sinh viên quốc tế...</p><p>Để học và nghiên cứu hiệu quả, Tiên thường chọn ưu tiên công việc quan trọng ở từng thời điểm. Vào những đợt thi bận rộn, em xin nghỉ ở phòng thí nghiệm để tập trung cho bài vở.</p><p>Nữ sinh dự kiến du học thạc sĩ về Khoa học vật liệu sau khi tốt nghiệp đại học, theo đuổi con đường trở thành nhà nghiên cứu.</p><p style=\"text-align:right;\"><strong>Bình Minh</strong></p>','trankhangctu@gmail.com','anonymousUser',NULL,'Từ nữ sinh chuyên Lý đến giải thưởng khoa học công nghệ','https://vnexpress.net/tu-nu-sinh-chuyen-ly-den-giai-thuong-khoa-hoc-cong-nghe-4814649.html','\"Phúc Tiên, sinh viên năm thứ ba Đại học VinUni, đạt giải thưởng Nữ sinh khoa học công nghệ 2024 nhờ nghiên cứu đăng trên tạp chí Q1.  Cô  có thành tích học tập xuất sắc, liên tiếp đạt giải President\'s list.  Nghiên cứu của Tiên tập trung vào chế tạo cảm biến phát hiện DNA vi khuẩn nhanh, chính xác và giá rẻ.  Quá trình nghiên cứu gặp nhiều khó khăn nhưng Tiên kiên trì, được sự hướng dẫn tận tình của TS Mai.  Bài báo công bố trên tạp chí Plos One (Q1) có tiềm năng ứng dụng rộng rãi.  Tiên đam mê khoa học từ nhỏ, từng đạt nhiều giải thưởng học sinh giỏi. Cô dự định du học sau khi tốt nghiệp để theo đuổi sự nghiệp nghiên cứu.  Tiên là sinh viên đầu tiên của VinUni đạt giải thưởng này.  Thành công của Tiên là sự kết hợp giữa năng lực, sự nỗ lực và niềm đam mê.\"','https://i1-vnexpress.vnecdn.net/2024/11/12/tien1-1824-1731407612.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=haC1eoXhQp7nomxUOcxQJQ','Từ nữ sinh chuyên Lý đến giải thưởng khoa học công nghệ',NULL,'admin','2024-12-06 21:03:41.882761'),(_binary '',NULL,'2024-11-13 17:54:21.253040',46,4,'2024-12-06 21:29:24.144734',6,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733494845/news-46.mp3.mp3','<p>Thiết kế máy bay không đường nối giữa cánh và thân của Natilus sẽ tạo ra nhiều lực nâng và ít lực cản hơn, đồng thời giảm 1/2 lượng khí thải.</p><figure class=\"image\"><img style=\"aspect-ratio:680/408;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/12/VNE-Na-2647-1731402906.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=u14TmyslRP0wmQbggQuPrg\" alt=\"Hình dáng máy bay Horizon của Natilus. Ảnh: Natilus\" width=\"680\" height=\"408\"></figure><p><span style=\"font-size:12px;\"><i>Hình dáng máy bay Horizon của Natilus. Ảnh: Natilus</i></span></p><p>Công ty khởi nghiệp hàng không vũ trụ Natilus nhắm tới cạnh tranh với những ông lớn trong ngành hàng không dân dụng, thông báo kế hoạch chế tạo máy bay chở khách/chở hàng cánh liền thân Horizon có thể chở 200 hành khách từ New York tới London với lượng khí thải ít hơn 50%, New Atlas hôm 11/11 đưa tin.</p><p>Một trong những giải pháp hứa hẹn thay thế cấu hình cánh và thân dạng ống của máy bay tiêu chuẩn là cánh liền thân (BWB), trong đó cánh và thân máy bay nối với nhau mà không có đường phân chia rõ ràng. Ý tưởng về BWB đã tồn tại từ thập niên 1920 với ứng dụng thực tế là máy bay ném bom hạt nhân B-1 Lancer. Hiện nay, BWB có khả năng thách thức những mẫu máy bay chở khách phổ biến.</p><p>Lợi thế của thiết kế cánh liền thân là không có mối nối giữa cánh và thân, giúp giảm phần lớn lực cản. Ngoài ra, cánh và thân liền nhau cũng giúp tạo ra nhiều lực nâng hơn thay vì phụ thuộc vào phần cánh. Mẫu máy bay này cũng có nhiều không gian nội thất hơn để chứa hành khách, hàng hóa hoặc nhiên liệu. Cuối cùng, phương tiện có thể chứa bình nhiên liệu hydro và các cơ cấu hỗ trợ, giúp giao thông hàng không trở nên \"xanh\" hơn.</p><p>Natilus muốn phát triển dòng máy bay cánh liền thân với mẫu lớn nhất là Horizon, chở 200 hành khách trong chuyến bay liên lục địa với lượng khí thải thấp hơn 50% và mức tiêu thụ nhiên liệu ít hơn 30%. Ngoài ra, thể tích của nó tăng thêm 40% so với thiết kế truyền thống, có thể chở lượng hàng tương đương máy bay thân hẹp Boeing 737 và Airbus A320.</p><p>Với nhu cầu tương lai dành cho máy bay chở khách vượt quá khả năng sản xuất và Boeing đang gặp rắc rối tài chính, đây là cơ hội để Natilus gia nhập thị trường. Tuy nhiên, máy bay cánh liền thân có một số hạn chế. Các sân bay sẽ cần điều chỉnh để chứa vừa chúng và hành khách có thể không muốn ngồi ở hàng ghế quá xa cửa sổ.</p><p>\"Thị trường hàng không đang tìm kiếm giải pháp thực sự để trở nên bền vững, hiệu quả và tạo ra nhiều lợi nhuận hơn\", Aleksey Matyushev, nhà đồng sáng lập kiêm giám đốc điều hành Natilus. Cho biết. \"Với Horizon, chúng tôi đang giới thiệu phương tiện hàng không cải tiến có lợi cho ngành công nghiệp đồng thời bảo vệ an toàn hành tinh cho thế hệ mai sau\".</p><p style=\"text-align:right;\"><strong>An Khang (Theo New Atlas)</strong></p>','trankhangctu@gmail.com','minhkhang2',NULL,'Máy bay cánh liền thân sức chứa 200 hành khách','https://vnexpress.net/may-bay-canh-lien-than-suc-chua-200-hanh-khach-4815241.html','\"Natilus đang phát triển máy bay chở khách/hàng Horizon cánh liền thân (BWB).  Thiết kế BWB loại bỏ mối nối giữa cánh và thân, giảm lực cản và tăng lực nâng.  Horizon dự kiến chở 200 hành khách, giảm 50% khí thải và 30% nhiên liệu so với máy bay thông thường.  Nó có thể tích lớn hơn 40%, tương đương Boeing 737/Airbus A320.  Natilus hướng đến thị trường hàng không đang thiếu máy bay và có nhu cầu về tính bền vững.  Thiết kế BWB có một số hạn chế về hạ tầng sân bay và bố trí ghế ngồi.  Horizon được kỳ vọng là giải pháp thân thiện môi trường và hiệu quả kinh tế.\"','https://res.cloudinary.com/dd1grolgr/image/upload/v1731494965/tagged-images/pqvvfzr3x2ud82gzfpvj.jpg','Máy bay cánh liền thân sức chứa 200 hành khách',NULL,'admin','2024-12-06 21:20:21.487065'),(_binary '',NULL,'2024-11-13 18:12:49.253902',47,6,'2024-12-06 22:26:58.308528',13,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733494854/news-47.mp3.mp3','<p>Giá dầu năm sau được dự báo còn 30-40 USD nếu OPEC+ rút lại chính sách hạn chế sản xuất đã áp dụng 2 năm qua.</p><p>\"Thị trường ngày càng lo ngại về giá dầu năm 2025. Sau 14 năm kể từ phong trào Mùa xuân Arab gây bất ổn chính trị tại Trung Đông và Bắc Phi, tôi mới thấy thị trường lo ngại đến thế\", Tom Kloza - Giám đốc nghiên cứu năng lượng tại công ty dữ liệu OPIS - nhận định.</p><p>Ông cho rằng giá dầu thô có thể xuống 30-40 USD một thùng, nếu OPEC+ rút lại các chính sách ghìm sản xuất đã áp dụng từ cuối năm 2022. Vấn đề này gần đây được nhắc đến nhiều, vì \"thị phần của OPEC+ vài năm qua đã giảm đáng kể\".</p><p>Hiện tại, giá dầu Brent là 72 USD một thùng. Dầu thô Mỹ WTI là 68 USD một thùng.</p><p>Nếu nhu cầu dầu năm tới không tăng thêm hơn 1 triệu thùng mỗi ngày, việc OPEC+ rút chính sách giảm sản xuất \"chắc chắn khiến giá lao dốc\", Henning Gloystein - Giám đốc năng lượng, khí hậu và tài nguyên tại Eurasia Group - cho biết trên CNBC. Ông cũng dự báo giá dầu về 40 USD một thùng năm 2025.</p><figure class=\"image\"><img style=\"aspect-ratio:639/428;\" src=\"https://i1-kinhdoanh.vnecdn.net/2024/11/13/oil-refinery-kazhastan-reuters-7637-1731490316.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=knuoWZNKR-dzwWjQScIRPQ\" alt=\"Bên trong một cơ sở lọc dầu tại Atyrau, Kazakhstan tháng 11/2023. Ảnh: Reuters\" width=\"639\" height=\"428\"></figure><p><span style=\"font-size:12px;\"><i>Bên trong một cơ sở lọc dầu tại Atyrau, Kazakhstan tháng 11/2023. Ảnh: Reuters</i></span></p><p>Saul Kavonic - nhà phân tích năng lượng cấp cao tại MST Marquee thậm chí lo ngại khả năng xảy ra \"cuộc chiến giá dầu để giành thị phần\", khiến giá xuống thấp nhất kể từ khi đại dịch xuất hiện.</p><p>OPEC+ đã ghìm sản xuất 2 năm qua, nhằm ngăn dư cung trên thị trường, khiến giá giảm gây thiệt hại cho các nước thành viên vốn phụ thuộc vào xuất khẩu dầu mỏ. Tuy nhiên, giá năm nay lại giảm gần 6%. Nguyên nhân là các nước ngoài OPEC+, như Mỹ, tăng sản xuất. Trong khi đó, nhu cầu nhiên liệu tại Trung Quốc, nước nhập khẩu dầu hàng đầu thế giới, yếu đi.</p><p>Hồi tháng 9, OPEC+ hoãn kế hoạch nâng sản xuất trong tháng 10 và 11, do giá giảm, nhu cầu yếu và nguồn cung tăng lên. Tuần trước, họ tiếp tục hoãn kế hoạch tăng bơm dầu trở lại từ tháng 12.</p><p>Ngày 12/11, tổ chức này công bố báo cáo mới nhất về thị trường dầu, trong đó hạ dự báo tăng trưởng nhu cầu dầu năm tới từ 1,6 triệu thùng một ngày về 1,5 triệu thùng.</p><p>\"Nếu OPEC+ tăng bơm dầu, dư cung trên thị trường có thể tăng gấp đôi\", Martoccia Francesco - chiến lược gia năng lượng tại Citibank - cho biết. Thậm chí, kể cả khi khối này vẫn ghìm sản xuất, dự báo giá dầu năm sau cũng u ám. Các nhà phân tích tại Citi cho rằng giá Brent trung bình năm sau sẽ là 60 USD một thùng.</p><p>Giá dầu nhiều khả năng còn chịu tác động từ các chính sách của Tổng thống đắc cử Mỹ Donald Trump. Ông đã cam kết tăng khai thác dầu khí và hạ giá năng lượng xuống một nửa, đồng nghĩa giá dầu thô phải xuống dưới 40 USD.</p><p>Bên cạnh đó, các chính sách thuế nhập khẩu của Trump nhiều khả năng gây ra chiến tranh thương mại. \"Nếu chiến tranh thương mại xảy ra, đặc biệt là với Trung Quốc, giá dầu sẽ còn xuống thấp hơn rất nhiều\", Kloza cảnh báo.</p><p style=\"text-align:right;\"><strong>Hà Thu (theo CNBC, Reuters)</strong></p>','tranminhkhang8888@gmail.com','anonymousUser',NULL,'Giá dầu thô năm sau có thể giảm 50%','https://vnexpress.net/gia-dau-tho-nam-sau-co-the-giam-50-4815448.html','\"OPEC+ dự kiến sẽ giảm sản lượng dầu trong hai năm qua.  Tuy nhiên, nếu họ dỡ bỏ chính sách này, giá dầu năm 2025 có thể giảm xuống 30-40 USD/thùng.  Nhiều chuyên gia lo ngại về giá dầu năm 2025, cho rằng thị trường đang thiếu hụt cầu.  Việc giảm sản lượng của OPEC+ đã không ngăn được giá dầu giảm gần 6% trong năm nay.  Sự gia tăng sản lượng của các nước ngoài OPEC+ và nhu cầu yếu kém từ Trung Quốc là nguyên nhân chính. OPEC+ đã hoãn kế hoạch tăng sản xuất nhiều lần.  Tăng sản lượng có thể dẫn đến dư cung dầu, đẩy giá xuống thấp hơn.  Thậm chí nếu OPEC+ duy trì chính sách hiện tại, giá dầu năm sau vẫn được dự báo ở mức 60 USD/thùng. Chính sách của Tổng thống Mỹ cũng có thể ảnh hưởng đến giá dầu. Chiến tranh thương mại có thể khiến giá dầu giảm mạnh hơn nữa.\"','https://res.cloudinary.com/dhocs0lis/image/upload/v1731496273/munh4ntlvtsfgddq5rsd.jpg','Giá dầu thô năm sau có thể giảm 50%',NULL,'manage-kinh-doanh','2024-12-06 21:20:13.213082'),(_binary '',NULL,'2024-11-22 09:52:52.093306',48,5,'2024-12-06 21:27:17.752084',7,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733494817/news-48.mp3.mp3','<p>Các doanh nghiệp Việt Nam hợp tác, đầu tư tại Dominica có thể coi đây là cửa ngõ để tiến vào khu vực Caribe, Mỹ Latin, theo Thủ tướng Phạm Minh Chính.</p><p>Dự diễn đàn doanh nghiệp Việt Nam - Cộng hòa Dominica ngày 21/11 tại thủ đô Santo Domingo, Thủ tướng Phạm Minh Chính cho biết Việt Nam - Dominica cùng có nền văn hóa, vị trí địa chính trị quan trọng tại hai khu vực Mỹ Latin và Đông Nam Á. Hai nước cũng là những nền kinh tế tăng trưởng nhanh, có thể bổ trợ, thúc đẩy nhau phát triển. Đây là những nền tảng, lợi thế quan trọng để doanh nghiệp hai nước yên tâm đầu tư.</p><p>Doanh nghiệp Việt Nam - Cộng hòa Dominica có thể thông qua nhau để tiếp cận thị trường của cả khu vực. \"Các doanh nghiệp Việt Nam hợp tác, đầu tư tại Dominica có thể coi đây là bàn đạp, cửa ngõ để tiến vào khu vực Caribe\", Thủ tướng nói.</p><figure class=\"image image_resized\" style=\"width:75.27%;\"><img style=\"aspect-ratio:680/408;\" src=\"https://i1-vnexpress.vnecdn.net/2024/11/22/img3054-1732211873087259781377-5306-1732214392.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=nwWIzAUJBw1lLIz3jKihCQ\" alt=\"Thủ tướng Phạm Minh Chính phát biểu tại tọa đàm doanh nghiệp Việt Nam - Cộng hòa Dominica tại thủ đô Santo Domingo sáng 21/11. Ảnh: Nhật Bắc\" width=\"680\" height=\"408\"></figure><p><span style=\"font-size:12px;\"><i>Thủ tướng Phạm Minh Chính phát biểu tại tọa đàm doanh nghiệp Việt Nam - Cộng hòa Dominica tại thủ đô Santo Domingo sáng 21/11. Ảnh: Nhật Bắc</i></span></p>','tranminhkhang8888@gmail.com','minhkhang1',NULL,'Thủ tướng: Dominica là cửa ngõ để doanh nghiệp Việt vào khu vực Caribe','https://vnexpress.net/thu-tuong-dominica-la-cua-ngo-de-doanh-nghiep-viet-vao-khu-vuc-caribe-4818956.html','\"Thủ tướng Phạm Minh Chính khẳng định Việt Nam và Dominica có nhiều điểm tương đồng về kinh tế và vị trí địa lý.  Việt Nam và Dominica có thể thúc đẩy lẫn nhau phát triển.  Doanh nghiệp hai nước có thể tận dụng cơ hội này để hợp tác và đầu tư.  Dominica là cửa ngõ để doanh nghiệp Việt Nam thâm nhập thị trường Caribe và Mỹ Latin.  Thủ tướng nhấn mạnh tiềm năng hợp tác kinh tế giữa hai nước.  Doanh nghiệp Việt Nam được khuyến khích đầu tư vào Dominica.  Hợp tác kinh tế Việt Nam - Dominica mang lại nhiều lợi ích cho cả hai bên.  Hai nước có nền kinh tế tăng trưởng nhanh, bổ trợ lẫn nhau.  Dominica là bàn đạp giúp doanh nghiệp Việt Nam mở rộng thị trường.  Đây là cơ hội tốt để doanh nghiệp hai nước cùng phát triển.\"','https://res.cloudinary.com/dhocs0lis/image/upload/v1732243914/fmbuplxs59qogydqjhv1.jpg','Thủ tướng: Dominica là cửa ngõ để doanh nghiệp Việt vào khu vực Caribe',NULL,'admin','2024-12-06 21:21:42.000793'),(_binary '',4,'2024-11-22 22:24:58.977066',49,8,'2024-12-07 09:50:47.576005',32,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1732290761/news-49.mp3.mp3','<p>Kết quả phân nhánh tứ kết UEFA Nations League 2024-2025 đưa Hà Lan đụng Tây Ban Nha, Đức đấu Italy, còn Bồ Đào Nha và Pháp tránh đối mạnh.</p><p>Ba trong bốn cặp đấu tứ kết Nations League mùa này từng là chung kết World Cup. Italy từng thắng Đức tại chung kết World Cup 1982, Hà Lan thua Tây Ban Nha năm 2010, còn Pháp đả bại Croatia năm 2018. Cặp đấu còn lại của tứ kết diễn ra giữa Bồ Đào Nha và Đan Mạch.</p><figure class=\"image\"><img style=\"aspect-ratio:680/320;\" src=\"https://i1-thethao.vnecdn.net/2024/11/22/ANH-2-4812-1732287959.png?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=qTrTkAkzvk4Fa2CusT72kg\" alt=\"Kết quả phân nhánh tứ kết UEFA Nations League 2024-2025 hôm nay 22/11/2024.\" width=\"680\" height=\"320\"></figure><p><span style=\"font-size:12px;\"><i>Kết quả phân nhánh tứ kết UEFA Nations League 2024-2025 hôm nay 22/11/2024.</i></span></p><p>Đây là lần đầu Bồ Đào Nha gặp Đan Mạch gặp nhau ở vòng knock-out một giải chính thức. Đại diện Bắc Âu cũng lép vế về đối đầu trên mọi đấu trường, khi mới thắng ba, hòa hai và thua 11 trong 16 lần đụng độ Bồ Đào Nha. Vì thế, Cristiano Ronaldo và đồng đội có cơ hội lớn vào bán kết, nơi họ có thể gặp Đức hoặc Italy.</p><p>Đức và Italy có nhiều duyên nợ, khi hai đội đã gặp nhau 37 trận, với 15 chiến thắng, 12 hòa và 10 thua cho đại diện Nam Âu. Trong sáu cuộc đối đầu gần đây, lợi thế lại nghiêng về Đức với ba trận thắng, ba hòa. Hai đội cũng đang có phong độ cao, lần lượt dưới trướng Julian Nagelsmann và Luciano Spalletti.</p><p>Ở nhánh còn lại, trận cầu tâm điểm sẽ diễn ra giữa đương kim vô địch châu Âu, Tây Ban Nha và Hà Lan. Đoàn quân Luis de la Fuente dĩ nhiên được đánh giá cao hơn với 16 trận bất bại gần đây. Tuy nhiên, \"Cơn Lốc Cam\" cũng có lý do để tự tin khi bất bại ba trận gần nhất gặp đối thủ này.</p><p>Đội thắng trong cặp đấu này sẽ gặp Pháp hoặc Croatia ở bán kết. Trong 10 cuộc đối đầu, Croatia mới thắng Pháp một trận, và cũng là trận gần nhất giữa hai đội ở vòng bảng Nations League 2022-2023. Pháp được đánh giá cao hơn nhưng họ đang không có phong độ tốt dưới trướng Didier Deschamps.</p><p>Các trận tứ kết diễn ra hai lượt đi và về, ngày 20/3 và 23/3/2025. Từ bán kết, các trận chỉ diễn ra một lượt, trên sân trung lập, ngày 4/6 và 5/6. Trận chung kết diễn ra ngày 8/6.</p><p>Đây là mùa thứ tư của Nations League, giải đấu phân chia các đội tuyển châu Âu làm bốn hạng. Bồ Đào Nha, Pháp và Tây Ban Nha lần lượt đăng quang ba mùa đầu tiên. Còn trong tám đội vào tứ kết kỳ này, chỉ có Đức và Đan Mạch chưa từng vào bán kết.</p><p style=\"text-align:right;\"><strong>Hoàng An</strong></p>','tranminhkhang8888@gmail.com','khangb2012215@student.ctu.edu.vn',NULL,'Tây Ban Nha đấu Hà Lan ở tứ kết UEFA Nations League','https://vnexpress.net/tay-ban-nha-dau-ha-lan-o-tu-ket-uefa-nations-league-4819339.html','\"Tứ kết UEFA Nations League 2024-2025: Hà Lan gặp Tây Ban Nha, Đức gặp Italy, Bồ Đào Nha gặp Đan Mạch, Pháp gặp Croatia.  Ba trong bốn cặp đấu từng là chung kết World Cup.  Bồ Đào Nha được đánh giá cao hơn Đan Mạch.  Đức và Italy có nhiều duyên nợ. Tây Ban Nha được đánh giá cao hơn Hà Lan nhưng Hà Lan có thành tích tốt trước đó. Pháp được đánh giá cao hơn Croatia nhưng đang có phong độ không tốt.  Các trận tứ kết diễn ra hai lượt, bán kết và chung kết một lượt.  Giải đấu gồm bốn hạng, đây là mùa giải thứ tư.  Chỉ Đức và Đan Mạch chưa từng vào bán kết Nations League.\"','https://res.cloudinary.com/dhocs0lis/image/upload/v1732289166/azjem7ouuks9lpqig3tl.jpg','Tây Ban Nha đấu Hà Lan ở tứ kết UEFA Nations League',NULL,'manage-the-thao','2024-11-22 22:51:59.519492'),(_binary '',2,'2024-11-22 22:29:51.198055',50,6,'2024-12-07 08:32:35.128459',28,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1732326787/news-50.mp3.mp3','<p>Đầu tháng 12, Aeon Mall Việt Nam sẽ khởi công dự án trung tâm thương mại trên khu đất 91.000 m2 ở Bãi Cháy, TP Hạ Long.</p><p>Trung tâm thương mại của Aeon Mall nằm tại lô đất ký hiệu TMDV-D2.1, đường Cái Lân, phường Bãi Cháy, TP Hạ Long tỉnh Quảng Ninh. Dự án này có tổng mức đầu tư hơn 5.140 tỷ đồng trên diện tích đất khoảng 91.000 m2.</p><p>Theo kế hoạch, Công ty TNHH Aeon Mall Việt Nam sẽ khởi công dự án vào ngày 2/12. Trung tâm thương mại dự kiến hoàn thành vào ngày 30/4/2025 với 5 tầng, 1 tum và 1 tầng hầm, tổng diện tích sàn xây dựng khoảng 200.000 m2.</p><p>Trước đó, Aeon Mall công bố quyết định đầu tư trung tâm thương mại ở Hạ Long hồi đầu tháng 10. Đây là dự án trung tâm thương mại thứ 4 tại miền Bắc của đại gia bán lẻ Nhật Bản sau các công trình ở Hà Nội và Hải Phòng.</p><p>Hiện tại, Aeon Mall có 7 trung tâm thương mại tại Việt Nam với tổng diện tích sàn cho thuê khoảng 462.000 m2. Thời gian qua, tập đoàn này cũng liên tục xúc tiến triển khai thêm các dự án mới. Mới đây nhất, Aeon Mall được Cần Thơ duyệt chủ trương đầu tư trung tâm thương mại với tổng vốn hơn 5.400 tỷ đồng.</p><p>Hồi tháng 5, họ đã khởi công trung tâm thương mại đầu tiên tại khu vực Đồng bằng sông Cửu Long với dự án quy mô hơn 1.000 tỷ đồng tại TP Tân An, tỉnh Long An. Bên cạnh đó, Aeon Mall cũng đang có các dự án đặt mục tiêu sắp triển khai ở Thanh Hoá, Đà Nẵng.</p><p>Giai đoạn tháng 3-8/2024, Aeon Mall đạt doanh thu hơn gần 8,2 tỷ yen, khoảng hơn 1.390 tỷ đồng tại Việt Nam. Mức này tăng hơn 14% so với cùng kỳ năm ngoái. Sau khi trừ các chi phí, đại gia Nhật Bản lãi trước thuế khoảng 2,4 tỷ yen (tương đương trên 400 tỷ đồng), tăng khoảng 21%.</p><p>Như vậy, Việt Nam đóng góp gần 40% vào lợi nhuận từ các thị trường nước ngoài của Aeon Mall. Sau hơn 10 năm, Aeon đã rót khoảng 1,5 tỷ USD vào Việt Nam.</p><p style=\"text-align:right;\"><strong>Anh Tú</strong></p>','tranminhkhang8888@gmail.com','anonymousUser',NULL,'Aeon Mall sắp xây trung tâm thương mại ở Hạ Long','https://vnexpress.net/aeon-mall-sap-xay-trung-tam-thuong-mai-o-ha-long-4819227.html','\"Aeon Mall Việt Nam khởi công trung tâm thương mại thứ 4 miền Bắc tại Hạ Long ngày 2/12, trên diện tích 91.000m2, tổng vốn đầu tư hơn 5.140 tỷ đồng.  Dự án 5 tầng, 1 tum, 1 hầm, hoàn thành 30/4/2025, diện tích sàn khoảng 200.000m2.  Đây là một phần trong kế hoạch mở rộng của Aeon Mall tại Việt Nam,  bao gồm các dự án sắp tới ở Cần Thơ, Thanh Hóa và Đà Nẵng.  Doanh thu Aeon Mall Việt Nam tăng 14% trong 6 tháng đầu năm 2024, đóng góp gần 40% lợi nhuận quốc tế của tập đoàn.  Aeon Mall đã đầu tư khoảng 1,5 tỷ USD vào Việt Nam trong hơn 10 năm.\"','https://i1-vnexpress.vnecdn.net/2024/11/22/anh21573635663-1732265289-7729-1732265311.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=Ma64ohe0odnVMyRTYkHifA','Aeon Mall sắp xây trung tâm thương mại ở Hạ Long',NULL,'manage-bat-dong-san','2024-11-23 08:52:35.323660'),(_binary '',NULL,'2024-12-05 07:07:36.053467',51,NULL,'2024-12-06 17:35:44.056400',3,1,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733357401/news-51.mp3.mp3','<p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Campuchia là nhà cung cấp cao su lớn nhất cho Việt Nam, tiếp đến là Trung Quốc, Hàn Quốc.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Cao su, được ví như \"vàng trắng\", từng là cây trồng chủ lực phục vụ xuất khẩu. Tuy nhiên, giá giảm sâu trong nhiều năm qua đã khiến diện tích trồng thu hẹp, nông dân chuyển đổi cây trồng khác. Hệ quả, Việt Nam phải tăng nhập khẩu nguyên liệu này trong hai năm gần đây.</span></span></p><figure class=\"image image_resized\" style=\"width:40.28%;\"><img style=\"aspect-ratio:220/132;\" src=\"data:image/jpeg;base64,\" width=\"220\" height=\"132\"></figure><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\"><o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Trong 10 tháng đầu năm, Việt Nam nhập khẩu hơn 1,4 triệu tấn cao su, trị giá hơn 2,2 tỷ USD. Con số này tăng 8,9% về lượng và 30,1% về giá trị so với cùng kỳ năm trước, theo thống kê sơ bộ của Tổng cục Hải quan. Điều này phản ánh sự thay đổi trong cán cân cung cầu khi nguồn cung trong nước sụt giảm đáng kể.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Campuchia là nhà cung cấp cao su lớn nhất cho Việt Nam với hơn 649.000 tấn, trị giá 802 triệu USD. Mặc dù lượng nhập khẩu giảm 7%, giá trị tăng 22%, đạt trung bình 1.235 USD một tấn, tăng 31% so với năm trước. Trung Quốc và Hàn Quốc lần lượt đứng thứ hai và ba, với trị giá 316 triệu USD và 261 triệu USD, giá bình quân từ 1.734 đến 1.962 USD một tấn.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Theo các doanh nghiệp, nguyên nhân chính dẫn đến sự gia tăng nhập khẩu là do người dân thu hẹp diện tích trồng cao su trong những năm gần đây, đặc biệt khi giá cả liên tục duy trì ở mức thấp. Biến đổi khí hậu cũng là một yếu tố tác động mạnh mẽ, ảnh hưởng đến năng suất và chất lượng mủ cao su. Trong khi đó, nhu cầu tiêu thụ các sản phẩm cao su tự nhiên trên toàn cầu lại tăng trưởng đều đặn ở mức 4-6% mỗi năm, đặc biệt từ các ngành sản xuất lốp xe và thiết bị công nghiệp. Điều này tạo cơ hội để các doanh nghiệp Việt đẩy mạnh sản xuất, đáp ứng nhu cầu của thị trường thế giới.</span></span></p><p><span style=\"font-family:&quot;Times New Roman&quot;,serif;font-size:12.0pt;\"><span style=\"line-height:107%;\">Ở khía cạnh xuất khẩu, Việt Nam vẫn giữ vững vị thế là quốc gia xuất khẩu cao su lớn thứ ba toàn cầu, chiếm 17,4% thị phần. Trong 10 tháng đầu năm nay, kim ngạch xuất khẩu loại này đạt gần 2,6 tỷ USD, tăng 17,2% so với cùng kỳ năm ngoái. Mặc dù phải đối mặt với nhiều thách thức, ngành cao su vẫn cho thấy sức mạnh cạnh tranh nhờ vào năng lực sản xuất và các chiến lược đổi mới, như phát triển tín chỉ carbon từ cây cao su và ứng dụng công nghệ xanh.</span></span></p><p style=\"text-align:justify;\"><span style=\"font-family:&quot;Times New Roman&quot;,serif;font-size:12.0pt;\"><span style=\"line-height:107%;\"><strong>Trần Minh Khang</strong></span></span></p>','tranminhkhang8888@gmail.com','admin',NULL,'Việt Nam chi 2,2 tỷ USD nhập khẩu cao su','https://vnexpress.net/viet-nam-chi-2-2-ty-usd-nhap-khau-cao-su-4823789.html','\"Việt Nam nhập khẩu cao su tăng mạnh do diện tích trồng trong nước giảm.  Campuchia là nhà cung cấp lớn nhất cho Việt Nam.  Giá cao su nhập khẩu tăng cao.  Trung Quốc và Hàn Quốc là những nhà cung cấp chính khác.  Giảm sản lượng trong nước do giá thấp và biến đổi khí hậu.  Nhu cầu cao su toàn cầu tăng.  Việt Nam vẫn là nước xuất khẩu cao su lớn thứ ba thế giới.  Ngành cao su Việt Nam đang đổi mới để cạnh tranh. Xuất khẩu cao su của Việt Nam tăng.  Ngành công nghiệp cao su Việt Nam đối mặt với thách thức nhưng vẫn giữ vững vị thế.\"','https://res.cloudinary.com/dhocs0lis/image/upload/v1733357113/nnmkxyjyiqle2qebbcws.jpg','Việt Nam chi 2,2 tỷ USD nhập khẩu cao su',NULL,'admin','2024-12-05 07:09:35.518531'),(_binary '',2,'2024-12-05 20:35:06.895280',52,6,'2024-12-07 07:12:01.609387',18,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733405824/news-52.mp3.mp3','<p>Campuchia là nhà cung cấp cao su lớn nhất cho Việt Nam, tiếp đến là Trung Quốc, Hàn Quốc.<br>Cao su, được ví như \"vàng trắng\", từng là cây trồng chủ lực phục vụ xuất khẩu. Tuy nhiên, giá giảm sâu trong nhiều năm qua đã khiến diện tích trồng thu hẹp, nông dân chuyển đổi cây trồng khác. Hệ quả, Việt Nam phải tăng nhập khẩu nguyên liệu này trong hai năm gần đây.<br>Trong 10 tháng đầu năm, Việt Nam nhập khẩu hơn 1,4 triệu tấn cao su, trị giá hơn 2,2 tỷ USD. Con số này tăng 8,9% về lượng và 30,1% về giá trị so với cùng kỳ năm trước, theo thống kê sơ bộ của Tổng cục Hải quan. Điều này phản ánh sự thay đổi trong cán cân cung cầu khi nguồn cung trong nước sụt giảm đáng kể.<br>Campuchia là nhà cung cấp cao su lớn nhất cho Việt Nam với hơn 649.000 tấn, trị giá 802 triệu USD. Mặc dù lượng nhập khẩu giảm 7%, giá trị tăng 22%, đạt trung bình 1.235 USD một tấn, tăng 31% so với năm trước. Trung Quốc và Hàn Quốc lần lượt đứng thứ hai và ba, với trị giá 316 triệu USD và 261 triệu USD, giá bình quân từ 1.734 đến 1.962 USD một tấn.<br>Theo các doanh nghiệp, nguyên nhân chính dẫn đến sự gia tăng nhập khẩu là do người dân thu hẹp diện tích trồng cao su trong những năm gần đây, đặc biệt khi giá cả liên tục duy trì ở mức thấp. Biến đổi khí hậu cũng là một yếu tố tác động mạnh mẽ, ảnh hưởng đến năng suất và chất lượng mủ cao su. Trong khi đó, nhu cầu tiêu thụ các sản phẩm cao su tự nhiên trên toàn cầu lại tăng trưởng đều đặn ở mức 4-6% mỗi năm, đặc biệt từ các ngành sản xuất lốp xe và thiết bị công nghiệp. Điều này tạo cơ hội để các doanh nghiệp Việt đẩy mạnh sản xuất, đáp ứng nhu cầu của thị trường thế giới.<br>Ở khía cạnh xuất khẩu, Việt Nam vẫn giữ vững vị thế là quốc gia xuất khẩu cao su lớn thứ ba toàn cầu, chiếm 17,4% thị phần. Trong 10 tháng đầu năm nay, kim ngạch xuất khẩu loại này đạt gần 2,6 tỷ USD, tăng 17,2% so với cùng kỳ năm ngoái. Mặc dù phải đối mặt với nhiều thách thức, ngành cao su vẫn cho thấy sức mạnh cạnh tranh nhờ vào năng lực sản xuất và các chiến lược đổi mới, như phát triển tín chỉ carbon từ cây cao su và ứng dụng công nghệ xanh.</p><p style=\"text-align:right;\"><br><strong>Trần Minh Khang</strong></p>','tranminhkhang8888@gmail.com','tranminhkhang',NULL,'Việt Nam chi 2,2 tỷ USD nhập khẩu cao su','','\"Việt Nam nhập khẩu cao su tăng mạnh do diện tích trồng trong nước giảm.  Campuchia là nhà cung cấp lớn nhất cho Việt Nam.  Giá cao su nhập khẩu tăng cao hơn 30%.  Trung Quốc và Hàn Quốc là các nhà cung cấp lớn khác.  Giảm sản lượng trong nước do giá thấp và biến đổi khí hậu.  Nhu cầu toàn cầu cao su tăng 4-6%/năm. Việt Nam vẫn là nước xuất khẩu cao su lớn thứ ba thế giới.  Xuất khẩu cao su của Việt Nam tăng 17,2%. Ngành cao su Việt Nam đang đổi mới, phát triển bền vững.\"','https://res.cloudinary.com/dhocs0lis/image/upload/v1733405648/jjvpmkkdmcn375qbhvh1.jpg','Việt Nam chi 2,2 tỷ USD nhập khẩu cao su',NULL,'manage-kinh-doanh','2024-12-05 20:36:33.166038'),(_binary '\0',NULL,'2024-12-06 21:18:43.028675',53,NULL,'2024-12-06 21:18:56.635094',NULL,3,NULL,NULL,'<p>Ban Chỉ đạo Trung ương về tổng kết Nghị quyết 18 yêu cầu các đơn vị hoàn thành đề án sắp xếp, tinh gọn bộ máy trong tháng 12/2024 để phục vụ Hội nghị Trung ương và kỳ họp Quốc hội bất thường tháng 2/2025.</p><p>Ngày 5/12, ông Lê Minh Hưng, Trưởng ban Tổ chức Trung ương, Phó trưởng ban Chỉ đạo Trung ương về tổng kết Nghị quyết 18, cho biết Hội nghị Trung ương bất thường tổ chức cách đây 10 ngày đã cơ bản thống nhất nội dung định hướng do Bộ Chính trị đề ra. Các cấp ủy, tổ chức đảng, cơ quan và đơn vị trực thuộc Trung ương sẽ dựa trên các gợi ý này để nghiên cứu, đề xuất phương án sắp xếp tổ chức bộ máy chính trị theo hướng tinh gọn, hiệu lực, hiệu quả.</p><p>Bộ Chính trị và Ban Chỉ đạo Trung ương được giao nhiệm vụ xem xét, quyết định việc sắp xếp các cơ quan, tổ chức có phương án chuẩn bị kỹ lưỡng.</p><p>Thực hiện chỉ đạo của Tổng Bí thư Tô Lâm, Hội nghị Trung ương dự kiến diễn ra vào giữa tháng 2/2025, và kỳ họp Quốc hội bất thường vào cuối tháng 2/2025. Các đơn vị cần hoàn thành đề án tinh gọn bộ máy trước thời hạn này.</p><p>Những nhiệm vụ cần thực hiện ngay</p><p>Nội dung triển khai ngay để hoàn thành trước 31/12/2024 thuộc thẩm quyền của Bộ Chính trị, Ban Bí thư, các cấp ủy, tổ chức đảng và cơ quan, đơn vị. Cụ thể, các ban Đảng Trung ương xây dựng đề án tinh gọn đầu mối ở cấp vụ, phòng và đơn vị trực thuộc; rà soát ban chỉ đạo do cơ quan mình làm thường trực, đề xuất kết thúc hoạt động, chỉ giữ lại những ban thật sự cần thiết.</p><p>Các ban Đảng Trung ương kết thúc hoạt động các tạp chí, chuyển chức năng, nhiệm vụ về Tạp chí Cộng sản, hoàn thành trước 15/12. Ban Tuyên giáo Trung ương xây dựng đề án kết thúc hoạt động của báo Điện tử Đảng Cộng sản Việt Nam, chuyển chức năng, nhiệm vụ liên quan về báo Nhân Dân; hoàn thành trước ngày 15/12/2024.</p><p>Hội đồng Lý luận, phê bình văn học nghệ thuật Trung ương, Hội đồng khoa học các cơ quan Đảng Trung ương được chuyển về Học viện Chính trị quốc gia Hồ Chí Minh. Học viện tiếp nhận chức năng, nhiệm vụ của Hội đồng Lý luận Trung ương; Hội đồng Lý luận, phê bình văn học nghệ thuật Trung ương; Hội đồng Khoa học các cơ quan Đảng Trung ương.</p><p>Báo Nhân Dân xây dựng đề án kết thúc hoạt động của Truyền hình Nhân Dân, chuyển chức năng, nhiệm vụ liên quan về Đài Truyền hình Việt Nam; tiếp nhận chức năng, nhiệm vụ của báo Điện tử Đảng Cộng sản Việt Nam; tinh gọn các vụ, đơn vị trực thuộc. Tạp chí Cộng sản tiếp nhận chức năng, nhiệm vụ của các tạp chí thuộc ban Đảng Trung ương.</p><p>Ban Bảo vệ chăm sóc sức khỏe cán bộ Trung ương phối hợp với Ban Tổ chức Trung ương, Bộ Y tế xây dựng đề án kết thúc hoạt động, chuyển nhiệm vụ của Ban về Ban Tổ chức Trung ương, Bộ Y tế và một số bệnh viện Trung ương.</p><p>Ban Tổ chức Trung ương sẽ tham mưu Bộ Chính trị sửa đổi, bổ sung các quy định để sắp xếp tinh gọn bộ máy, bố trí cán bộ, tinh giản biên chế.</p><figure class=\"image image_resized\" style=\"width:78.8%;\"><img style=\"aspect-ratio:680/453;\" src=\"https://i1-vnexpress.vnecdn.net/2024/12/05/dsc09859-1733397870-1733397942-3367-1733398019.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=OGKWJ8ZTJHcSZVpsavUySw\" alt=\"Trụ sở Bộ Nội vụ, tháng 12/2024. Ảnh: Hoàng Giang\" width=\"680\" height=\"453\"></figure><p>Trụ sở Bộ Nội vụ, tháng 12/2024. Ảnh: Hoàng Giang</p><p>Ban Cán sự đảng Chính phủ và Ban Chỉ đạo tổng kết Nghị quyết 18 trình Bộ Chính trị, Ban Bí thư chủ trương giải thể Ủy ban Quản lý vốn nhà nước tại doanh nghiệp và Ủy ban Giám sát tài chính quốc gia. Chính phủ sửa đổi, bổ sung quy định pháp luật để sắp xếp các cơ quan như: Ban Quản lý Lăng Chủ tịch Hồ Chí Minh, Bảo hiểm xã hội Việt Nam, Kho bạc Nhà nước, Tổng cục Thuế, Tổng cục Hải quan, Tổng cục Thi hành án dân sự, Tổng cục Quản lý thị trường, Chi nhánh Ngân hàng Nhà nước tại địa phương.</p><p>Các nghị định về chức năng, nhiệm vụ của bộ, cơ quan ngang bộ, cơ quan thuộc Chính phủ được điều chỉnh theo hướng tinh gọn. Chính phủ chấm dứt hoạt động Truyền hình Thông tấn, Truyền hình VOV, Truyền hình VTC, chuyển nhiệm vụ về Đài Truyền hình Việt Nam, và sắp xếp lại báo chí thuộc các bộ, ngành, hoàn thành trước 15/1/2025.</p><p>Đảng đoàn Quốc hội trình Bộ Chính trị, Ban Bí thư cho chủ trương về sắp xếp, tinh gọn tổ chức bộ máy, biên chế các cơ quan thuộc Ủy ban Thường vụ Quốc hội và Văn phòng Quốc hội; kết thúc hoạt động của Viện Nghiên cứu lập pháp; quy định không bố trí chức danh ủy viên thường trực, ủy viên chuyên trách tại Hội đồng Dân tộc và các Ủy ban của Quốc hội. Các ủy ban của Quốc hội có chủ nhiệm, phó chủ nhiệm, đại biểu Quốc hội chuyên trách và đại biểu Quốc hội kiêm nhiệm; kết thúc hoạt động của Truyền hình Quốc hội.</p><p>Đảng đoàn Mặt trận Tổ quốc Việt Nam, các đảng đoàn tổ chức chính trị - xã hội ở Trung ương, Ban Bí thư Trung ương Đoàn Thanh niên Cộng sản Hồ Chí Minh, các Đảng đoàn và tổ chức đảng hội quần chúng do Đảng và Nhà nước giao nhiệm vụ, xây dựng đề án sắp xếp lại báo, tạp chí trực thuộc, các hội quần chúng theo hướng sáp nhập, kết thúc hoạt động một số báo, tạp chí không thật sự cần thiết; tinh gọn đầu mối cấp ban, cấp phòng, đơn vị, tổ chức trực thuộc.</p><p>Ban Tuyên giáo Trung ương chủ trì, phối hợp với Ban Dân vận Trung ương xây dựng đề án sáp nhập Ban Tuyên giáo Trung ương và Ban Dân vận Trung ương; hoàn thành trước 15/1/2025.</p><p>Ban Đối ngoại Trung ương chủ trì xây dựng đề án kết thúc hoạt động của cơ quan này, chuyển các nhiệm vụ chính về Bộ Ngoại giao, một phần công việc về Văn phòng Trung ương Đảng. Đảng ủy Khối các cơ quan Trung ương chủ trì xây dựng đề án kết thúc hoạt động của cơ quan này.</p><p>Văn phòng Trung ương Đảng chủ trì xây dựng Đề án lập Đảng bộ các cơ quan Đảng, cơ quan tư pháp Trung ương, Văn phòng Chủ tịch nước; đề xuất Bộ Chính trị chỉ định Ban Chấp hành, Ban Thường vụ, Bí thư, Phó bí thư Đảng ủy các cơ quan Đảng, cơ quan tư pháp Trung ương, Văn phòng Chủ tịch nước nhiệm kỳ 2020-2025.</p><p>Tòa án nhân dân Tối cao và Viện Kiểm sát nhân dân Tối cao xây dựng đề án kết thúc Ban cán sự đảng, lập các đảng bộ trực thuộc Đảng ủy cơ quan tư pháp Trung ương. Đảng ủy Khối doanh nghiệp Trung ương xây dựng đề án giải thể Đảng bộ Khối doanh nghiệp Trung ương. Ban cán sự đảng Chính phủ xây dựng đề án giải thể, lập Đảng bộ Chính phủ trực thuộc Trung ương, Đảng đoàn Quốc hội xây dựng đề án giải thể, lập Đảng bộ Quốc hội trực thuộc Trung ương và đề xuất nhân sự lãnh đạo nhiệm kỳ 2020-2025.</p><p>Ban Tổ chức Trung ương tham mưu hoàn thiện Quy định thi hành Điều lệ Đảng (sửa đổi, bổ sung) và Nghị quyết của Hội nghị Trung ương bất thường, dự kiến tổ chức giữa tháng 2/2025; trình Bộ Chính trị ngay sau hội nghị. Ban đồng thời tham mưu Bộ Chính trị, Ban Bí thư trong việc sắp xếp, bố trí cán bộ thuộc diện Trung ương quản lý.</p><p>Ban cán sự đảng Chính phủ chỉ đạo trình Quốc hội tại kỳ họp bất thường để ban hành nghị quyết về thành lập, giải thể một số bộ và sửa đổi các luật liên quan.</p><p>Đảng đoàn Quốc hội chỉ đạo tổ chức kỳ họp bất thường vào cuối tháng 2/2025 để xem xét, thông qua sửa đổi, bổ sung các luật và thực hiện công tác nhân sự.</p><p style=\"text-align:right;\"><strong>Viết Tuân</strong></p>','trankhangctu@gmail.com','trankhangctu@gmail.com',NULL,'Trung ương, Quốc hội sẽ họp bàn về tinh gọn bộ máy vào tháng 2/2025','https://vnexpress.net/trung-uong-quoc-hoi-se-hop-ban-ve-tinh-gon-bo-may-vao-thang-2-2025-4824399.html',NULL,'https://i1-vnexpress.vnecdn.net/2024/12/05/dsc09859-1733397870-1733397942-3367-1733398019.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=NAHhTnt0aA0eIDN3wBsi8w','Trung ương, Quốc hội sẽ họp bàn về tinh gọn bộ máy vào tháng 2/2025',NULL,NULL,NULL),(_binary '',3,'2024-12-06 22:13:51.363602',54,1,'2024-12-07 07:11:56.360402',3,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733498323/news-54.mp3.mp3','<p>HLV Jose Mourinho mỉa mai đồng nghiệp Pep Guardiola vì 150 cáo buộc gian lận của Man City, sau khi bị so sánh số danh hiệu Ngoại hạng Anh.</p><p>Trong một cuộc phỏng vấn hôm 4/12, Guardiola nhận được câu hỏi liệu ông giơ 6 ngón tay trên sân Anfield có liên quan gì tới Mourinho hay không, vì đó là động tác quen thuộc của HLV người Bồ Đào Nha. HLV người Tây Ban Nha trả lời: \"Mourinho chỉ đoạt ba danh hiệu Ngoại hạng Anh, còn tôi sáu lần vô địch. Nhưng đúng là chúng tôi giống nhau ở chỗ đang gặp khó khăn\".</p><figure class=\"image image_resized\" style=\"width:81.34%;\"><img style=\"aspect-ratio:680/408;\" src=\"https://i1-thethao.vnecdn.net/2024/12/06/mourinho-guardiola-1733482637-1628-1733482700.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=Xzv3upx0qQhIPJ9jpFo2Ng\" alt=\"Mourinho (phải) và Guardiola trong một trận derby Manchester trên sân Old Trafford năm 2018. Ảnh: Guardian\" width=\"680\" height=\"408\"></figure><p><span style=\"font-size:12px;\"><i>Mourinho (phải) và Guardiola trong một trận derby Manchester trên sân Old Trafford năm 2018. Ảnh: Guardian</i></span></p><p>Trong họp báo hôm nay 6/12, các phóng viên Thổ Nhĩ Kỳ lại hỏi Mourinho về quan điểm của ông trước phát biểu của Guardiola. \"Người Đặc Biệt\" đáp: \"Tôi muốn thắng, nhưng luôn phải là thắng công bằng và trong sạch. Nếu không thể thắng trong sạch, tôi thà thua. Hôm trước Guardiola nói rằng ông ấy đoạt sáu danh hiệu, còn tôi chỉ có ba. Nhưng tôi thắng công bằng và trong sạch. Tôi không muốn thắng khi phải đối phó với 150 cáo buộc\".</p><p>Mourinho ba lần vô địch Ngoại hạng Anh, cùng Chelsea năm 2005, 2006 và 2015. Gần cuối giai đoạn dẫn Man Utd năm 2018, ông từng giơ ba ngón tay trong họp báo, ám chỉ ba lần vô địch, khi 19 đồng nghiệp còn lại mới đăng quang tổng cộng hai lần, trong đó Guardiola sở hữu một danh hiệu.</p><p>Nhưng kể từ đó, HLV Man City giành thêm năm danh hiệu Ngoại hạng Anh. Trong trận Man City thua Liverpool 0-2 trên sân Anfield, ông bị khán giả chủ nhà giễu về khả năng bị sa thải. Đáp lại, HLV 53 tuổi giơ 6 ngón tay, ám chỉ số lần đăng quang.</p><p>Man City đang chịu 130 cáo buộc gian lận tài chính, và phiên điều trần vẫn đang diễn ra, dự kiến chưa thể có kết quả cho tới năm 2025. Đội bóng của Guardiola đang đứng trước nguy cơ phải xuống hạng.</p><p>\"Người Đặc Biệt\" đang dẫn Fenerbahce ở Thổ Nhĩ Kỳ, chuẩn bị gặp kình địch Besiktas thứ Bảy 7/12. Đoàn quân Mourinho đang có 32 điểm, chỉ ít hơn đội đầu bảng Galatasaray ba điểm, còn Besiktas đứng thứ năm với 22 điểm.</p><p>Mourinho và Guardiola đã nhiều lần đấu khẩu trước truyền thông, đặc biệt là khi họ còn làm việc ở Real Madrid và Barca thời 2010-2012. Có lúc cựu HLV Real nói rằng đồng nghiệp \"không thích bóng đá, nên mới rụng tóc\". Còn cựu HLV Barca nói đàn anh \"chỉ muốn dựng xe bus trước cầu môn\".</p><p style=\"text-align:right;\"><strong>Hoàng An</strong></p>','tranminhkhang8888@gmail.com','tranminhkhang',NULL,'Mourinho: \'Tôi thà thua còn hơn thắng không trong sạch như Man City\'','https://vnexpress.net/mourinho-toi-tha-thua-con-hon-thang-khong-trong-sach-nhu-man-city-4824790.html','\"Guardiola nhắc đến việc mình có 6 chức vô địch Ngoại hạng Anh so với 3 chức của Mourinho.  Mourinho đáp trả, nhấn mạnh rằng 3 chức vô địch của ông đều đạt được một cách công bằng, trái ngược với 150 cáo buộc gian lận mà Man City đang đối mặt.  Mourinho từng giơ 3 ngón tay ám chỉ 3 chức vô địch của mình. Guardiola gần đây giơ 6 ngón tay sau khi Man City thua trận.  Cả hai HLV từng nhiều lần khẩu chiến trước truyền thông.  Mourinho hiện đang dẫn dắt Fenerbahce.  Man City đối mặt nguy cơ xuống hạng.  Sự việc này tiếp tục làm nóng cuộc khẩu chiến lâu năm giữa hai HLV nổi tiếng.  Mourinho cho rằng thắng công bằng quan trọng hơn số lượng danh hiệu.\"','https://res.cloudinary.com/dhocs0lis/image/upload/v1733497986/xk4jcbqpb2c1r2vsorep.jpg','Mourinho: \'Tôi thà thua còn hơn thắng không trong sạch như Man City\'',NULL,'manage-the-thao','2024-12-06 22:18:16.107142'),(_binary '\0',NULL,'2024-12-06 22:16:47.223936',55,NULL,'2024-12-06 22:16:47.223936',NULL,3,NULL,NULL,'<p>Mbappe đưa bóng vào lưới ở phút 13 nhưng bàn thắng không được trọng tài công nhận vì việt vị. Sau đó, anh bị cho là \"mất tích\", đến khi bỏ lỡ cơ hội tốt ở phút 59. Tiền đạo 26 tuổi tiếp tục đá hỏng phạt đền ở phút 68, khiến Real thất bại 1-2 và lỡ cơ hội rút ngắn cách biệt với đỉnh bảng của Barca.</p><p>\"Sân San Mames đã nuốt chửng Mbappe và Thibaut Courtois\", Diario AS viết bài sau trận, ám chỉ tiền đạo Pháp phung phí cơ hội, còn thủ môn Bỉ mắc sai lầm dẫn tới bàn thua đầu tiên.</p><p>Báo Marca thì giật tít: \"Cơn ác mộng của Mbappe, khi anh bỏ lỡ phạt đền và mất tích trong trận\".</p><p>Còn báo lớn El Pais cho rằng Mbappe \"hoàn toàn không làm được gì trong hiệp một\", và \"chỉ đi bộ lang thang chứ không kết nối với đồng đội\".</p><figure class=\"image image_resized\" style=\"width:71.04%;\"><img style=\"aspect-ratio:680/408;\" src=\"https://i1-thethao.vnecdn.net/2024/12/05/mbappe-real-1733363612-8173-1733363682.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=5Rv-iBHRbMpQUyCXWiVkLA\" alt=\"Mbappe (áo trắng) sau khi sút hỏng phạt đền ở trận Real Madrid gặp Athletic trên sân San Mames, thành phố Bilbao, xứ Basque, Tây Ban Nha tối 4/12/2024. Ảnh: EFE\" width=\"680\" height=\"408\"></figure><p><span style=\"font-size:14px;\"><i>Mbappe (áo trắng) sau khi sút hỏng phạt đền ở trận Real Madrid gặp Athletic trên sân San Mames, thành phố Bilbao, xứ Basque, Tây Ban Nha tối 4/12/2024. Ảnh: EFE</i></span></p><p>Truyền thông cảm thấy khó hiểu vì Mbappe từng đá vào cả ba quả 11m (hai phạt đền, một luân lưu) trong trận chung kết World Cup 2022, nhưng lại đang hỏng ăn hai lần liên tiếp gần đây. Cú đá của anh về góc phải lần lượt bị thủ môn Liverpool và Athletic đẩy ra. Tỷ lệ sút phạt đền thành công của anh hiện chỉ còn 79%, tương ứng một cầu thủ trung bình.</p><p>Mundo Deportivo thì chỉ ra rằng đây không phải lần đầu Mbappe trượt phạt đền hai lần liên tiếp. Năm 2019, anh cũng đá hỏng hai lần trước Marseille và Nantes, khi còn chơi cho PSG.</p><p>Thủ thành Julen Agirrezabala cho biết anh đã nghiên cứu kỹ những cú sút phạt đền của Mbappe, trước trận tối 4/12. \"Tôi biết Mbappe từng sút về góc phải và hỏng ăn trước Liverpool, vì thế tôi nghĩ anh ấy sẽ tiếp tục đá về góc đó\", thủ môn 24 tuổi nói. \"May mắn là tôi đã phán đoán đúng\".</p><p>Ban đầu Jude Bellingham định sút phạt đền, nhưng sau đó trao lại cho Mbappe, như để tiếp thêm tự tin cho ngôi sao 26 tuổi. Anh tỏ ra tự tin trước khi sút, nhưng cú đá vừa thiếu lực, lại không đủ hiểm khi Agirrezabala đã bắt bài. \"Mbappe đã thể hiện một cách tệ hại nhất với một tiền đạo hàng đầu, đó là mờ nhạt suốt trận\", El Pais viết thêm.</p><p>Trong họp báo sau trận, phóng viên thậm chí hỏi HLV Carlo Ancelotti rằng liệu Mbappe đã đáp ứng được 1% kỳ vọng của ông hay chưa. HLV người Italy trả lời: \"Hơn 1% nhiều, nhưng rõ ràng cậu ấy đang không có phong độ cao nhất. Điều quan trọng là Mbappe vẫn đang cố gắng cật lực\".</p><p>Thất bại hôm qua khiến Real lỡ cơ hội rút ngắn cách biệt với đỉnh bảng Barca. Hiện, họ vẫn kém đối thủ bốn điểm và đá ít hơn một trận. Ngày 7/12, Mbappe và đồng đội làm khách của Girona ở vòng 17 La Liga.</p><p style=\"text-align:right;\"><strong>Hoàng An</strong></p>','trankhangctu@gmail.com','trankhangctu@gmail.com',NULL,'Báo Tây Ban Nha: \'Mbappe bị đối thủ nuốt chửng\'','https://vnexpress.net/bao-tay-ban-nha-mbappe-bi-doi-thu-nuot-chung-4823991.html',NULL,'https://i1-thethao.vnecdn.net/2024/12/05/mbappe-real-1733363612-8173-1733363682.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=CdTWvPa0F2sKHjktn4H7wQ','Báo Tây Ban Nha: \'Mbappe bị đối thủ nuốt chửng\'',NULL,NULL,NULL),(_binary '',1,'2024-12-06 22:22:51.498137',56,NULL,'2024-12-07 08:32:44.190255',5,2,NULL,'https://res.cloudinary.com/dztroerja/video/upload/v1733498640/news-56.mp3.mp3','<p>Đại học Quốc gia Australia (ANU) dùng điểm SAT/ACT để xét thẳng học sinh từ tất cả trường THPT của Việt Nam, thay vì chỉ ưu tiên cho nhóm trường chuyên.</p><p>Ông Andy Phạm, Quản lý cấp cao khu vực Mekong của ANU, hôm 6/12 cho biết tin này. Trước đây, ANU chỉ xét học sinh từ 92 trường chuyên và trường điểm vào thẳng đại học (trừ học sinh theo chương trình quốc tế). Nếu không, các em phải học chương trình dự bị trước khi vào năm thứ nhất. Thí sinh cần có điểm trung bình lớp 12 (từ 8,5 trở lên), chứng chỉ tiếng Anh IELTS (tối thiểu 6.5, không kỹ năng nào dưới 6) hoặc tương đương.</p><p>\"Còn bây giờ, nếu ngoài danh sách trên, học sinh cần nộp thêm điểm SAT/ACT. Trường sẽ xem xét cấp thư mời và học bổng\", ông Andy nói.</p><p>Yêu cầu điểm SAT tối thiểu là 1170/1600; ACT 23/36, tùy ngành. Một số ngành như Luật, thí sinh cần đạt SAT 1430 và ACT 33/36 trở lên.</p><figure class=\"image image_resized\" style=\"width:73.73%;\"><img style=\"aspect-ratio:680/454;\" src=\"https://i1-vnexpress.vnecdn.net/2024/12/06/dai-hoc-3033-1733455023.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=omdQSnHjL7bqLCMDlaYYwg\" alt=\"Đại học Quốc gia Australia. Ảnh: ANU\" width=\"680\" height=\"454\"></figure><p><span style=\"font-size:14px;\"><i>Đại học Quốc gia Australia. Ảnh: ANU</i></span></p><p>Lý giải sự điều chỉnh, ông Andy Phạm cho hay có hai lý do. Đầu tiên, số du học sinh từ Việt Nam đã đủ để ANU đánh giá chất lượng. Ban tuyển sinh và học thuật đã khảo sát thành tích, năng lực học tập, nhận thấy các em đạt kết quả tốt trong một năm qua. Thứ hai, Việt Nam có nhiều học sinh giỏi ở các trường THPT, không riêng trường chuyên và trọng điểm.</p><p>\"Sẽ là không công bằng khi các em này không có cơ hội nộp hồ sơ vào ANU. Vì thế, trường quyết định mở rộng tuyển sinh và yêu cầu thêm SAT/ACT\", ông nói.</p><p>ANU là một trong 8 đại học hàng đầu của Australia. Theo xếp hạng QS 2025, trường đứng thứ 30 thế giới. Học phí trung bình năm 2025 của ANU là 53.000 AUD (865 triệu đồng).</p><p style=\"text-align:right;\"><strong>Bình Minh</strong></p>','trankhangctu@gmail.com','anonymousUser',NULL,'Đại học hàng đầu Australia mở rộng tuyển học sinh Việt Nam','https://vnexpress.net/dai-hoc-hang-dau-australia-mo-rong-tuyen-hoc-sinh-viet-nam-4824518.html','\"Đại học Quốc gia Australia (ANU) mở rộng xét tuyển thẳng học sinh Việt Nam vào năm nhất.  Trước đây, ANU chỉ ưu tiên trường chuyên, nay chấp nhận hồ sơ từ tất cả trường THPT.  Điều kiện xét tuyển thẳng bao gồm điểm trung bình lớp 12 từ 8.5 và điểm SAT/ACT.  Yêu cầu điểm SAT tối thiểu là 1170/1600, ACT là 23/36.  Một số ngành có yêu cầu điểm SAT/ACT cao hơn.  ANU quyết định này dựa trên chất lượng học sinh Việt Nam và mong muốn công bằng hơn.  Việc này giúp nhiều học sinh giỏi hơn có cơ hội vào ANU.  ANU là một trong 8 đại học hàng đầu Australia. Học phí trung bình khoảng 53.000 AUD.\"','https://i1-vnexpress.vnecdn.net/2024/12/06/dai-hoc-3033-1733455023.jpg?w=1020&h=0&q=100&dpr=1&fit=crop&s=ZLskIebV_3lXdycpsMjw8w','Đại học hàng đầu Australia mở rộng tuyển học sinh Việt Nam',NULL,'admin','2024-12-06 22:23:41.644935');
INSERT INTO `news` VALUES (_binary '\0',NULL,'2024-12-07 09:56:33.821406',57,NULL,'2024-12-07 09:56:33.821406',NULL,3,NULL,NULL,'<p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Nhu cầu nhiên liệu yếu và nguồn cung tăng cao khiến các nước xuất khẩu dầu hàng đầu thế giới tiếp tục lùi thời gian tăng sản xuất.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Tuần này, Tổ chức Các nước Xuất khẩu Dầu mỏ và đồng minh (OPEC+) tổ chức họp trực tuyến từ ngày 3/12. Nguồn tin thân cận của&nbsp;</span><i><span style=\"line-height:107%;\">Reuters</span></i><span style=\"line-height:107%;\">&nbsp;cho biết các lãnh đạo OPEC+ thống nhất tiếp tục lùi kế hoạch tăng sản xuất tới tháng 4/2025. Theo dự định trước đó, họ sẽ tăng bơm dầu trở lại từ tháng 1.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Đây là lần thứ 3 liên tiếp OPEC+ lùi kế hoạch nâng sản lượng. Nguyên nhân do nhu cầu thế giới chậm lại và các nước ngoài nhóm tăng sản xuất. OPEC+ hiện đóng góp một nửa sản lượng nguồn cung dầu toàn cầu.<o:p></o:p></span></span></p><figure class=\"image\"><img style=\"aspect-ratio:561/373;\" src=\"data:image/png;base64,\" width=\"561\" height=\"373\"></figure><p><span style=\"font-size:14px;\"><i><span style=\"line-height:107%;\">Thái tử Arab Saudi Mohammed bin Salman và Tổng thống Nga Vladimir Putin. Ảnh:&nbsp;AFP</span></i></span><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\"><o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Trong cuộc họp ngày 5/12, tổ chức này quyết định gia hạn việc giảm sản xuất 2 triệu thùng (áp dụng toàn nhóm) và 1,65 triệu thùng (8 nước tự nguyện lần 1) đến hết 2026. Mốc này bị lùi một năm so với trước.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Mức giảm 2,2 triệu thùng (8 nước tự nguyện lần 2) sẽ được rút dần từ tháng 4/2025 và kết thúc vào tháng 9/2026.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">OPEC+ đã ghìm sản xuất hai năm qua, nhằm ngăn dư cung trên thị trường khiến giá giảm, gây thiệt hại cho các nước thành viên vốn phụ thuộc vào xuất khẩu dầu mỏ. Hiện tại, nhóm này cắt giảm 5,86 triệu thùng, tương đương 5,7% nhu cầu toàn cầu.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Tuy nhiên, giá dầu Brent năm nay chỉ dao động quanh 70-80 USD một thùng. Hồi tháng 9, giá còn xuống thấp nhất năm, tại 69 USD. Hiện tại, Brent giao dịch quanh 72 USD.<o:p></o:p></span></span></p><p><span style=\"font-size:12.0pt;\"><span style=\"line-height:107%;\">Đến nay, OPEC và Arab Saudi - nước dẫn đầu tổ chức này - luôn khẳng định không đặt mục tiêu giá ở mức nào. Các quyết định của họ đều dựa trên yếu tố nền tảng của thị trường và mục đích cân bằng cung - cầu. Dù vậy, theo Quỹ Tiền tệ Quốc tế (IMF), Arab Saudi cần giá quanh 100 USD để cân bằng ngân sách. Thái tử Mohammed bin Salman đang tìm nguồn vốn cho các siêu dự án nhằm cải tổ kinh tế quốc gia này.<o:p></o:p></span></span></p><p style=\"text-align:right;\"><span style=\"font-family:&quot;Times New Roman&quot;,serif;font-size:12.0pt;\"><span style=\"line-height:107%;\"><strong>Hà Thu</strong></span></span></p>','tranminhkhang8888@gmail.com','tranminhkhang8888@gmail.com',NULL,'OPEC+ lại hoãn tăng bơm dầu','',NULL,'https://res.cloudinary.com/dhocs0lis/image/upload/v1733540038/tqopjgyfrtkwxfbklyed.jpg','OPEC+ lại hoãn tăng bơm dầu',NULL,NULL,NULL);
